M.Data[1] = {"Faction",true,"一周为一个工会战赛季。赛季分为3个阶段：\n积分排位赛\n1.积分排位赛时间为周一至周五晚上24:00。\n2.会长和副会长报名参加工会战。\n3.公会战报名等级需要大于12级,参战队伍不少于10支,部超过15支。\n4.会长和副会长可调整参战队伍和出站顺序。\n5.会长和副会长可隐藏3支队伍的信息。\n6.会长和副会长可匹配对手,每次刷新对手时间间隔为10秒。\n7.每3小时回复1点工会战体力,对战消耗1点体力。\n8.每支队伍最多出战3次。\n9.每场战斗胜利获得单场战斗积分,公会获得排名积分。\n10.公会战斗,无论胜败都获得积分。胜利战斗次数越多,战斗后存活队伍越多,对战公会越靠前,获得积分越多。\n11.公会战结束后按排名发放奖励。","Faction","Faction",}
