M.Data[360514] = {"Passive Fgt.: Wenn LP 50% unterschreiten, erleiden alle Feinde 50% Angriffsschaden. Alle Helden regenerieren 5% der max. LP. (Nur 1-mal anwendbar)",true,"被动技能：生命低于50%时，对所有敌方造成50%攻击伤害，并且恢复所有友军5%最大生命。（只触发1次）","Passive Skill: When HP is below 50%, deals damage (50% of Attack) to all enemies and heals all allies HP (5% of MaxHP) (Can be triggered once only per battle).","สกิลพาสซิฟ: เมื่อ HP ต่ำกว่า 50% จะทำให้ศัตรูทั้งหมดเกิดความเสียหาย (50% ของพลังโจมตี) และฟื้นฟู HP ให้ทีมตัวเองทั้งหมด (5% ของค่า Max HP) (ปล่อยสกิลได้เพียง 1 ครั้ง)",}
M.Data[40026] = {"Wetteinsatz\n\n1. Im Gildenmachtkampf können Spieler Wetten auf die Platzierung der Gilden abschließen.\n\n2. Solange die jeweilige Gilde die gewettete Platzierung oder eine bessere erreicht, erhältst du eine Wettbelohnung.\n\n3. Bei einer erfolgreichen Wette erhältst du eine Belohnung (per Nachricht). Liegst du daneben, erhältst du nichts.",true,"投注说明\n\n1.王者公会争霸赛期间玩家可选择投注竞猜公会名次。\n\n2.只要投注的公会最终名次大于等于竞猜的名次，则竞猜成功。\n\n3.竞猜成功获得相应奖励（通过邮件发放）；失败无奖励。","Bet Rules\n\n1. You can bet on a team\'s Finals\' ranking during the Guild War Finals.\n\n2. As long as the actual ranking is not lower than the bet one, the bet is successful.\n\n3. A successful bet grants a corresponding reward by mail; a failed one grants no reward.","กฎการเดิมพัน\n\n1.ในช่วงเวลาของศึกชิงแชมป์ราชากิลด์ ผู้เล่นสามารถเลือกเดิมพันทายผลอันดับกิลด์ในรอบตัดสินได้\n\n2.โดยอันดับกิลด์ในรอบตัดสินนั้นจะต้องสูงกว่าหรือเท่ากับอันดับที่ทาย จึงจะถือว่าทายผลสำเร็จ\n\n3.เมื่อทายผลสำเร็จ จะได้รับรางวัล (รางวัลจะถูกส่งให้ทางจดหมาย);หากทายผลผิด;ก็จะไม่ได้รับรางวัล",}
