M.Data[40027] = {"Punkteregeln\n\n1. Beim Sieg in einem einzelnen Kampf erhältst du 48 Punkte.\n\n2. Beim Sieg in einer Runde erhältst du 240 Punkte. Bei Niederlagen gibt es keinen Punkteabzug.\n\n3. Für jedes Team, das bis zum Ende des Kampfes nicht das Schlachtfeld betritt,erhält man 96 Punkte.\n\n4. Das im Einzelkampf siegreiche Team tritt gegen das nächste gegnerische Team an. Jedes Team kann maximal 3-mal pro Runde antreten.",true,"积分规则\n\n1.单场战斗获胜方积48分。\n\n2.每轮获胜方积240分，失败均不扣分。\n\n3.一轮结束后出战但未上场的队伍每支积96分。\n\n4.单场获胜队伍继续与对手下一支队伍战斗，每支队伍在一轮对战中最多出战3次。","Score Rules\n\n1. Each single battle victory grants 48 scores.\n\n2. Each round victory grants 240 scores. No scores are deducted for defeats.\n\n3. The team which is dispatched but doesn\'t join in any battles in a round wins 96 scores.\n\n4. Battle winner continues to fight with rival\'s next team, but each team can engage up to 3 teams each round.","กฎการให้คะแนน\n\n1.ในการต่อสู้แต่ละครั้ง ฝ่ายที่ชนะจะได้รับ 48 คะแนน\n\n2.ในการต่อสู้แต่ละรอบ ฝ่ายที่ชนะจะได้รับ 240 คะแนน ฝ่ายที่แพ้จะไม่ถูกหักคะแนน\n\n3.หลังจากจบ 1 รอบ ผู้ที่ถูกส่งแต่ไม่ได้ร่วมต่อสู้ในสนามจะได้ 96 คะแนน\n\n4.ทีมที่ชนะจากการต่อสู้ จะได้สู้ต่อกับคู่แข่งทีมต่อไป โดยแต่ละทีมจะถูกส่งได้สูงสุด 3 ครั้งต่อ 1 รอบ",}
