M.Data[40019] = {"Wenn du eine Monatskarte für 30 Tage gekauft hast, erhältst du sofort 750 Juwelen und 750 VIP-Erfahrung. \n\nIn den nächsten 30 Tagen erhältst du täglich 300 Juwelen per Nachricht. \n\nAußerdem erhältst du täglich die VIP-Tagesbelohnung. \n\nInsgesamt gibt es 9750 Juwelen! Hol dir dieses Angebot!",true,"当你购买30天月卡后,你会立即获得750钻石和750VIP经验。\n\n在之后的30天内,每天将可以在邮箱中收取300钻石。\n\n购买月卡后还能获得VIP每日奖励\n\n总共有9750钻石,快来得到这个超值的商品吧！","Upon purchase, you will receive 750 Gems and 750 VIP EXP immediately.\n\nYou can claim 300 Gems daily from in-game mail for 30 days.\n\nYou\'ll also get VIP daily reward.\n\nIt contains a total of 9,750 Gems! The best deal!","หลังจากที่คุณซื้อบัตรเดือน 30 วัน คุณจะได้รับ 750 เพชรและ 750 VIP EXP ทันที\n\nนอกจากนั้นภายใน 30 วัน ยังจะได้รับ 300 เพชรทุกวัน โดยกดรับได้ที่กล่องจดหมาย\n\nหลังจากซื้อบัตรเดือนแล้วยังจะได้รับรางวัลประจำวัน VIP\n\nรวมรางวัลมูลค่าทั้งสิ้น 9750 เพชร รีบๆมาจับจองรางวัลสุดคุ้มนี้กันเถอะ !",}
