M.Data[40021] = {"1. In der Gildenmine findest du Gold und Gildenmünzen. \n\n2. Je höher das Gildenlevel, desto höher die Produktion. \n\n3. Je höher das Level der Minenbestellungen, desto einfacher ist es, Bestellungen mit höherem Level zu erhalten. \n\n4. Mitglieder können mit Goldspenden das Bestellungslevel erhöhen.",true,"1.公会矿脉中可以挖掘出金币和公会币资源\n\n2.公会等级越高矿脉获得的单位时间产出越多\n\n3.矿脉订单等级越高,越容易获得高等级的订单\n\n4.公会成员捐赠金币可以提升订单等级","1. Gold and Guild Coins can be dug from the Guild Mine.\n\n2. The higher the guild level, the higher the yield per unit time.\n\n3. The higher level the Mine, the more easily you get high level orders.\n\n4. Guild Members can donate Gold to increase Mine level.","1.เหมืองกิลด์ ใช้สำหรับขุดเจาะเพื่อหาทองและเหรียญกิลด์\n\n2.เลเวลกิลด์ยิ่งเยอะ ผลผลิตที่ได้จากเหมืองกิลด์ก็ยิ่งมาก\n\n3.เลเวลออเดอร์เหมืองกิลด์ยิ่งสูง ยิ่งได้รับออเดอร์เลเวลสูงง่ายขึ้น\n\n4.สมาชิกกิลด์สามารถช่วยบริจาคทองเพื่อเพิ่มเลเวลของออเดอร์เหมืองกิลด์ได้",}
