M.Data[40022] = {"Kampfregeln\n\n1. Spieler können beim Systemstart die Defensivformation einstellen. Es werden 3 Heldenteams eingestellt, jedes Team besteht aus mind. 1 Helden.\n\n2. Der Kampf besteht aus 3 Runden. Für den Sieg musst du 2 Runden gewinnen.\n\n3. Du gewinnst, wenn du alle Feinde des Gegnerteams besiegt hast.\n\n4. In der Arena gibt es max. 15 Runden. Der Angreifer verliert, wenn 15 Runden überschritten werden.\n\n5. Nach dem Kampf werden Punkte verteilt, auf deren Basis eine Rangliste erstellt wird.\n\nBelohnungsregeln\n\nAuf Basis der Rangplatzierung erhältst du eine Belohnung per Nachricht.",true,"战斗规则\n\n1.玩家可以在系统开启时调整自己的防守阵容，需设置3队英雄，每队至少1人\n\n2.战斗采取3战2胜制，先胜利2场者胜出\n\n3.击败对方全部英雄获得一场战斗胜利\n\n4.竞技场战斗限定15回合，战斗超过15回合，则进攻方失败\n\n5.战斗后有积分计算，积分作为玩家的排名依据\n\n奖励规则\n\n结束后根据排名以邮件的方式发放","Battle Rules\n\n1. After the contest starts, players should set up 3 defense lineups, each of which must include at least 1 hero.\n\n2. The battle is a best-of-three playoff. The player who gains 2 victories wins.\n\n3. Defeat all opponent heroes to win a battle.\n\n4. Each Arena battles lasts up to 15 rounds. The attacker loses once the limit is reached.\n\n5. Players will be ranked by ranking scores gained from the battle.\n\nReward Rules\n\nThe rewards will be sent by mails after the contest ends.","กฎการต่อสู้\n\n1.เมื่อระบบเปิดทำการ ผู้เล่นสามารถปรับแต่งทีมป้องกันของตัวเองได้ 3 กองทัพ แต่ละกองทัพต้องมีฮีโร่อย่างน้อย 1 คน\n\n2.การต่อสู้จะใช้กฎแบบชนะ 2 ใน 3 ผู้ที่เอาชนะได้ 2 ครั้งก่อนก็จะเป็นผู้ชนะ\n\n3.โดยจะต้องกำจัดฮีโร่ของฝั่งตรงข้ามให้ครบทุกตัวถึงจะชนะ\n\n4.การต่อสู้ในอารีน่าจะจำกัดที่ 15 รอบ เมื่อฝ่ายโจมตีเล่นจนเกิน 15 รอบ จะถูกปรับแพ้ทันที\n\n5.หลังจากต่อสู้เสร็จสิ้น ก็จะคำนวณคะแนนและอันดับให้กับผู้เล่น\n\nเงื่อนไขรางวัล\n\nรางวัลที่ได้รับจะอิงตามอันดับของผู้เล่น และจะถูกส่งไปทางจดหมายเมื่อเวลาการแข่งขันสิ้นสุดลง",}
