M.Data[40023] = {"1. 24 Stunden nach dem Start der Prüfung wird sie geschlossen. Nach weiteren 24 Stunden wird sie erneut gestartet.\n\n2. Die Prüfung ist in 5 Arten unterteilt, die auf die Helden der verschiedenen Lager abzielen. Helden begeben sich in Prüfungsraubzüge, um Kreaturen als Belohnung zu erhalten.\n\n3. Sobald eine gewissen Anzahl an Ebenen in der Prüfung erreicht wurde, erhältst du eine Etappen-Belohnung für die jeweilige Prüfung. Die Etappen-Belohnung wird nicht zurückgesetzt.\n\n4. Wenn eine bestimmte Anzahl an Ebenen in der Prüfung erreicht wurde und du nochmals diese Prüfung durchführst, wird auf Basis der gewonnen Ebenen Auto-Kampf aktiviert und eine Raubzugbelohnung versandt. Nach dem Ende des Auto-Kampfs kämpfst du in den übrigen Ebenen weiter.\n\n5. Alle 5 Ebenen triffst du auf den Prüfungshändler, der dir zufällig alle möglichen Waren anbietet. Die Waren des Tages werden im Sortiment des Prüfungshändlers zusammengefasst. Innerhalb des Prüfungszeitraums kannst du jederzeit bei im einkaufen.\n\n6. Die 5 Arten der Prüfung haben auch 5 verschiedene Ranglisten. Nach dem Ende der Prüfung erhält der siegreiche Spieler einen zeitbegrenzten Porträtrahmen als Belohnung. Dieser bleibt bis zum Ende der nächsten Prüfung.",true,"1.英雄试炼开启24小时后关闭，间隔24小时再次开放\n\n2.试炼分为5种，分别限制不同阵营的英雄进入试炼副本挑战，可获得丰厚的宠物资源奖励\n\n3.当试炼进行到一定关卡数量，可根据5种不同试炼分别获得阶段性奖励，阶段性奖励不会重置\n\n4.当某一种试炼进行到一定关卡数量，再次轮到该试炼时，将以玩家所战胜的关卡数为依据进行自动战斗并发放副本战胜奖励。自动战胜后玩家则继续挑战剩下的关卡\n\n5.试炼中每通过5个关卡会遇到试炼商人，将随机出现各种商品。当日的商品会汇总到试炼商店中，在本次试炼时间内都可以随时购买\n\n6.5种试炼有5种不同的排行榜。在某试炼结束时，通关排名第一的玩家将会获得限时的头像框奖励。时限为下次该试炼的结束时间。","1. Each Heroic Trial opens for 24 hours, and the next one will open 24 hours after the current one ends.\n\n2. There are 5 types of trials, each of which is limited to the heroes of specified factions. Successful challenges grant abundant Minion resources.\n\n3. Stage rewards are granted at certain stages in 5 different trials respectively. Each stage reward can only be claimed once.\n\n4. If you have reached a certain stage, you can reach this stage by auto-battle in the next trial of this type. The rewards will be gained accordingly. After auto-battle, you can continue to challenge the next stages.\n\n5. The Trial Merchant who offers random items appears every 5 stages. These items can be bought from the Trial Shop at any time during the current trial.\n\n6. Each of the 5 types of trial has its own ranking. The player who wins the 1st place will be rewarded with a limited-time frame, which lasts until the next trial of this type ends.","1.การฝึกฮีโร่จะเปิดเป็นเวลา 24 ชั่วโมงแล้วจะปิดลง จากนั้นต้องรออีก 24 ชั่วโมงถึงจะเปิดรอบต่อไป\n\n2.การฝึกฮีโร่จะแบ่งออกเป็น 5 ประเภท โดยแต่ละประเภทจะจำกัดธาตุฮีโร่ที่จะเข้าร่วมท้ารบในดันเจี้ยน เมื่อชนะจะได้รับรางวัลวัตถุดิบสำหรับสัตว์เลี้ยงมากมาย\n\n3.เมื่อฝึกจนถึงจำนวนด่านที่กำหนด จะได้รับรางวัลที่แตกต่างกันไปตามด่านการฝึกฮีโร่แต่ละประเภท โดยแต่ละรางวัลด่านจะสามารถรับได้เพียงครั้งเดียวเท่านั้น\n\n4.เมื่อแต่ละการฝึกฝนถึงด่านที่กำหนด และเวียนมาถึงการฝึกเดิมอีกครั้ง ด่านที่ผู้เล่นเคยเอาชนะแล้วทั้งหมดจะเปิดระบบการต่อสู้ออโต้ขึ้นและให้รางวัลจากดันเจี้ยน หลังจากการต่อสู้ออโต้ ผู้เล่นก็จะสามารถเข้าต่อสู้ในด่านต่อไปได้\n\n5.ในการฝึกฮีโร่เมื่อผ่านทุกๆ 5 ด่านจะเจอกับพ่อค้าที่จะนำสินค้ามาขายแบบสุ่ม โดยสินค้าในวันนั้นจะถูกรวมเข้ากับร้านค้าฝึก และสามารถซื้อสินค้าได้ตลอดเวลาในช่วงเวลาที่ฝึกฮีโร่อยู่\n\n6.การฝึกฮีโร่มีทั้งหมด 5 ประเภท ตารางอันดับคะแนนของแต่ละประเภทจะไม่เหมือนกัน เมื่อการฝึกแต่ละประเภทสิ้นสุดลง ผู้เล่นที่อยู่ในอันดับ 1 จะได้รับกรอบรูปโปรไฟล์แบบจำกัดเวลา โดยสามารถใช้ได้จนถึงสิ้นสุดการฝึกฮีโร่ในครั้งต่อไป",}
