M.Data[360637] = {"Aktive Fgt.: Verursacht bei allen Feinden in der hinteren Reihe 150% Angriffsschaden. Heilt LP i. H. v. 56% des Angriffsschadens bei Helden der vorderen Reihe. ANG -30% bei Wanderer-Typ. Dauer: 2 Runden. ",true,"主动技能：对所有后排敌人造成150%攻击伤害,使所有前排友军恢复56%攻击的等量生命,降低敏捷型目标30%攻击,持续2回合","Active Skill: Deals damage (150% of Attack) to all back-line enemies, heals all front-line allies (56% of Attack) and reduces Agility enemies\' Attack by 30% for 2 rounds.","สกิลแอคทีฟ: ทำให้ศัตรูแถวหลังทั้งหมดเกิดความเสียหาย (150% ของพลังโจมตี) ทำให้ทหารแถวหน้าทั้งหมดฟื้นฟู HP (56% ของพลังโจมตี) พร้อมทั้งลดพลังโจมตีเป้าหมายประเภท นักผจญภัย 30% ต่อเนื่อง 2 รอบ",}
