M.Data[360630] = {"Passive Fgt.: ESD+15%, ANG+15%",true,"被动技能：真实伤害+15%,攻击+15%","Passive Skill: True Damage +15%, Attack +15%.","สกิลพาสซิฟ: True.DMG +15% ATK +15%",}
M.Data[40024] = {"Aktionsregeln\n1. Im Kreuzzug fordern Spieler einen starken Boss heraus.\n\n2. Jede Herausforderung kostet 1 Ticket. Tickets können im Auto-Kampf gefunden oder mit Juwelen gekauft werden. Maximal kannst du 80-mal Tickets kaufen.\n\n3. Der beim Boss verursachte Schaden wird in der Rangliste abgebildet. Auf Basis der Rangliste wird am Ende der Aktion eine Belohnung versandt. Alle Teilnehmer erhalten am Aktionsende eine Belohnung.\n\n4. Wenn der Boss besiegt wurde, taucht der nächste Boss auf. Dies geht so weiter, bis die Aktion endet.\n\nKampfregeln\n1. Es können 1 bis 30 Helden aufgestellt werden.\n\n2. In der Formation repräsentiert jede Linie von Helden ein Team.\n\n3. Nach Kampfende kannst du eine Belohnung wählen, egal, ob du gewonnen oder verloren hast.\n\n4. Wird der Boss besiegt, so wird eine Belohnung per Nachricht versandt.\n\n5. Immer wenn du einen Boss schon einmal herausgefordert hast, kannst du die „Überspringen“-Funktion im Kampf nutzen.",true,"活动规则\n1、讨伐战活动开启期间玩家可以向强大的boss发起挑战\n\n2、每次挑战消耗1个挑战门票，门票可以通过挂机掉落，钻石购买，最大可购买80次\n\n3、对boss造成的伤害记录在排行榜中，活动结束时根据排名进行奖励发放。参与过战斗的玩家都可在活动结束时获得奖励。\n\n4、当前boss被击杀后，会出现下一名boss，直到活动结束\n\n战斗规则\n1、布阵时可选择1-30名英雄上阵\n\n4、布阵时每一行英雄代表对应的队伍\n\n5、战斗结束后不论胜败都有抽奖奖励\n\n6、击杀boss后将会获得奖励，通过邮件发放\n\n7、每个boss战进行过1次战斗后，可以使用”跳过战斗”功能。","Event Rules\n1. After the event starts, powerful Bosses will appear for players to challenge.\n\n2. Each challenge requires 1 Challenge Ticket which can be gained from auto-battle or purchased by Gems. You can purchase the Ticket up to 80 times.\n\n3. All participants are ranked according to their damage dealt to the Boss and will be rewarded accordingly when the event ends.\n\n4. A new Boss will appear after the current one is killed. It continues so until the end of the event.\n\nBattle Rules\n1. 1-30 heroes can be deployed in the lineup.\n\n2. Each row of heroes in the lineup represents a corresponding team.\n\n3. Each battle grants a reward no matter victory or defeat.\n\n4. Defeating Bosses grants kill rewards by mails.\n\n5. You can use \"Skip Battle\" feature after you fight each Boss for the first time.","เงื่อนไขกิจกรรม\n1.หลังจากที่กิจกรรมสงครามครูเสดเริ่มขึ้น จะปรากฏ Boss สุดทรงพลังเพื่อให้ผู้เล่นได้ท้ารบ\n\n2.ในการเข้าร่วมแต่ละครั้งจะต้องใช้ตั๋วท้ารบ 1 ใบเพื่อเข้าร่วม ตั๋วท้ารบสามารถหาได้จากการดรอปในการต่อสู้ออโต้ หรือซื้อด้วยเพชร โดยสามารถซื้อได้สูงสุด 80 ครั้ง\n\n3.ความเสียหายที่ทำได้จะถูกบันทึกลงในสถิติตารางอันดับ ผู้เล่นที่ได้เข้าร่วมท้ารบจะได้รางวัลเมื่อกิจกรรมสิ้นสุดลง โดยจะแจกรางวัลตามอันดับของผู้เล่น\n\n4.หลังจากที่ Boss ถูกกำจัด ก็จะเกิด Boss ตัวใหม่ขึ้น และจะเป็นแบบนี้ต่อไปเรื่อยๆจนกว่ากิจกรรมสิ้นสุดลง\n\n กฎการต่อสู้\n\nกฎการต่อสู้\n1.เลือกฮีโร่ 1 - 30 ตัวลงสนาม\n\n4.ขณะจัดทีม ฮีโร่แต่ละแถวเป็นตัวแทนของทีมดังกล่าว\n\n5.หลังจากการรบสิ้นสุด ทั้งฝ่ายที่แพ้และฝ่ายที่ชนะก็จะได้รับรางวัลทั้งสองฝ่าย\n\n6.หลังจากกำจัด Boss สำเร็จจะได้รับรางวัลผ่านทางจดหมาย\n\n7.ทุกๆ 1 ครั้งที่ผ่านการต่อสู้ Boss ในแต่ละตัว คุณจะสามารถใช้ฟังก์ชัน \"ข้ามต่อสู้\" ได้",}
