M.Data[40025] = {"Aktionsregeln\n\nDuellregeln\n\n1. Im Legionsduell werden Kämpfe mit 2 Runden durchgeführt.\n\n2.Teilnehmer: Ausgewählt aus den Top 50 der letzten Legionsliga.\n\n3. 3 Tage nach dem Aktionsbeginn startet die erste Runde. 6 Tage später startet die zweite Duellrunde. Nach dem Ende der ersten Runde, werden sofort die Kontrahenten der zweiten Runde gewählt.\n\n4. Formieren und Wetten müssen 10 min vor Kampfbeginn abgeschlossen sein.\n\n5. Jedes Duell ist in 2 Gruppen unterteilt. In jeder Gruppe kämpfen jeweils 5 Spieler Seite an Seite gegen eine andere Gruppe mit 5 Spielern. Jeder Sieg bringt 1 Punkt. Niederlagen bringen keine Punkte. Nach dem Kampfende gewinnt die Gruppe, die mind. 3 Punkte erreicht hat.\n\nWettregeln\n1. Nach der Teilnehmerauswahl können alle Spieler ihre Wetten auf den Ausgang der aktuellen Runde abgeben (d. h. in der ersten Runde kannst du keine Wette für die zweite Runde abgeben.)\n\n2. Wetten können nur bezüglich Sieg oder Niederlage der 2 Gruppen abgegeben werden. Die Wette benötigt einen Arenaschein.\n\n3. In jeder Runde darf jeder Spieler nur 1-mal wetten. Mit Juwelen kann aber die Wette geändert werden.",true,"活动规则\n\n对决规则\n\n1.军团对决活动开启期间总共进行2轮战斗。\n\n2.参战选手：从最近一次军团之征前50名中选取。\n\n3.活动开始后3天进行第一轮对决。6天后进行第二轮对决。第一轮对决结束后，立即选取第二轮参战玩家。\n\n4.布阵与竞猜操作将在战斗前10分钟截至。\n\n5.每轮对决分为2组，每组有5个玩家分别对抗对方5个玩家，每个玩家对决获胜该玩家小组得1分，战败不得分。战斗结束后，双方小组任意达到3分以上的获得胜利。\n\n竞猜规则\n1.每一次选出参战者后所有玩家即可开始竞猜，仅能对于当前轮数的对决进行竞猜（在第一轮竞猜中不可竞猜第二轮的结果）\n\n2.竞猜内容为2组玩家的胜负，选择第一组或第二组玩家胜利，使用竞技场券竞猜。\n\n3.每一轮每个玩家只能竞猜1次，可通过花费钻石改变竞猜的小组。","Event Rules\n\nBattle Rules\n\n1. Each contest has two rounds of battles.\n\n2. Participants will be selected from the top 50 players of the most recent Legion League.\n\n3. The first round of battles will be held 3 days after the contest starts. The second round will be held 6 days after the contest starts. Following the first round, the players who are to join the second round will be selected immediately.\n\n4. Lineup setup and betting operations will become unavailable 10 minutes before the battle.\n\n5. Each round\'s participants are divided into two groups, each group has 5 players battling against other 5 players. Each victory grants 1 group score, while a defeat does not earn scores. At the end of the battle, the group who earns at least 3 scores will be the winner.\n\nBetting Rules\n1. All players can begin to bet after the participating players are selected each time (can only bet for the result of the current round).\n\n2. Players can bet on the outcome (Win or Lose) of the 2 groups with Arena Tickets.\n\n3. Each player can only bet once per round. The betting can be altered afterwards by using Gems.","เงื่อนไขกิจกรรม\n\nเงื่อนไขการต่อสู้\n\n1.ช่วงเวลาเปิดกิจกรรมกองทัพพิชิตศึกจะแบ่งออกเป็น 2 รอบ\n\n2.ผู้เล่นที่เข้าร่วมรบ: คัดเลือกจากผู้เล่น 50 อันดับแรกของศึกพันธมิตรล่าสุด\n\n3.หลังจากเริ่มกิจกรรมได้ 3 วัน จะเริ่มการต่อสู้ในรอบที่ 1 หลังจากเริ่มกิจกรรมได้ 6 วัน จะเริ่มการต่อสู้ในรอบที่ 2 โดยหลังจากการต่อสู้ในรอบที่ 1 สิ้นสุด จะเลือกผู้เล่นที่จะได้ไปแข่งขันในรอบที่ 2 ทันที\n\n4.การจัดทีมและการทายผลจะหมดเขตก่อนการต่อสู้จะเริ่ม 10 นาที\n\n5.แต่ละรอบการต่อสู้จะแบ่งออกเป็น 2 กลุ่ม แต่ละกลุ่มจะมีผู้เล่น 5 คน และทีมตรงข้ามอีก 5 คน ทีมที่ชนะจะได้รับคะแนนทีม 1 คะแนน ส่วนทีมที่แพ้จะไม่ได้รับคะแนน หลังจากการต่อสู้สิ้นสุดลง ทีมไหนที่ได้ 3 คะแนนก่อนก็จะเป็นผู้ชนะ\n\nกฎการทายผล\n1.เมื่อเลือกผู้เข้าร่วมการต่อสู้เรียบร้อยแล้ว ก็จะสามารถเริ่มทายผลได้ โดยจะทายผลได้เฉพาะในรอบใดรอบหนึ่งเท่านั้น (หากทายแล้วในรอบที่ 1 จะไม่สามารถทายผลในรอบที่ 2 ได้)\n\n2.สิ่งที่จะทายคือผลแพ้ชนะของทั้ง 2 ทีม โดยเลือกว่าทีมที่ 1 หรือทีมที่ 2 จะชนะ โดยจะต้องใช้ตั๋วอารีน่าในการทายผล\n\n3.แต่ละรอบ ผู้เล่นจะทายผลได้เพียง 1 ครั้งเท่านั้น และสามารถใช้เพชรเปลี่ยนแปลงผลที่ทายได้",}
