M.Data[40011] = {"1. Wähle einen Helden, dessen Sternenlevel erhöht werden soll. Füge genug Materialhelden hinzu. Wenn alle Bedingungen erfüllt sind, kannst du das Sternenlevel erhöhen.\n\n2. Mehr Sterne verleihen dir verbesserte Attribute und Fähigkeitseffekte.\n\n3. Nach der Sternerhöhung behalten Helden ihr Level, ihren Rang und ihre Ausrüstung.\n\n4. Die verbrauchten Materialhelden werden in Lila Seelen sowie Goldene Seelen verwandelt und im Inventar abgelegt. Die Ausrüstung wird auch in das Inventar gelegt.",true,"1.选择一个可升星的英雄,再放入指定材料英雄,满足条件后可为指定英雄升星。\n\n2.升星英雄将保留其等级、阶级、装备。\n\n3.被消耗的材料英雄将返还对应价值的紫魂和金魂到背包。穿戴的装备将放入背包。\n\n4.升星后的英雄将获得更强的属性和技能效果。","1. Select one host hero and add material heroes to increase the star level of the host hero if the requirements are met.\n\n2. Hero star-up increases hero stats and enhances skills.\n\n3. The host hero will keep the level, rank and gears.\n\n4. The material heroes will be converted into Golden Souls and Purple Souls accordingly, which will be returned to the Bag together with their equipped gears.","1.เลือกฮีโร่ 1 ตัวที่สามารถอัพดาวได้ จากนั้นเลือกวัตถุดิบฮีโร่ที่กำหนด หลังจากทำครบตามเงื่อนไขทั้งหมดแล้วก็จะสามารถอัพดาวให้กับฮีโร่ได้\n\n2.หลังจากอัพดาวฮีโร่สำเร็จ สเตตัสและเอฟเฟกต์สกิลของฮีโร่ก็จะเพิ่มขึ้น\n\n3.หลังอัพดาวฮีโร่ เลเวล ระดับคุณภาพ และอุปกรณ์ของฮีโร่ที่ได้ทำการอัพดาวจะยังคงเหมือนเดิม\n\n4.วัตถุดิบฮีโร่ที่ถูกใช้จะถูกคืนเป็นวิญญาณม่วงและวิญญาณทองไปที่กระเป๋าพร้อมกับอุปกรณ์ที่สวมใส่",}
