M.Data[40012] = {"1. Das Roulette wird alle 24 Std. um 0 Uhr aktualisiert. Eine manuelle Aktualisierung ist möglich. Dann wird die nächste Aktualisierung 24 Std. nach der manuellen durchgeführt.\n\n2. Verwende Roulettemünzen I, um das Roulette zu starten. Du kannst Heldenteile, Ausrüstung, Artefakte u.v.m. gewinnen.\n\n3. Bei einem Zug erhältst du 10 Glücksmünzen, womit du im Glücksladen Heldenteile kaufen kannst.\n\n4. Roulettemünzen I kannst du direkt mit Juwelen kaufen. Du kannst sie auch auf dem Markt gegen Gold oder Juwelen kaufen, in Paketen finden oder in Aktionen gewinnen.",true,"1.幸运转盘每天24小时自动刷新一次,若手动刷新后,将重置幸运转盘刷新时间。\n\n2.在幸运转盘可以消耗赌场券进行抽奖,有概率获得英雄碎片、装备、神器等道具。\n\n3.抽奖一次将获得10个幸运币,可以在幸运商店使用幸运币兑换英雄碎片、装备等道具。\n\n4.转盘币可以通过钻石快速购买、在市场使用金币或钻石购买、购买礼包活动、特定活动领取等方式获得。","1. The Roulette refreshes at 0 o\'clock (UTC/GMT+0) everyday. You can manually refresh the Roulette, which will set the next auto refreshing to 24 hours later.\n\n2. Roulette Coins can be used to spin the Roulette and gain Hero Shards, gears, Artifacts and other rewards.\n\n3. Each spin grants 10 Lucky Coins, which can be used to purchase items in Luck Shop.\n\n4. Roulette Coins can be purchased using Gems or Gold from the Shop, or found in Event Packs or special events.","1.รูเล็ตนำโชคจะรีเฟรชอัตโนมัติ 1 ครั้งทุกๆ 24 ชม. หรือทุกๆ 00:00 น.ของทุกวัน สามารถรีเฟรชรูเล็ตเองได้ ซึ่งหากรีเฟรชรูเล็ตเองจะรีเฟรชอัตโนมัติครั้งต่อไปในอีก 24 ชม.\n\n2.รูเล็ตนำโชคจะต้องใช้เหรียญรูเล็ตในการหมุนรางวัล โดยรางวัลที่มีโอกาสดรอปได้แก่ เศษฮีโร่ อุปกรณ์ อาวุธเทพและไอเทมอื่นๆ\n\n3.หมุนรางวัล 1 ครั้งจะได้รับเหรียญโชคดี 10 เหรียญ สามารถใช้เหรียญโชคดีแลกเศษฮีโร่ อุปกรณ์ และไอเทมอื่นๆที่ร้านโชคดีได้\n\n4.เหรียญรูเล็ตสามารถหาได้จากการซื้อด้วยเพชรหรือทองจากร้านค้า จากการซื้อแพ็กเกจกิจกรรม หรือสามารถหาได้จากกิจกรรมพิเศษ",}
