M.Data[40015] = {"1. Mit Yggdrasilteilen kannst du einen Helden in einen anderen Helden des gleichen Lagers mit gleichem Stern-Lv. umwandeln.\n\n2. Wenn du mit dem Ergebnis nicht zufrieden bist, kannst du deinen ursprünglichen Helden behalten. Die Yggdrasilteile erhältst du aber nicht zurück.\n\n3. Gesperrte und in der Arenaformation befindliche Helden können nicht umgewandelt werden. Nur Helden mit 4 oder 5 Sternen sind umwandelbar.Helden des Licht-Lagers sind nicht umwandelbar.\n\n4. Beim Umwandeln kannst du fusionierte 5-Sterne-Helden erhalten.\n\n5. Der umgewandelte Held behält Folgendes bei: Level, Rang, Ausrüstung, Trank, Artefakt.\n\n6. Der umgewandelte Held und dessen Informationen können eingesehen werden. Die angezeigten Attribute entsprechen dem Helden auf Lv. 1 und dienen nur der Orientierung.",true,"1.消耗置换碎片,可以将英雄置换为同阵营、同星级的其他英雄。\n\n2.对置换结果不满意,可以通过取消保留原英雄。但消耗的置换碎片不会返还。\n\n3.被锁定以及竞技场上阵的英雄无法进行置换,只能置换4星和5星英雄,光暗阵营的英雄无法置换。\n\n4.置换可以获得合成的5星英雄。\n\n5.置换成功可以将原英雄的等级、品阶、装备、强化剂、神器转移至新英雄。\n\n6.置换出的英雄可以查看其相关信息,查看到的属性为英雄1级时的属性,仅供参考。","1. A hero can be converted into other heroes of the same star level from the same faction by consuming World Tree Shards.\n\n2. The conversion can be cancelled if the result is not satisfying enough, but the consumed Shards will not be returned.\n\n3. Locked heroes and heroes in the Arena defense lineup can\'t be converted. Only 4-star and 5-star heroes (except for Light and Dark heroes) can be converted.\n\n4. Conversion may produce the 5-star heroes that can only be gained from the Temple.\n\n5. Conversion will transfer the level, rank, gears, Potion, and Artifact of the original hero to the new one.\n\n6. Details of the new hero can be viewed (stats shown are based on level 1 hero and only for reference).","1.เศษแปลง ใช้สำหรับแปลงฮีโร่โดยจะได้ฮีโร่ที่ระดับดาวเท่ากันและเป็นธาตุเดียวกัน\n\n2.หากไม่พอใจกับผลการแปลง สามารถยกเลิกและเก็บรักษาฮีโร่ตัวเดิมไว้ได้ แต่เศษแปลงที่ใช้ไปนั้นจะไม่ได้รับคืน\n\n3.ฮีโร่ที่ถูกล็อกและฮีโร่ที่อยู่ในทีมป้องกันในอารีน่าจะไม่สามารถแปลงได้ จะแปลงได้เฉพาะฮีโร่ 4 ดาวและ 5 ดาว เท่านั้น,ยกเว้นฮีโร่ธาตุแสง / มืด จะไม่สามารถแปลงได้\n\n4.การแปลง มีโอกาสได้รับฮีโร่ 5 ดาวจากการรวมในวิหาร\n\n5.หลังจากแปลงสำเร็จ เลเวล คุณภาพ อุปกรณ์ น้ำยาตีบวก อาวุธเทพของฮีโร่ตัวเก่าจะถูกย้ายไปยังฮีโร่ตัวใหม่ทั้งหมด\n\n6.สามารถดูคุณสมบัติต่างๆของฮีโร่ที่แปลงสำเร็จได้ โดยข้อมูลคุณสมบัติที่แสดงจะเป็นคุณสมบัติของเลเวล 1 ไว้ใช้สำหรับอ้างอิงเท่านั้น",}
