M.Data[40016] = {"1. Alle 8 Std. hast du die Chance, auf einen Koop-Boss zu stoßen.\n\n2. Der Koop-Boss wird von allen Freunden mit einem Level von mind. 36 gesehen. Die Freunde können dir helfen, den Koop-Boss zu bezwingen, was aber Ausdauer kostet.\n\n3. Du kannst umgekehrt auch deinen Freunden helfen, den Koop-Boss, den sie aktiviert haben, zu besiegen. Bei jedem Kampf erhältst du auf Basis des angerichteten Schadens und Koop-Boss-Levels Punkte.\n\n4. Im Kampf erhältst du Punkte. Jede Woche werden auf Basis der Punkteränge Belohnungen (u. a. Gold, Juwelen, Herzen) per Nachricht an die Teilnehmer versandt.\n\n5. Die Punkterangliste wird jede Woche zurückgesetzt. Hilf fleißig deinen Freunden.\n\n6. Stirbt der Koop-Boss, so erhält der Spieler, der ihn aktiviert hat, eine Belohnung.",true,"1.每8个小时可获得一次搜寻机会,有概率遭遇好友BOSS。\n\n2.好友BOSS将被所有玩家等级大于36级的好友看到,并且可以消耗体力帮助你击败好友BOSS。\n\n3.你也可以帮助你的好友挑战其激活的好友BOSS。每次战斗将根据伤害和好友BOSS等级获得不同积分。\n\n4.参与战斗可获取积分,每周将根据积分排名发送相应的金币、钻石、爱心等奖励到参与了好友BOSS挑战的玩家邮箱中。\n\n5.积分榜每周进行重置,请踊跃帮助你的好友。\n\n6.好友BOSS死亡将会为激活的玩家发放结算奖励。","1. A searching chance is granted every 8 hours. Each search has a chance to find a Boss.\n\n2. Bosses are visible to lv.36 or higher friends, who can spend Stamina to help defeat them.\n\n3. You can also help defeat your friends\' Bosses. Each battle grants a reward as well as scores based on the damage dealt and the level of the Boss.\n\n4. Players are ranked by their scores and the ranking rewards including Gold, Gems and Hearts will be sent by mails weekly.\n\n5. Score rankings are reset weekly. Help friends defeat their Bosses to gain scores and earn great rewards!\n\n6. The player who found the Boss will be rewarded upon the Boss being defeated.","1.ทุกๆ 8 ชั่วโมงจะได้รับโอกาสในการค้นหา 1 ครั้ง และมีโอกาสที่จะเจอ Boss เพื่อน\n\n2.เพื่อนที่มีเลเวลทีมถึง Lv.36 ขึ้นไปจะสามารถมองเห็น Boss เพื่อนได้ โดยพวกเขาสามารถใช้ Stamina เพื่อมาช่วยสังหาร Boss เพื่อน ได้\n\n3.คุณสามารถช่วยสังหาร Boss เพื่อนได้ การต่อสู้แต่ละครั้งจะได้รับคะแนนที่แตกต่างกันไปตามความเสียหายที่ทำได้และระดับของ Boss เพื่อน\n\n4.ผู้เล่นที่เข้าร่วมการต่อสู้จะได้รับคะแนน แต่ละสัปดาห์จะได้รับรางวัลเป็นเหรียญทอง เพชร หัวใจตามคะแนนอันดับ โดยจะส่งรางวัลท้ารบ Boss เพื่อนไปยังจดหมายของผู้เล่นที่เข้าร่วม\n\n5.ตารางอันดับคะแนนจะรีเซ็ตทุกอาทิตย์ ช่วยเพื่อนกำจัดเหล่า Boss ของพวกเขา เพื่อเก็บสะสมคะแนนและรับรางวัลต่าง ๆมากมาย\n\n6.ผู้เล่นที่ปลุกกระตุ้น Boss เพื่อนขึ้นมา จะได้รับรางวัลหลังจากที่ Boss ถูกจำกัดแล้ว",}
