M.Data[360701] = {"Aktive Fgt.: Verursacht bei Feinden in der hinteren Reihe 80% Schaden mit einer Chance von 100%, den Zielen ein Abgrund-Siegel zu verpassen. Das Siegel wird nach 1 Runde ausgelöst und verursacht 160% Schaden.",true,"主动技能：对后排敌人造成80%伤害并有100%几率对目标附加深渊印记,深渊印记1回合后触发造成160%伤害","Active Skill: Deals damage (80% of Attack) to back-line enemies and imposes an Abyss Mark on them. After 2 rounds, the Mark will be triggered dealing damage (160% of Attack).","สกิลแอคทีฟ: ทำให้ศัตรูแถวหลังเกิดความเสียหาย 80%และมีโอกาส 100% ทำให้เป้าหมายติดผนึกเหวลึก เมื่อปล่อยผนึกเหวลึก 1 รอบไปแล้ว จะทำให้เกิดความเสียหาย (160% ของพลังโจมตี)",}
