M.Data[40017] = {"1. Nach dem Login kannst du täglich eine Belohnung abholen.\n\n2. Wenn du alle 30 Belohnungen abgeholt hast, werden sie aktualisiert und du kannst sie erneut abholen. Nicht abgeholte Belohnungen bleiben bestehen.\n\n3. Belohnungen, die du nicht abgeholt hast, kannst du beim nächsten Login nachträglich abholen.",true,"1.每日登录游戏后可领取一次奖励。\n\n2.领取完30次后内容刷新,重新开始领取,未领取完时不会刷新。\n\n3.当日登录但未领取的奖励,可以下次登录时领取。","1. A reward for check-in is gifted daily.\n\n2. The rewards will be refreshed after all 30 days\' rewards are claimed.\n\n3. If you forget to claim the check-in reward, you can still claim it at next logins.","1.สามารถรับรางวัลจากการล็อกอินได้วันละครั้ง\n\n2.หลังจากรับครบ 30 ครั้งแล้ว จะรีเฟรชใหม่และเริ่มรับรางวัลใหม่ หากยังรับรางวัลไม่ครบก็จะไม่รีเฟรช\n\n3.หากคุณล็อกอินเข้าเกมแล้วแต่ลืมกดรับรางวัล สามารถกดรับได้ในการล็อกอินครั้งต่อไป",}
