M.Data[40002] = {"1. Beende Ebene 3-15, um die Gold-Herausforderung freizuschalten. Der Sieg bringt viel Gold. \n\n2. Beende Ebene 3-15, um die Seelen-Herausforderung freizuschalten. Der Sieg bringt viele Lila und Goldene Seelen. \n\n3. Beende Ebene 3-15, um die Heldenherausforderung freizuschalten. Der Sieg bringt viele Helden-Teile. \n\n4. Jede Herausforderung kann täglich 2-mal angenommen werden. Der Sieg kostet 1 Chance. Niederlagen kosten nichts. \n\n5. Erhöhe das Spielerlevel, um schwierigere Herausforderungen zu erhalten. Je schwerer, desto besser die Belohnung. \n\n6. Mit einem höheren VIP-Level kannst du mehr Chancen zusätzlich kaufen. \n\n7. Sieger können eine vielfach bessere Belohnung erhalten.",true,"1.通关3-15开启金币挑战,获胜可以获得大量金币。\n\n2.通关3-15开启勇者挑战,获胜可以获得大量紫魂和金魂。\n\n3.通关3-15开启英雄挑战,获胜可以获得大量英雄碎片。\n\n4.每天每个挑战可以获得2次挑战机会,获胜后扣除挑战次数,失败不扣。\n\n5.提升玩家等级可以解锁更高难度的挑战,越高的难度获取的奖励越多。\n\n6.更高的VIP等级可以购买更多的额外次数。\n\n7.战胜者有几率获得多倍奖励。","1. Gold Raid unlocks clear stage 3-15. It grants a large amount of Gold.\n\n2. Soul Raid unlocks clear stage 3-15. It grants a large amount of Golden Souls and Purple Souls.\n\n3. Hero Raid unlocks clear stage 3-15. It grants a large amount of Hero Shards.\n\n4. You have 2 challenge chances for each type of Raid per day. Only a victory will use up a challenge chance.\n\n5. More difficult challenges with better rewards are unlocked as your team level increases.\n\n6. The higher your VIP level, the more additional challenge chances you can purchase.\n\n7. There is a random chance to get the rewards multiplied!","1.เมื่อถึงเลเวล 20 จะเปิดโหมดทองท้ารบ เมื่อเอาชนะจะได้รับทองเป็นจำนวนมาก\n\n2.เมื่อถึงเลเวล 25 จะเปิดโหมดผู้กล้าท้ารบ เมื่อเอาชนะจะได้รับวิญญาณทองและวิญญาณม่วงเป็นจำนวนมาก\n\n3.เมื่อถึงเลเวล 30 จะเปิดโหมดฮีโร่ท้ารบ เมื่อเอาชนะจะได้รับเศษฮีโร่\n\n4.ในแต่ละสนามรบมีโอกาสเข้าร่วม 2 ครั้งต่อวัน หากแพ้จากการต่อสู้จะไม่ถูกหักจำนวนครั้งท้ารบ แต่ถ้าชนะก็จะไม่ถูกหักจำนวนครั้งท้ารบ\n\n5.เมื่อเลเวลทีมอัพจะปลดล็อกโหมดท้ารบที่ยากขึ้น ความยากของด่านยิ่งยากเท่าไหร่ก็จะยิ่งได้รับของรางวัลเยอะขึ้น\n\n6.ระดับ VIP ที่สูงขึ้นก็จะยิ่งซื้อจำนวนครั้งในการท้ารบได้มากขึ้น\n\n7.ผู้ชนะมีโอกาสที่จะได้รับรางวัลที่มากขึ้น",}
