M.Data[40003] = {"Kampfregeln\n\n1. Täglich um 21 Uhr werden die Rangbelohnungen per Nachricht versandt.\n\n2. Kämpfe in der Arena kosten Tickets. Tickets können mit Juwelen gekauft werden.\n\n3. Ein Kampf in der Arena dauert max. 15 Runden. Dauert er länger, so gilt er als Niederlage.\n\n4. Nach dem Kampf werden Punkte verteilt. Sieger erhalten Punkte, Besiegte verlieren Punkte. Auf Basis des Punktestands wird eine Rangliste erstellt.\n\n5. In den Aufnahmen kannst du die Wiederholungen der letzten 10 Kämpfe anschauen.\n\nBelohnungsregeln\n\n1. Auf Basis des Tagesranges wird eine Belohnung versandt. Details hierzu findest du, wenn du auf den Belohnungsbutton tippst.",true,"战斗规则\n\n1.每天21点通过邮箱发放排名奖励。\n\n2.参与竞技场战斗会消耗门票,门票可以通过钻石购买。\n\n3.竞技场战斗限定15回合,战斗超时则失败。\n\n4.战斗后有积分结算,胜利获得积分,失败扣除积分,所有玩家按照积分进行排名。\n\n5.战斗记录可以查看最近10场战斗的录像。\n\n奖励规则\n\n1.根据每天排名结算时的排名发放奖励。更多细节点击奖励按钮查看。","Battle Rules\n\n1. The ranking rewards are sent by mails at 21:00 (UTC/GMT+0) daily.\n\n2. Each Arena battle costs 1 Arena Ticket, which can be purchased using Gems.\n\n3. Each Arena battle lasts up to 15 rounds. The attacker loses once the limit is reached.\n\n4. Winners win some scores while losers lose some. Players are ranked based on their scores.\n\n5. Replays of the last 10 battles can be checked in Battle Records.\n\nReward Rules\n\n1. Rewards are sent out daily according to the ranking. For details, please tap the \"REWARDS\" button.","กฎการต่อสู้\n\n1.ในเวลา 21:00 น. ของทุกวันจะได้รับรางวัลอันดับผ่านทางจดหมาย\n\n2.ใช้บัตรผ่านประตูเพื่อเข้าร่วมการต่อสู้อารีน่า บัตรผ่านประตูสามารถซื้อได้ด้วยเพชร\n\n3.ในการต่อสู้อารีน่าจะจำกัดการเล่นเพียงแค่ 15 รอบ หากเกินกำหนดก็จะแพ้\n\n4.หลังจบการต่อสู้ ก็จะทำการคำนวณคะแนน หากชนะจะได้รับคะแนน แพ้ก็จะเสียคะแนน จากนั้นจะจัดอันดับตามคะแนนของผู้เล่น\n\n5.สามารถดูสถิติการต่อสู้ 10 ครั้งล่าสุดได้ที่บันทึกการต่อสู้\n\nเงื่อนไขรางวัล\n\n1.ของรางวัลจะมอบตามตารางอันดับที่คำนวณเสร็จในแต่ละวัน คลิกที่ปุ่มรางวัลเพื่อดูรายละเอียดเพิ่มเติม",}
