M.Data[40006] = {"1. Gildenmitglieder können in Gruppenraubzüge ziehen.\n\n2. Nach jedem Kampf erhaltet ihr eine einzelne Belohnung. Je stärker der Boss, desto besser fällt die Belohnung aus.\n\n3. Wenn der Boss stirbt, wird eine Rangbelohnung auf Basis des Schadens, den jedes Gildenmitglied beim Boss angerichtet hat, per Nachricht versandt.\n\n4. Es gibt nur eine Belohnung für die erste Teilnahme am Boss-Kampf und den Sieg über den Boss.\n\n5. Nach einer Niederlage musst du bis 0 Uhr des Folgetages warten, um wieder kämpfen zu können, oder Juwelen ausgeben. Maximal kannst du 3-mal eine Belebung mit Juwelen herbeiführen.\n\n6. Stirbt der aktuelle Boss, so wird der nächste freigeschaltet.\n\n7. Ein besiegter Boss kann nicht mehr herausgefordert werden.",true,"1.公会成员可进入团队副本进行挑战。\n\n2.每次战斗结束可获得单次战斗奖励。越强大的BOSS单次奖励越丰厚。\n\n3.在BOSS被击杀后,根据玩家对BOSS造成的总伤害量发放排名奖励,以邮件方式发送。\n\n4.只有首次参与击杀BOSS才能获得奖励。\n\n5.挑战失败后,需至次日0点可再次挑战,也可以花费钻石进行复活。\n\n6.击杀当前BOSS后,可解锁下一个BOSS。\n\n7.已击杀的BOSS无法再次挑战。","1. Guild members can challenge Guild Bosses.\n\n2. Each Guild Boss battle grants rewards. The more powerful the Boss, the better the rewards.\n\n3. After defeating the Guild Boss, defeat rewards will be sent by mails according to the participants\' total damage ranking.\n\n4. Defeat rewards of each Boss can be only claimed once.\n\n5. After a failed challenge, another challenge is only available after 0 o\'clock next day. You can also spend Gems to revive and make another challenge. Max 3 revivals are allowed per day.\n\n6. The next Boss unlocks after the current one is defeated.\n\n7. Defeated Bosses cannot be challenged again.","1.สมาชิกกิลด์สามารถเข้าร่วมและท้ารบในดันเจี้ยนกิลด์ได้\n\n2.ทุกครั้งที่จบการต่อสู้จะได้รับรางวัลจากการต่อสู้ Boss ยิ่งแข็งแกร่ง รางวัลจากการต่อสู้ก็ยิ่งมากขึ้น\n\n3.หลังจากสังหาร Boss สำเร็จ จะให้รางวัลอันดับตามผลรวมความเสียหายที่ทำต่อ Boss โดยจะส่งรางวัลให้ทางจดหมาย\n\n4.ต้องมีส่วนร่วมในการฆ่า Boss ในครั้งแรกเท่านั้นถึงจะได้รับรางวัล\n\n5.หากแพ้จากการท้ารบ จะต้องรอจนถึงเที่ยงคืนในวันถัดไปถึงจะเข้าร่วมท้ารบใหม่ได้ หรือสามารถใช้เพชรเพื่อฟื้นคืนชีพได้ โดยผู้เล่นสามารถใช้เพชรฟื้นคืนชีพได้สูงสุด 3 ครั้ง\n\n6.หลังจากสังหาร Boss ตัวปัจจุบันได้สำเร็จ ก็จะปลดล็อก Boss ตัวถัดไป\n\n7.บอสที่ถูกสังหารไปแล้ว จะไม่สามารถท้ารบใหม่ได้อีก",}
