M.Data[40007] = {"Jede Woche findet eine Gildenkriegsaison statt. Die Saison ist in zwei Abschnitte unterteilt:\n\nVorentscheid\n\n1. Zeitraum: Montag 0:00:00 (GMT+0) bis Freitag 23:59:59 (GMT+0).\n\n2. Verfügbar ab Gildenlevel 12. Teilnehmerzahl mind. 10, max. 15. Gildenanführer oder -Vize nehmen die Anmeldung vor.\n\n3. Gildenanführer und -Vize kümmern sich um das teilnehmende Team und den Wechsel der Gegner. Max. können 3 Teamformationen versteckt werden.\n\n4. Jeder Kampf verbraucht 1 Punkt G-Ausdauer. Alle 3 Std. wird 1 Punkt regeneriert.\n\n5. Die Sieger eines Kampfes kämpfen gegen das nächste Team. Jedes Team kann pro Runde max. 3-mal kämpfen.\n\n6. Anfangs beträgt der Punktestand 0. Für einen Sieg erhältst du 48 Punkte. Pro siegreicher Runde erhältst du 240 Punkte. Niederlagen kosten keine Punkte. Endet eine Runde, ohne dass einzelne Teams gekämpft haben, so gibt es für jedes dieser Teams 96 Punkte.\n\n7. Nach dem Ende des Vorentscheids werden Belohnungen auf Basis des Punktestands versandt. (Abzuholen in der Gildenkartentruhe)\n\nGildenmachtkampf\n\n1. Die besten 16 des Vorentscheids gehen automatisch in den Gildenmachtkampf. Anhand ihres Gildenranges treten sie im Kampf an.\n\n2. Samstags 0:00:00 bis 18:00:00 (GMT+0) Uhr ist die Vorbereitungszeit. Das Finale dauert ca. 10 min. Im Kampf kannst du die Formation nicht mehr ändern.\n\n3. Während der Vorbereitung kannst du Wetten auf den Rang der Gilde abschließen. Solange der tatsächliche Rang der Gilde höher als der gewettete Rang ist, erhältst du die Wettbelohnung auf Basis deines Einsatzes per Nachricht.\n\n4. Nach dem Finale wird die Wettkampfbelohnung auf Basis der Gildenränge versandt. (Abzuholen in der Gildenkartentruhe).\n\n5. Der Finalbelohnungsrahmen, das Gildenzeichen und die Championgildengebäude können 7 Tage lang verwendet werden.\n\nHinweise\n\n1. Während der Wettkampfpause kannst du die Ergebnisse des letzten Gildenmachtkampfs anschauen.\n\n2. Verlassen Spieler während des Gildenmachtkampfs die Gilde, so verlieren sie die Teilnahmegenehmigung für den aktuellen Wettkampf.\n\n3. Gildenmitglieder, die nicht in die Formation aufgenommen wurden, erhalten nur 10% der Gildenbelohnung.",true,"公会战每周一个赛季，赛季分为两个阶段：\n\n排位赛\n\n1.开放时间：周一0:00（GMT+0）开放，周五晚23:59:59（GMT+0）结束。\n\n2.公会等级达到12级开放，参战成员不少于10人，不超过15人,由会长或副会长报名参加。\n\n3.由会长或副会长管理参战队伍出战和更换作战对手，最多可隐藏3支队伍阵容。\n\n4.每轮对战消耗1点公会体力，每3小时回复1点。\n\n5.单场获胜队伍继续与对手下一支队伍战斗，每支队伍在一轮对战中最多出战3次。\n\n6.初始积分为0，单场战斗获胜方积48分，每轮获胜方积240分，失败均不扣分。一轮结束后出战但未上场的队伍每支积96分。\n\n7.排位赛结束后根据积分排名发放比赛奖励。（公会地图宝箱领取）\n\n王者公会争霸赛\n\n1.排位赛前16名自动进入王者公会争霸赛，依据公会排名进行对战。\n\n2.周六0：00到18：00（GMT+0）开放战前准备。决赛大约持续10分钟，战斗中无法调整阵容。\n\n3.准备期间玩家可进行投注，竞猜决赛公会名次，只要投注对象实际名次不低于投注名次，将根据赔率获得竞猜奖励。（通过邮件发放）\n\n4.决赛结束后根据公会排名发放比赛奖励。（公会地图宝箱领取）\n\n5.决赛奖励的头像框、公会徽章和王者公会建筑可使用7天。\n\n注意事项\n\n1.休赛期间可以查看上次王者公会争霸赛结果。\n\n2.玩家在参战状态下退出公会将丧失本轮公会战参战资格。\n\n3.未设置阵容的公会成员仅获得相应公会奖励的10%。","Guild War is held weekly. Each season includes two phases:\n\nPreliminaries\n\n1. Opening Time: 0:00 Monday (GMT+0) - 23:59:59 Friday (GMT+0).\n\n2. Guild War unlocks at guild level 12. At least 10 members and at most 15 are required to sign up for Guild War. Only guild Leader or Deputies are allowed to sign up.\n\n3. Leader or Deputies can manage the teams and choose the rivals. Max 3 teams can be hidden.\n\n4. Each round of battles consumes 1 guild Stamina. 1 Stamina is restored every 3 hours.\n\n5. Battle winner continues to fight with rival\'s next team, but each team can engage up to 3 teams each round.\n\n6. All teams start from 0 score. Each single battle victory grants 48 scores and each round victory grants 240 scores. No scores are deducted for defeats. The team which is dispatched but doesn\'t join in any battles in a round wins 96 scores.\n\n7. Rewards will be sent (to the Treasure Chest in guild) based on score ranking by the end of the Preliminaries.\n\nFinals\n\n1. Top 16 guilds of the Preliminaries are automatically qualified for the Finals, the schedule of which is decided by the guild ranking.\n\n2. The preparation stage starts at 0:00 Saturday (GMT+0). Battles start at 18:00 (GMT+0). The Finals will last about 10 minutes, during which the lineups can\'t be changed.\n\n3. You can bet on a team\'s Finals\' ranking during the preparation. As long as the actual ranking is not lower than the bet one, reward will be granted according to the odds.\n\n4. Contest rewards will be sent (to the Treasure Chest in guild) according to the Finals\' ranking by the end of the Finals.\n\n5. The rewarded Frame, Guild Badge and Castle Appearance will expire in 7 days.\n\nNotice\n\n1. You can check the result of the previous Finals during the off-season.\n\n2. The participant who quits his guild during Guild War will longer be able to participate in this season.\n\n3. Members who did not set up their lineup gain 10% rewards only.","ศึกกิลด์จะจัดสัปดาห์ละ 1 ซีซั่น โดยในซีซั่นจะแบ่งออกเป็น 2 ช่วง: \n\nรอบคัดเลือก\n\n1.เวลาทำการ: เปิดวันจันทร์เวลา 00:00 (GMT+0) และสิ้นสุดในวันศุกร์เวลา 23:59:59 (GMT+0)\n\n2.ศึกกิลด์จะเปิดให้เล่นเมื่อกิลด์ถึงเลเวล 12 โดยจะต้องมีสมาชิกเข้าร่วมอย่างน้อย 10 คนและไม่เกิน 15 คน เฉพาะหัวหน้ากิลด์หรือรองหัวหน้ากิลด์เท่านั้นที่จะสามารถลงชื่อเข้าร่วมศึกได้\n\n3.หัวหน้ากิลด์หรือรองหัวหน้ากิลด์สามารถจัดทีมและเลือกคู่ต่อสู้ได้ สามารถซ่อนทีมได้สูงสุด 3 ทีม\n\n4.แต่ละรอบจะเสีย Stamina ศึกกิลด์ รอบละ 1 แต้ม โดย Stamina ศึกกิลด์ จะฟื้นฟู 1 หน่วยทุกๆ 3 ชั่วโมง\n\n5.ทีมที่ชนะจะเข้ารอบไปเจอกับทีมต่อไป แต่ละทีมจะออกรบได้สูงสุดรอบละ 3 ครั้ง\n\n6.คะแนนแต่ละทีมจะเริ่มต้นที่ 0 คะแนน ชนะแต่ละครั้งจะได้รับ 48 คะแนน ชนะแต่ละรอบจะได้รับ 240 คะแนน ถ้าหากแพ้ก็จะไม่เสียคะแนน เมื่อจบรอบ ทีมที่ถูกส่งแต่ไม่ได้ออกรบจะได้รับ 96 คะแนน\n\n7.หลังจากรอบคัดเลือกสิ้นสุดลงก็จะมอบรางวัลให้ตามคะแนนอันดับ (กดรับได้ที่แผนที่หีบสมบัติกิลด์)\n\nศึกชิงแชมป์ราชากิลด์\n\n1.สำหรับรอบคัดเลือก 16 กิลด์ที่มีอันดับสูงสุดจะได้เข้าสู่รอบตัดสิน โดยตารางการแข่งขันจะจัดตามอันดับกิลด์\n\n2.วันเสาร์ เวลา 00:00 น. จะเปิดให้เตรียมตัวก่อนการสู้รบ และจะเริ่มการต่อสู้เวลา 18:00 (GMT+0) โดยรอบตัดสินจะใช้เวลาประมาณ 10 นาที และไม่สามารถปรับทีมขณะต่อสู้ได้\n\n3.ในระหว่างการเตรียมตัวก่อนการสู้รบ ผู้เล่นสามารถร่วมโหวตทีมที่จะชนะได้ โดยทายผลอันดับกิลด์ในรอบตัดสิน อันดับจริงของทีมที่ทำการเดิมพันจะต้องไม่ต่ำกว่าอันดับที่จะวางเดิมพัน จำนวนรางวัลที่ได้รับจะได้รับตามอัตราต่อรอง (รับรางวัลได้ที่จดหมาย)\n\n4.หลังจากรอบตัดสินสิ้นสุดลงก็จะมอบรางวัลให้ตามคะแนนอันดับ (กดรับได้ที่แผนที่หีบสมบัติกิลด์)\n\n5.รางวัลรอบชิงชนะเลิศได้แก่กรอบรูปโปรไฟล์ ตรากิลด์ และสิ่งก่อสร้างราชากิลด์ สามารถใช้ได้ 7 วัน\n\nหมายเหตุ\n\n1.สามารถตรวจสอบผลการแข่งขันรอบก่อนหน้าได้ในช่วงพักการแข่งขัน\n\n2.ผู้เล่นที่เข้าร่วมในศึกกิลด์และได้ออกจากกิลด์ของเขาในระหว่างศึกกิลด์ จะสูญเสียคุณสมบัติในการเข้าร่วมศึกกิลด์ในซีซั่นนี้\n\n3.สมาชิกกิลด์ที่ไม่ได้เลือกให้เป็นผู้เล่นตัวจริงจะได้รับรางวัลเพียง 10% ของรางวัล",}
