M.Data[360681] = {"Aktive Fgt.: Feinde in der vorderen Reihe erleiden 78% Angriffsschaden. Chance von 30%, Ziele für 2 Runden zu versteinern. Feinde vom Stärke-Typ erleiden zusätzlich 43% Angriffsschaden.",true,"主动技能：对所有前排敌人造成78%攻击伤害,有30%几率使目标石化2回合,对力量型目标造成43%额外伤害","Active Skill: Deals damage (78% of Attack) to all front-line enemies with a 30% chance to petrify them for 2 rounds; deals 43% more damage to Strength enemies.","สกิลแอคทีฟ: สร้างความเสียหาย (78% ของพลังโจมตี) ให้แก่ศัตรูแถวหน้าทั้งหมด มีโอกาส 30% ทำให้เป้าหมายเป็นหิน 2 รอบ และทำให้เป้าหมายประเภท STR เกิดความเสียหายเพิ่ม (43% ของพลังโจมตี)",}
