M.Data[40008] = {"1. Das Schmieden von Ausrüstung verbraucht eine gewisse Anzahl minderwertiger Ausrüstungsteile.\n\n2. Das Schmieden verbraucht Gold.\n\n3. Gerade angelegte Ausrüstung kann nicht geschmiedet werden. Nur Ausrüstung, die im Inventar liegt, wird beim Schmieden angezeigt.",true,"1.装备锻造需要消耗指定数量的低级装备。\n\n2.锻造时需要消耗金币。\n\n3.穿戴中的装备不能进行锻造,只有在背包中的装备才能显示在锻造栏中。","1. It costs 3 low quality gears to forge a higher quality one.\n\n2. Forging costs Gold.\n\n3. Only gears in the Bag can be forged while the equipped ones cannot.","1.การตีอุปกรณ์ต้องใช้อุปกรณ์ระดับต่ำตามจำนวนที่กำหนดในการตี\n\n2.จะต้องใช้เหรียญทองในการตีอุปกรณ์ด้วย\n\n3.อุปกรณ์ที่สวมใส่อยู่ไม่สามารถนำไปตีได้ จะต้องเป็นอุปกรณ์ที่อยู่ในกระเป๋าเท่านั้นถึงจะปรากฏในช่องเลือกตีอุปกรณ์",}
