M.Data[40009] = {"1. In der Silbertruhe findest du tendenziell Helden von niedriger Qualität (1 - 5 Sterne). Du öffnest sie mit Silberschlüsseln.\n\n2. In der Goldtruhe findest du tendenziell Helden von hoher Qualität (3 - 5 Sterne). Du öffnest sie mit Goldschlüsseln oder Juwelen.\n\n3. In der Freundestruhe findest du tendenziell mittelmäßige Helden (2 - 5 Sterne). Du öffnest sie mit Herzen. Du kannst maximal 2000 Herzen erhalten.\n\n4. Jedes Mal, wenn du die Goldtruhe öffnest, erhältst du 10 Punkte Energie. Wenn du 1000 Punkte Energie gesammelt hast und VIP 3 bist oder dein Spielerlevel bei 100 liegt, erhältst du zufällig einen 5-Sterne-Helden.\n\n5.Aus der Freundestruhe erhältst du 3 Punkte Energie und aus der Silbertruhe 1 Punkt.",true,"1.银宝箱可以召唤出品质较低的英雄(1～5星),银宝箱需要消耗银钥匙。\n\n2.金宝箱可以召唤出品质较高的英雄(3～5星),金宝箱需要消耗钻石或金钥匙。\n\n3.友情宝箱可以召唤出品质一般的英雄(2～5星),需要消耗爱心,可获得的爱心数量上限不超过2000个,超过上限后将无法继续累积。\n\n4.每次打开金宝箱可以获取10点宝箱能量,积累1000点能量并且成为VIP3即可打开宝箱,获得随机一名5星英雄。\n\n5.打开爱心宝箱可获得3点能量,打开银宝箱可以获得1点能量","1. It requires Silver Keys to open Silver Chests, which can summon 1 to 5-star heroes.\n\n2. It requires Gems or Golden Keys to open Golden Chests, which can summon 3 to 5-star heroes.\n\n3. It requires Hearts to open Heart Chests, which can summon 2 to 5-star heroes. You can accumulate up to 2000 Hearts.\n\n4. Each Golden Chest opened grants 10 Energy. VIP 3 or level 100 or higher players can use 1000 Energy to summon a 5-star hero.\n\n5. Each Heart Chest opened grants 3 Energy, while each Silver Chest grants 1.","1.หีบสมบัติเงินสามารถอัญเชิญฮีโร่ระดับต่ำ (1 - 5 ดาว) โดยหีบสมบัติเงินจะต้องใช้กุญแจเงินในการเปิด\n\n2.หีบสมบัติทองสามารถอัญเชิญฮีโร่ระดับสูง (3 - 5 ดาว) โดยหีบสมบัติทองจะต้องใช้เพชรหรือกุญแจทองในการเปิด\n\n3.หีบสมบัติมิตรภาพสามารถอัญเชิญฮีโร่ระดับกลาง (2 - 5 ดาว) โดยหีบสมบัติมิตรภาพจะต้องใช้หัวใจในการเปิด หัวใจจะสะสมได้สูงสุด 2000 ดวง หากสะสมจนเต็มแล้วจะไม่สามารถรับเพิ่มได้อีก\n\n4.ทุกครั้งที่เปิดหีบสมบัติทองจะได้รับพลังงาน 10 แต้ม ผู้เล่น VIP 3 หรือเลเวลทีมถึง Lv.100 ขึ้นไป สามารถสะสมแต้มพลังงานครบ 1000 แต้มเพื่อเปิดหีบสมบัติ โดยจะได้รับฮีโร่ระดับ 5 ดาวแบบสุ่ม\n\n5.ทุกครั้งที่เปิดหีบสมบัติมิตรภาพจะได้รับพลังงาน 3 แต้ม ทุกครั้งที่เปิดหีบสมบัติเงิน จะได้รับพลังงาน 1 แต้ม",}
