M.Data[150625] = {"1. Abzeichen\nBeende Ebene 2-2, um das Abzeichen freizuschalten.\n\n2. Abzeichen-Belohnung\nSammle Abzeichenerfahrung, um Belohnungen abholen zu können.\n\n3. Abzeichenerfahrung\nQuelle: Auto-Kampf (ab Ebene 2-2), in der Tagesquest, Kauf mit Juwelen\n\n4. Goldabzeichen\nDas Goldabzeichen wird nach seinem Kauf aktiviert und hält an, bis das Abzeichen der Woche endet.\nErhältlich durch Goldabzeichen:\n1) Extra-Abzeichenbelohnung (Gesamtwert: 50000 Juwelen) (zusätzlich zur bereits erhaltenen Abzeichenbelohnung)\n2) Freischaltung einer weiteren Tagesquest\n3) Im Auto-Kampf erhältlich: Gold, Lila Seelen, Abzeichenerfahrung +50% (Ab Kauf, beginnt bei nächstem Fund)\n\n5. Überflussbelohnung\nNachdem du das Goldabzeichen aktiviert und alle Belohnungen abgeholt hast, erhältst du beim Sammeln zusätzlicher Abzeichenerfahrung einen Überschuss, der es ermöglicht, noch einmal die Truhe anzutippen, um eine weitere Belohnung zu erhalten.\n\n6. Nachträgliche Belohnung\nSobald du genug Abzeichenerfahrung hast, um eine Belohnung abzuholen, dies aber vergisst, kannst du in der Folgewoche im Abzeichen-Menü nachträglich die Belohnung der Vorwoche abholen (dies gilt nicht für Überschussbelohnungen).",false,"1.令牌\n通过关卡2-2即可解锁令牌。\n\n2.令牌奖励\n积累令牌经验可领取相应奖励。基础奖励所有人皆可领取，激活黄金令牌后可领取额外奖励。\n\n3.令牌经验\n令牌经验来源：挂机掉落(从关卡2-2开始)、每日任务获得、花费钻石快速获得。\n\n4.黄金令牌\n黄金令牌购买后激活，持续至当周令牌结束。\n激活黄金令牌获得：\n可领取额外令牌奖励(总价值30000钻石)(包括之前已达成的令牌奖励)\n\n4.溢出奖励\n当激活了黄金令牌并已经领取完所有奖励后，额外得到的令牌经验每额外溢出一定点数可以再次点击宝箱领取奖励。\n\n5.奖励补发\n您的令牌经验达到可以领取奖励时，若您忘记了领取奖励，在下周点击令牌界面系统会补发上周未领取奖励（溢出经验奖励不会补发）。","1. Pass\nPass unlocks at stage 2-2.\n\n2. Pass Reward \nAccumulate Pass EXP to claim Pass rewards. Basic rewards are available to all, while extra rewards are available to those who have activated the Golden Pass.\n\n3. Pass EXP\nSources of Pass EXP: Auto-battle (from stage 2-2), daily tasks or purchased using Gems.\n\n4. Golden Pass\nGolden Pass is activated upon purchase, and will expire at 0:00 this Friday.\nActivate the Golden Pass to gain:\n1). Extra Pass rewards (worth 50,000 Gems) (including previously achieved Pass rewards)\n2). Unlock extra daily tasks\n3). +50% Auto-battle Gold, Soul and Pass EXP (takes effect after Golden Pass activated)\n\n5. Overflow Reward\nAfter the Golden Pass is activated and all the rewards have been claimed, you can still gain Pass EXP and a certain amount of overflow EXP grants a reward.\n\n6. Reissue Reward\nIf you forget to claim this week\'s Pass rewards, the system will reissue the rewards next week when you enter the Pass system (overflow rewards won\'t be reissued).","1.Pass\nPass จะปลดล็อกด่าน 2-2\n\n2.รางวัล Pass\nเมื่อสะสม EXP Pass ครบกำหนดก็จะได้รับรางวัล ทุกคนสามารถรับรางวัลทั่วไปได้ แต่ถ้าเปิดใช้ Gold Pass ก็จะได้รับโบนัสรางวัล\n\n3.EXP Pass\nEXP Pass รับได้จาก: ดรอปจากต่อสู้ออโต้ (เริ่มตั้งแต่ด่าน 2-2), รับจากเควสรายวัน, ซื้อเพชรเพื่อเร่งรับได้\n\n4.Gold Pass\nGold Pass จะเปิดใช้งานทันทีหลังซื้อ ใช้งานไปจนถึงหมดอายุ\nหลังเปิดใช้ Gold Pass จะได้รับ: \n  1).สามารถรับโบนัสรางวัล Pass (มูลค่ารวม 50000 เพชร) (รวมไปถึงรางวัล Pass ตามเงื่อนไขก่อนหน้านี้)\n  2).ปลดล็อกเควสรายวันเพิ่ม\n  3).ต่อสู้ออโต้ จะได้รับทอง วิญญาณม่วง EXP Pass +50% (หลังจากซื้อไปจนถึงเริ่มดรอปครั้งถัดไป)\n\n5.รางวัลล้น\nเมื่อเปิดใช้ Gold Pass และรับรางวัลทั้งหมดแล้ว EXP Pass ที่ได้รับเกินมาแต่ละแต้ม สามารถกดรับรางวัลหีบสมบัติอีกครั้งได้\n\n6.ชดเชยรางวัล\nเมื่อ EXP Pass ของคุณ ตรงถามเงื่อนไขรับรางวัล หากคุณลืมรับรางวัล สัปดาห์ถัดไปสามารถกดรับรางวัลชดเชยได้ที่หน้า Pass (รางวัล EXP ล้น จะไม่ชดเชยให้)",}
