M.Data[150633] = {"Überschussbelohnung\nNachdem du das Goldabzeichen aktiviert und alle Belohnungen abgeholt hast, erhältst du beim Sammeln zusätzlicher Abzeichenerfahrung einen Überschuss, der es ermöglicht, noch einmal die Truhe anzutippen, um eine weitere Belohnung zu erhalten.",false,"溢出奖励\n当激活了黄金令牌并已经领取完所有奖励后，得到的令牌经验每额外溢出一定点数可以再次点击宝箱领取奖励。","Overflow Reward\nAfter the Golden Pass is activated and all the rewards have been claimed, you can still gain Pass EXP and a certain amount of overflow EXP grants a reward.","รางวัลล้น\nเมื่อเปิดใช้ Gold Pass และรับรางวัลทั้งหมดแล้ว EXP Pass ที่ได้รับเกินมาแต่ละแต้ม สามารถกดรับรางวัลหีบสมบัติอีกครั้งได้",}
