M.Data[150634] = {"Überschussbelohnung\nNachdem du das Goldabzeichen aktiviert und alle Belohnungen abgeholt hast, erhältst du beim Sammeln zusätzlicher Abzeichenerfahrung einen Überschuss, der es ermöglicht, noch einmal die Truhe anzutippen, um eine weitere Belohnung zu erhalten.",false,"1.额外领取令牌奖励(价值250000钻石)\n2.解锁额外每周任务\n3.挂机获得金币、紫魂、令牌、守护者令牌经验+50%\n4.VIP EXP +500","Overflow Reward\nAfter the Golden Pass is activated and all the rewards have been claimed, you can still gain Pass EXP and a certain amount of overflow EXP grants a reward.","รางวัลล้น\nเมื่อเปิดใช้ Gold Pass และรับรางวัลทั้งหมดแล้ว EXP Pass ที่ได้รับเกินมาแต่ละแต้ม สามารถกดรับรางวัลหีบสมบัติอีกครั้งได้",}
