M.Data[285003] = {"Liebe Spieler, wegen eines Spielupdates werden wir am %s (UTC-Zeit) den Server anhalten, um das Update durchzuführen. Dies wird ca. %d h dauern. Der Server kann je nach Fortschritt früher oder später geöffnet werden. Wir bitten für diese Umstände um Entschuldigung und bedanken uns für eure Unterstützung und euer Verständnis. ",false,"亲爱的玩家，为更新游戏版本，我们计划在%s（UTC时间）对服务器进行停服更新，持续时间约%d小时。服务器开启时间将根据实际进度进行提前或者延后，给您带来的不便敬请谅解，非常感谢您一直以来的支持！祝您游戏愉快！","Dear players, to update the game to the latest version, we plan to shut down the server at %s (UTC). Upgrading servers may take about %dh. The server downtime may vary according to the progress. We are sorry for the inconvenience and thank you for your continued support! Good gaming!","เรียนผู้เล่นทุกท่าน เพื่อการอัปเดตเกมเวอร์ชันใหม่ พวกเราจึงจะทำการปิดปรับปรุงเซิร์ฟเวอร์ในเวลา%s(เวลา UTC) และคาดว่าจะเสร็จสิ้นใน%dชั่วโมง โดยกำหนดเวลาในการเปิดเซิร์ฟเวอร์ อาจมีการเปลี่ยนแปลงขึ้นอยู่กับสถานการณ์ ขออภัยในความไม่สะดวก และขอขอบคุณการสนับสนุนจากผู้เล่นทุกท่านที่มีให้เรามาโดยตลอด ขอให้คุณมีความสุขไปกับเกมของพวกเรา !",}
