M.Data[285002] = {"Liebe Spieler, um den Serverbetrieb stabil und bei guter Qualität zu halten, werden wir am %s (UTC-Zeit) den Server anhalten, um eine Wartung durchzuführen. Dies wird ca. %d h dauern. Der Server kann je nach Fortschritt früher oder später geöffnet werden. Wir bitten für diese Umstände um Entschuldigung und bedanken uns für eure Unterstützung und euer Verständnis. ",false,"亲爱的玩家，为保证服务器的运行稳定和服务质量,我们计划在%s（UTC时间）对服务器进行停服维护，持续时间约%d小时。服务器开启时间将根据实际进度进行提前或者延后，给您带来的不便敬请谅解，非常感谢您一直以来的支持！祝您游戏愉快！","Dear players, to ensure the server stability and maintain a quality service, we plan to perform a server maintenance at %s (UTC) for about %dh. The server downtime may vary according to the progress. We are sorry for the inconvenience and thank you for your continued support! Good gaming!","เรียนผู้เล่นทุกท่าน พวกเราจะทำการปิดปรับปรุงเซิร์ฟเวอร์ในเวลา%s(เวลา UTC) และคาดว่าจะเสร็จสิ้นใน%dชั่วโมง โดยกำหนดเวลาในการเปิดเซิร์ฟเวอร์ อาจมีการเปลี่ยนแปลงขึ้นอยู่กับสถานการณ์ ขออภัยในความไม่สะดวก และขอขอบคุณการสนับสนุนจากผู้เล่นทุกท่านที่มีให้เรามาโดยตลอด ขอให้คุณมีความสุขไปกับเกมของพวกเรา !",}
