M.Data[285007] = {"Update: \n%s\n\nWenn du Fragen und Anregungen zum Spiel hast, zögere nicht, uns zu kontaktieren.",false,"更新说明:\n%s\n\n如果您对游戏有任何建议或疑问，请与我们联系。","Update Info:\n%s\nIf you have any suggestions or questions about the game, please contact us.","ข้อมูลการอัปเดต: \n%s\n\n หากท่านมีข้อสงสัยหรือข้อเสนอแนะใดๆเกี่ยวกับเกม สามารถติดต่อพวกเรามาได้ตลอด",}
