M.Data[285008] = {"Lieber Spieler, dein Konto hat einen Kauf storniert. Deshalb haben wir eine dem Kauf entsprechende Juwelenmenge von deinem Konto abgezogen. Bei Fragen stehen wir dir jederzeit zur Verfügung.",false,"亲爱的玩家，因您的账号存在退款行为，我们扣除了您退款道具所对应价值的钻石，如有疑问请联系我们。","Dear player, due to the refunds of your account, we\'ve deducted the Gems which are equal value of your refund item(s). If you have any questions, please contact us.","เรียนผู้เล่นที่น่ารัก เนื่องจากบัญชีของท่านมีการขอคืนเงิน พวกเราจึงได้ทำการหักเพชรตามมูลค่าไอเทมที่ท่านได้คืนเงิน หากท่านมีข้อสงสัยใดๆสามารถติดต่อมาที่พวกเราได้",}
