M.Data[285005] = {"Liebe Spieler, die Wartung ist vorüber und die Server laufen wieder. Wir haben für euch eine Entschädigung vorbereitet. Holt sie euch in eurem Posteingang ab! Mehr Informationen findet ihr auf unserer Facebook-Seite. Danke für eure Unterstützung! Wir wünschen euch weiterhin viel Spielspaß!",false,"亲爱的玩家，本次维护已完成，服务器已开启，我们为每位玩家准备了以下奖励，请在邮件内领取！更多讯息请您关注我们的facebook，非常感谢您一直以来的支持！祝您游戏愉快！","Dear players, the maintenance is over and the servers are back online. Besides, we have prepared the following rewards for each player in this mail! For more information, please like and stay tuned to our Facebook Fanpage. Good gaming!","เรียนผู้เล่นทุกท่าน ตอนนี้เราได้ทำการปรับปรุงเซิร์ฟเวอร์เสร็จเรียบร้อยแล้ว พวกเราได้เตรียมของรางวัลให้กับผู้เล่นทุกท่านไว้แล้ว กรุณากดรับที่จดหมาย โปรดกดติดตาม Facebook ของพวกเรา เพื่อไม่ให้พลาดข่าวสารต่างๆมากมาย ขอขอบคุณการสนับสนุนจากผู้เล่นทุกท่านที่มีให้เรามาโดยตลอด ขอให้คุณมีความสุขไปกับเกมของพวกเรา !",}
