M.Data[285006] = {"Liebe Spieler, ein neuer Held ist im Anmarsch! Folgt unserer Facebook-Seite und nehmt an unserem Heldenwette teil, um tolle Belohnungen zu erhalten! Danke für eure Unterstützung! Wir wünschen euch weiterhin viel Spielspaß!",false,"亲爱的玩家，新英雄即将到来！请关注我们的facebook，参与新英雄竞猜活动将获得丰厚奖励，非常感谢您一直以来的支持！祝您游戏愉快！","Dear players, the new hero is coming soon. Please stay tuned to our Facebook Fanpage and participate in the New Hero Guess event to win the big reward. Thank you for your continued support! Good gaming!","เรียนผู้เล่นทุกท่าน ฮีโร่คนใหม่กำลังจะมาแล้ว ! โปรดกดติดตาม Facebook ของพวกเรา เพื่อร่วมกิจกรรมทายฮีโร่พร้อมรับของรางวัลต่างๆอีกมากมาย ขอขอบคุณการสนับสนุนจากผู้เล่นทุกท่านที่มีให้เรามาโดยตลอด ขอให้คุณมีความสุขไปกับเกมของพวกเรา !",}
