M.Data[134651] = {"Hauptfunktionen\n\nKampagne\nEntsende Heldenteams, um Auto-Kämpfe und Kampfvorfälle zu erledigen. In Kampagnen erhältst du Erfahrung, Lila Seelen, Gold, Ausrüstung u. v.m. Es werden von Zeit zu Zeit Aktionen mit doppelter Fund-Chance geöffnet. \n\nExpedition\nEin uneingeschränkter Kampf, bei dem du nacheinander nach Lust und Laune gegen andere Spieler von unterschiedlichen Servern kämpfst. Die LP der Helden werden während der Expedition nicht geheilt. Wähle deine Strategie weise!\n\nFata Morgana\nJede Ebene der Fata Morgana verfügt über einen Wächter. Besiege ihn, um viele Goldene Seelen und starke Ausrüstung zu erhalten. Wenn du eine bestimmte Ebene erreichst, kannst du außerdem einen 5-Sterne-Helden erhalten.\n\nArena\nIn der Arena forderst du andere Spieler heraus! Beim Sieg erhältst du Punkte und viele kostenlose Diamanten!\n\nTaverne\nDer schnellste Weg, um neue Helden zu erhalten. Sammle Herzen oder Schlüssel, um gratis Helden zu beschwören. Wenn die Beschwörungs-Energie 1000 erreicht, erhältst du garantiert einen 5-Sterne-Held.\n\nTempel\nDer unumgängliche Weg, um das Sternen-Level von Helden zu erhöhen. Im Tempel kann das Sternen-Level auf maximal Level 6 erhöht werden. Sammle genug Heldenmaterial, um das Sternen-Level zu erhöhen. Verbrauchte Materialhelden werden in Lila und Goldene Seelen des entsprechenden Werts umgewandelt. Die Ausrüstung der Materialhelden wird in das Inventar gelegt. Je mehr Helden du hast, desto besser stehen die Chancen auf eine Sternen-Level-Erhöhung.\n\nAltar\nWenn du nutzlose Helden hast, kannst du diese auf dem Altar zerlegen. Dafür erhältst du Lila Seelen, Goldene Seelen, Tränke, Heldenkerne u. v. m. Die Ausrüstung und Artefakte zerlegter Helden werden im Inventar abgelegt. Heldenkerne können im Altar-Laden gegen Helden eingetauscht werden. Heldenkerne können außerdem in einigen Aktionen beim Verkauf von Geschenken erhalten werden!\n\nSchmied\nBeim Schmied kannst du Ausrüstung von niedrigem Level zum höheren Level durch Schmieden verbessern. Das Tragen eines kompletten Sets bringt dir zusätzliche Set-Attribute! Hinweis: Getragene Ausrüstung wird nicht beim Schmied angezeigt.\n\nRoulette\nBeim Roulette werden Roulettemünzen ausgegeben, um eventuelle Helden-Teile, Ausrüstung, Artefakte, große Goldmengen, Lila Seelen etc. zu erhalten.\n\nMarkt\nDer Markt wird zu gegebener Zeit automatisch aktualisiert, er kann aber auch manuell aktualisiert werden. Hier gibt es Lila Seelen, Goldene Seelen, Helden-Teile, Ausrüstung, Schlüssel, Arenascheine u. v. m.\n\nYggdrasil\nHier kannst du mit Yggdrasilfrüchten bestimmte Lager-Beschwörungen durchführen. Dabei besteht die Chance, Helden des Lagers mit 4 oder 5 Sternen und deren Helden-Teile zu erhalten. (Yggdrasilfrüchte kannst du bei Entdeckungs-Questen finden oder in Aktionen eintauschen. In unregelmäßigen Aktionen können auch Geschenke gegen Yggdrasilfrüchte verkauft werden und im Laden der Prüfung sowie der Arena können sie gekauft werden.) Nach jeder Beschwörung erhältst du zusätzlich Yggdrasilteile. Damit kannst du einen Helden des Lagers in einen anderen Helden des gleichen Lagers umwandeln. Hinweis: Nur 4- oder 5-Sterne-Helden, die nicht dem Licht- oder Dunkel-Lager angehören, können umgewandelt werden.\n\nEntdecken\nBeim Entdecken wird alle 24 h eine Helden-Quest unterschiedlichen Sternen-Levels aktualisiert. Beim Erledigen der Quest erhältst du eine große Belohnung! Du kannst die Quest mit Juwelen aktualisieren oder beschleunigen. Mit Entdeckungs-Questenbüchern kannst du Questen erweitern (nach dem Aktualisieren werden die nicht durchgeführte Entdeckungs-Questen von Erweiterungen zurückgesetzt). Entdeckungs-Questenbücher kannst du im Auto-Kampf erhalten.\n",true,"主要功能\n\n战役\n派遣英雄小队进入战斗,进行挂机和完成战斗事件。在战役中您可以获得玩家经验、紫魂、金币、装备等奖励。官方会不定期开启双倍掉率活动。\n\n远征\n不受限制的连续战斗,尽情挑战来自不同服务器的玩家。英雄们的生命值在远征中不会恢复,需要您富有策略的使用它们！\n\n幻境\n幻境每一层都有守卫看管,战胜他们后您将获得大量英雄金魂和强力装备。达到一定楼层后还能获得5星的英雄。更多层数,更多挑战。\n\n竞技场\n挑战竞技场中其他的玩家！获得胜利后将增加积分,并赢得大量免费的钻石！\n\n英雄酒馆\n获取新英雄的最快途径。积攒更多的爱心或钥匙就可以免费进行英雄召唤。召唤能量达到1000后必定能获得5星英雄。\n\n神殿\n英雄升星的必经之路。在神殿中提升英雄的星级,最高可提升到6星。凑齐所需的材料英雄,就能在神殿中为英雄升星,升星后被消耗的材料英雄将返回对应价值的紫魂和金魂,其所穿戴的装备将返回背包。拥有的英雄越多,提升英雄星级的机会越多！ \n\n祭坛\n当您拥有闲置无用的英雄时,可以去祭坛将他们分解掉。分解英雄可获得一定价值的紫魂、金魂、强化剂、灵核等材料,被分解英雄的装备和神器将返回背包。分解英雄得到的灵核能够在祭坛商店中兑换英雄,灵核有时候也可以通过活动出售的礼包获得！\n\n铁匠铺\n通过铁匠铺把低级装备合成为高级装备。穿戴完整套装将激活套装属性！注意：已穿戴的装备将不会在铁匠铺中显示。\n\n幸运转盘\n在幸运转盘中消耗转盘币将有机会获取英雄碎片、装备、神器以及大量的金币、紫魂等道具,祝您好运常伴,大将不断！\n\n市场\n在市场中会定时刷新,也可手动刷新。出现紫魂、金魂、英雄碎片、装备、钥匙、竞技场门票等道具。\n\n世界树\n在世界树中可以进行指定阵营的召唤！使用世界树果实在指定阵营进行召唤,有几率获得该阵营4星、5星英雄及随机碎片(世界树果实可以通过探索任务获得；还可以通过活动兑换获取；不定期的活动礼包也会出售世界树果实；还可以通过英雄试炼中的商店购买；还可以在竞技场商店中购买)。每次召唤后会额外获得置换碎片。您可以消耗一定置换碎片将一个阵营的英雄置换成同阵营的其他英雄。注意：只有4、5星非光暗阵营的英雄才能进行置换。\n\n探索\n探索会每隔24小时定时刷新出不同星级的英雄任务。完成英雄任务将获得丰厚的奖励！您可以通过花费钻石刷新改变任务星级,也可以花费钻石加速完成任务。使用探索任务书可增加英雄任务(刷新后,未执行的使用任务书增加的探索任务会被重置)。探索任务书在挂机中有几率获得。\n","Main Features\n\nCampaign\nSend a team of heroes to perform auto-battle and complete Boss battles. Winning battles grants Team EXP, Purple Souls, Gold and gears. Sometimes there\'re events which double the dropped loots.\n\nExpedition\nYou can challenge players from all servers without any limitation. Your heroes\' HP will not be restored after each battle, that\'s why it\'s so important to use your heroes wisely!\n\nMirage\nThe Mirage is heavily guarded. Defeating those guards grants lots of Golden Souls and powerful gears. Some stages even gift you 5-star heroes! Higher floors, larger challenges!\n\nArena\nChallenge other players in the Arena! Victories grant you Arena scores and free Gems!\n\nHero Pub\nThe fastest way to get new heroes! Gather more Hearts or Keys to summon heroes for free. When Summon Energy reaches 1,000, you will get a random 5-star hero.\n\nTemple\nThe only way to increase your heroes\' star levels (up to 6-star). Fusing the host hero with material heroes will increase his star level. Golden Souls and Purple Souls will be returned to the Bag according to the consumed heroes, along with their equipped gears.\n\nAltar\nThe Altar is used to decompose heroes you no longer need. Golden Souls, Purple Souls, Potions and Hero Cores will be returned to the Bag, along with their equipped gears and Artifacts.\n\nBlacksmith\nIt forges low-quality gears into advanced gears! A full set of gears equipped can activate set stats! Attention: Equipped gears won\'t be shown at the Blacksmith.\n\nRoulette\nYou can test your luck here by using Roulette Coins to look for Hero Shards, gears, Artifacts, Gold or Golden Souls. Good luck!\n\nShop\nThe Shop refreshes items regularly. You can also refresh the items manually. Items such as Purple Souls, Golden Souls, Hero Shards, gears, Keys and Arena Tickets can be found here.\n\nWorld Tree\nYou can summon heroes of specified factions in the World Tree! A World Tree Summon costs one World Fruit and grants a 4-star or 5-star hero or Hero Shards (World Tree Fruits can be gained from Explore Quests, exchange events, event packs or Arena Shop). Each Summon also grants some World Tree Shards, which can be used to convert a hero into another one of the same faction. Attention: only 4-star or 5-star heroes of Water/Wood/Fire factions can be converted.\n\nExplore\nThis is the place where you can send your heroes on quests of different stars. The quests refresh every 24 hours. Completing these quests grants you great rewards! You can spend Gems to instantly complete the quests or refresh them. Quest Books can be used to get new quests (which will be reset by refreshing if they are not completed). Quest Books may be gained from auto-battle.","ฟังก์ชั่นหลัก\n\nสมรภูมิ\nฮีโร่ทีมสำรวจเข้าร่วมต่อสู้แบบออโต้และต่อสู้ให้สำเร็จ การต่อสู้ในสมรภูมิจะได้รับรางวัลต่างๆเช่น EXP วิญญาณม่วง เหรียญทอง อุปกรณ์ หรือในบางครั้งจะมีกิจกรรมที่ทำให้ดรอปของรางวัลเป็นสองเท่า\n\nเดินทาง\nคุณสามารถต่อสู้กับผู้เล่นที่มาจากเซิร์ฟเวอร์อื่นได้โดยไม่มีข้อจำกัด หลังจากจบการต่อสู้ในแต่ละรอบ HP ของฮีโร่ที่เดินทางจะไม่มีการฟื้นฟู ดังนั้นต้องวางแผนในการใช้ฮีโร่ของคุณให้ดี !\n\nแดนความฝัน\nแดนความฝันในแต่ละชั้นจะมีผู้พิทักษ์คอยเฝ้าอยู่ หลังจากชนะพวกเขาก็จะได้รับวิญญาณทองและอุปกรณ์สุดแข็งแกร่งมากมาย เมื่อถึงชั้นที่กำหนดยังจะได้รับฮีโร่ 5 ดาวอีกด้วย จำนวนชั้นยิ่งสูง การต่อสู้ก็ยิ่งท้าทายขึ้น\n\nอารีน่า\nร่วมท้ารบไปกับเหล่าผู้เล่นคนอื่นๆในอารีน่า ! เอาชนะคู่ต่อสู้เพื่อรับคะแนนและเพชรฟรีจำนวนมาก !\n\nคลับฮีโร่\nช่องทางที่เร็วที่สุดที่จะได้รับฮีโร่ตัวใหม่ สะสมหัวใจหรือกุญแจเพื่ออัญเชิญฮีโร่ได้ฟรี และเมื่อพลังอัญเชิญครบ 1000 แต้ม จะได้รับฮีโร่ 5 ดาวฟรี\n\nวิหาร\nสถานที่ที่ใช้สำหรับอัพดาวให้กับฮีโร่ ให้เป็นฮีโร่ระดับ 6 ดาว รวบรวมวัตถุดิบให้ครบเพื่อทำการอัพดาวให้กับฮีโร่ โดยหลังจากอัพดาวสำเร็จ วิญญาณม่วง วิญญาณทองและอุปกรณ์ทั้งหมดจะถูกส่งคืนไปยังกระเป๋า ยิ่งมีฮีโร่เยอะ โอกาสในการอัปเกรดฮีโร่ของคุณก็ยิ่งเยอะไปด้วย ! \n\nแท่นบูชา\nหากคุณมีฮีโร่ที่ไม่ได้ใช้ สามารถนำพวกเขาเหล่านั้นไปย่อยได้ที่แท่นบูชา เมื่อทำการย่อยฮีโร่จะได้รับวิญญาณม่วง วิญญาณทอง น้ำยาตีบวก จิตฮีโร่ตามที่กำหนด โดยอุปกรณ์ที่ติดตัวอยู่กับฮีโร่ที่ถูกย่อยนั้น จะถูกส่งคืนไปที่กระเป๋า การย่อยฮีโร่จะทำให้ได้รับจิตฮีโร่ โดยสามารถนำจิตฮีโร่ไปแลกฮีโร่ได้ที่ร้านค้าแท่นบูชา ในบางครั้ง จิตฮีโร่ยังสามารถหาซื้อได้จากแพ็กกิจกรรมอีกด้วย !\n\nร้านตีเหล็ก\nร้านตีเหล็กเป็นสถานที่ที่ใช้รวมอุปกรณ์ระดับต่ำให้เป็นอุปกรณ์ระดับสูงได้ เมื่อใส่อุปกรณ์แบบครบเซ็ตจะสามารถเปิดใช้สกิลเซ็ตได้ ! หมายเหตุ: อุปกรณ์ที่สวมใส่อยู่จะไม่ปรากฏในร้านตีเหล็ก\n\nรูเล็ตนำโชค\nใช้เหรียญรูเล็ตเพื่อทำการหมุนรูเล็ต มีโอกาสที่จะได้รับไอเทมต่างๆเช่น เศษฮีโร่ อุปกรณ์ อาวุธเทพ ทองจำนวนมากและวิญญาณม่วง ขออวยพรให้คุณโชคดีนะ !\n\nร้านค้า\nเมื่อถึงเวลาที่กำหนด สินค้าในร้านค้าจะทำการรีเฟรชอัตโนมัติ หรือสามารถรีเฟรชด้วยตนเองได้ โดยจะได้รับไอเทม เช่น วิญญาณม่วง วิญญาณทอง เศษฮีโร่ อุปกรณ์ กุญแจ ตั๋วอารีน่า เป็นต้น\n\nต้นไม้โลก\nที่ต้นไม้โลกนั้น สามารถอัญเชิญธาตุได้ตามที่กำหนด โดยจะต้องใช้ผลไม้ต้นไม้โลกในการอัญเชิญ มีโอกาสที่จะได้รับฮีโร่ธาตุนั้นๆระดับ 4 – 5 ดาว หรือเศษฮีโร่แบบสุ่ม (ผลไม้ต้นไม้โลกสามารถหาได้จากการทำเควสสำรวจ;จากการแลกรางวัลในกิจกรรม;จากแพ็กเกจกิจกรรม;จากร้านค้าฝึกฮีโร่;หรือจากร้านค้าอารีน่า) หลังจากที่ทำการอัญเชิญในแต่ละครั้งจะได้รับเศษต้นไม้โลก สามารถนำเศษต้นไม้โลกไปใช้แปลงฮีโร่เป็นฮีโร่ตัวอื่นในธาตุเดียวกันได้ หมายเหตุ: สามารถแปลงได้เฉพาะฮีโร่ระดับ 4 ดาว และ 5 ดาวเท่านั้น\n\nสำรวจ\nเป็นสถานที่ที่จะให้คุณส่งฮีโร่เข้าไปทำภารกิจตามระดับภารกิจฮีโร่ที่แตกต่างกันไป โดยจะรีเฟรชทุกๆ 24 ชั่วโมง เมื่อคุณทำภารกิจฮีโร่สำเร็จก็จะได้รับรางวัลเป็นจำนวนมาก คุณสามารถใช้เพชรรีเฟรชระดับของภารกิจหรือเร่งความเร็วความสำเร็จของภารกิจได้ คุณสามารถใช้ตำราเควสสำรวจเพิ่มจำนวนภารกิจฮีโร่ได้ (หลังจากรีเฟรช เควสที่เพิ่มมาจากตำราเควสสำรวจก็จะถูกรีเฟรชไปด้วย) โดยตำราเควสสำรวจนั้นมีโอกาสดรอปจากการต่อสู้ออโต้\n",}
