M.Data[134655] = {"Helden stärker machen\nHeldenlevel erhöhen\nHeldenlevel können mit Lila Seelen erhöht werden.\n\nHeldenentwicklung\nSobald das Heldenlevel die Obergrenze erreicht, kannst du den Rangs durch Goldene Seelen erhöhen.\n\nStern-Level erhöhen\nWenn Heldenlevel und -Rang die Obergrenze erreichen, kannst du in der Formation das Stern-Lv. des Helden erhöhen. So erhöhen sich seine Attribute, er behält aber das Level, die Ausrüstung und den Rang.\n\nErwachen\nVerbrauche Helden als Material für Helden auf Stern-Lv. 6, um sie erwachen zu lassen. Dies erhöht ihr Stern-Lv., ihre Attribute und verbessert passive Fähigkeiten. Verbrauchte Helden werden außerdem in Lila Seelen umgewandelt.\n\nAusrüstung und Artefakte\nAusrüstung und Artefakte steigern die Macht der Helden. Je höher das Level und der Rang von Ausrüstung und Artefakten ist, desto mehr Macht erhält der jeweilige Held.\n\nTränke\nDurch das Erhöhen des Trank-Levels und das Umwandeln von Tränken kannst du Helden verbessern. Die Levelerhöhung und das Umwandeln von Tränken benötigt Tränke und Gold.",true,"英雄变强的方法\n英雄升级\n通过消耗紫魂来提升英雄等级。\n\n英雄进阶\n当英雄等级达到上限,可通过消耗金魂来提升等级的品阶。\n\n英雄升星\n当英雄等级和品阶升满后,可在创造法阵为其升星,升星后将提升英雄的属性,并且等级、装备、品阶都将保留。\n\n英雄觉醒\n消耗材料英雄使6星英雄以上的觉醒,觉醒将提升英雄的星级、属性以及强化英雄被动技能,被消耗的英雄将返还一定数量的紫魂。\n\n穿戴装备和神器 \n给英雄穿戴装备和神器来提升英雄的战斗力,装备和神器的星级和品质越高,给英雄增加的战斗力越多。\n\n升级强化剂\n通过升级和转化英雄身上的强化剂,来提高英雄的能力,升级和转化需要消耗一定数量的强化剂和金币。","How To Enhance Heroes:\n\nHero Level-up\nHeroes\' level can be increased by consuming Purple Souls.\n\nHero Promotion\nYou can use Golden Souls to promote a hero\'s rank when he reaches the max level.\n\nHero Star-up\nWhen a hero reaches the max level and rank, you an increase his star level in the Temple. The hero\'s stats will be greatly increased.\n\nHero Awaken\n6-star or above heroes can be awakened by consuming material heroes. Awakening can increase the hero\'s star level and stats as well as enhance his passive skills. A certain amount of Purple Souls will be returned for the consumed heroes.\n\nGear & Artifact\nEquip your heroes with gears and Artifacts to increase their power. The higher the gears\' /Artifacts\' star level or quality, the more the power increase.\n\nUpgrade Potion\nSpend a certain amount of Potions and Gold to upgrade or convert Potions to increase heroes\' power.","วีธีการเพิ่มพลังฮีโร่\nอัพฮีโร่\nอัพเลเวลฮีโร่โดยใช้วิญญาณม่วงในการอัพเกรด\n\nอัพขั้นฮีโร่\nเมื่ออัพเลเวลฮีโร่จนเต็ม สามารถอัพขั้นฮีโร่ได้โดยใช้วิญญาณทองในการอัพเกรด\n\nอัพดาวฮีโร่\nหลังจากอัพเลเวลและขั้นฮีโร่จนเต็ม จะสามารถอัพดาวของฮีโร่ได้ที่วิหาร หลังจากเอัพดาวสำเร็จสเตตัสของฮีโร่ก็จะเพิ่มขึ้น ทั้งเลเวล อุปกรณ์และระดับขั้นของอุปกรณ์จะยังคงอยู่\n\nปลุกฮีโร่\nใช้วัตถุดิบเพื่อปลุกฮีโร่ที่มีระดับ 6 ดาวขึ้นไป เมื่อทำการปลุกฮีโร่ ก็จะอัพเกรดระดับดาว สเตตัส และสกิลพาสซิฟของฮีโร่ขึ้น วิญญาณม่วงของฮีโร่ที่ถูกใช้เป็นวัตถุดิบจะถูกคืนให้ตามจำนวนที่กำหนด\n\nการใส่อุปกรณ์และอาวุธเทพ \nเมื่อฮีโร่สวมใส่อุปกรณ์หรืออาวุธเทพ พลังรบของฮีโร่ก็จะเพิ่มขึ้น ระดับดาวและคุณภาพของอุปกรณ์ยิ่งสูง พลังรบที่เพิ่มขึ้นก็ยิ่งมาก\n\nอัพน้ำยาตีบวก\nใช้น้ำยาตีบวกและทองตามที่กำหนดเพื่ออัพเกรดหรือแปลงน้ำยาตีบวก ใช้สำหรับเพิ่มพลังให้กับฮีโร่",}
