M.Data[134657] = {"Ausrüstung und Artefakte\nQualität\nAusrüstung und Artefakte werden anhand ihrer Farben in 7 Qualitätsstufen unterteilt: Weiß, Grün, Blau, Gelb, Lila, Orange und Rot. Je höher die Qualität, desto mehr Attribute steigern sie.\n\nSterne\nWeiße und grüne Ausrüstung kann 1 - 2 Sterne haben, blaue Ausrüstung 1 - 3 Sterne. Gelbe und bessere Ausrüstung kann 1 - 4 Sterne haben.\nWeiße und grüne Artefakte können 1 - 4 Sterne haben. Blaue, gelbe, lila und orange Artefakte können 1 - 5 Sterne haben. Rote Artefakte können 1 - 6 Sterne haben. Ausrüstung und Artefakte der gleichen Qualität steigern mehr Attribute, wenn sie ein höheres Stern-Lv. haben.\n\nSchmieden\nBeim Schmied kannst du minderwertige Ausrüstung in höherwertige umwandeln. Sammle genug Artefaktteile, um das entsprechende Artefakt herzustellen.\n\nAusrüstung erhalten\nAusrüstung findest du hier: Auto-Kampf, Fata Morgana, Vorfälle in Ebenen, Markt, Expeditionsladen, Gildenladen, Glücksladen. Beim Roulette kannst du auch Ausrüstung erhalten.\n\nAusrüstungssets\nGelbe und höhere Ausrüstung verfügt über Set-Effekte. Lege eine bestimmte Anzahl an Ausrüstungsteilen an, um Set-Effekte zu aktivieren.\n\nArtefaktlevel erhöhen\nVerbrauche überflüssige Artefakte, um das Level des getragenen Artefakts zu steigern. Durch die Levelerhöhung steigt auch das Stern-Lv. des Artefakts.\n\nArtefakte erhalten\nIm Auto-Kampf und Gildenladen findest du Artefaktteile, die du zu Artefakten fusionieren kannst. Beim Roulette kannst du Artefakte erhalten.",true,"装备和神器\n装备、神器的品质\n装备和神器根据颜色划分为白色、绿色、蓝色、黄色、紫色、橙色、红色7种品质,装备和神器品质越高,增加属性越多。\n\n装备、神器的星级\n白色、绿色品质的装备有1-2星2种星级,蓝色品质的装备有1-3星3种星级,黄色品质以上的装备有1-4星4种星级；\n白色、绿色品质的神器有1-4星4种星级,蓝色、黄色品质的神器有1-5星5种星级,紫色、橙色品质的神器有1-5星5种星级,红色以上品质的装备有1-6星6种星级；同品质的装备和神器星级越高,增加的属性越多。\n\n合成装备、神器\n在铁匠铺中可以消耗低品质的装备来合成高品质的装备；凑齐一定数量神器碎片可合成对应品质的神器。\n\n获取装备\n挂机、幻境、通关战斗事件会掉落装备,在市场、远征商店、公会商店、幸运商店会出售装备,在幸运转盘有几率获得装备。\n\n装备套装\n黄色品质以上的装备将带有套装效果,穿戴指定数目的套装即可激活套装效果。\n\n升级神器\n通过吞噬多余的神器来给英雄当前穿戴的神器升级,神器升级将提升神器的星级。\n\n获取神器\n可以通过挂机获取神器碎片来合成神器、公会商店购买神器碎片来合成神器、幸运转盘有几率获得神器。","Gear & Artifact\n\nGear & Artifact Quality\nThere are 7 gear & Artifact qualities: white, green, blue, yellow, purple, orange,and red. The higher the quality, the more the bonus stats.\n\nGear & Artifact Star Level\nWhite or green gears have the star level of 1-2, blue gears have the star level of 1-3, yellow or above quality gears have the star level of 1-4.\nWhite or green Artifacts have the star level of 1-4, blue, yellow, purple or orange Artifacts have the star level of 1-5, red Artifacts have the star level of 1-6. The higher the star level, the more the bonus stats.\n\nFuse Gears & Artifacts\nLow-quality gears can be forged into advanced gears in the Blacksmith. A certain number of Artifact Shards can be fused into an Artifact of the corresponding quality.\n\nGet Gear\nGears can be gained from auto-battle, Mirage or Boss battles, or purchased from the Shop, Expedition Shop, Guild Shop and Luck Shop. The Roulette also grants gears with certain chances.\n\nGear Set\nYellow or above gears have set effects, which can be activated by equipping a certain number of gears of a same set.\n\nArtifact Level-up\nMaterial Artifacts can be consumed to level up the Artifact which increases the Artifact\'s star level.\n\nGet Artifact\nArtifacts can be fused from Artifact Shards, which can be gained from auto-battle or Guild Shop. The Roulette also grants Artifacts with certain chances.","อุปกรณ์และอาวุธเทพ\nคุณภาพของอุปกรณ์และอาวุธเทพ\nคุณภาพของอุปกรณ์และอาวุธเทพจะแบ่งระดับตามสีออกเป็น 7 สี ได้แก่ สีขาว สีเขียว สีฟ้า สีเหลือง สีม่วง สีส้ม และสีแดง ระดับของอุปกรณ์ยิ่งสูง ยิ่งบวกสเตตัสให้กับฮีโร่เยอะขึ้น\n\nระดับดาวของอาวุธและอาวุธเทพ\nอุปกรณ์สีขาวและสีเขียวจะมีระดับดาว 2 ระดับคือ 1-2 ดาว อุปกรณ์สีฟ้าจะมีระดับดาว 3 ระดับคือ 1-3 ดาว อุปกรณ์สีเหลืองขึ้นไปจะมีระดับดาว 4 ระดับคือ 1-4 ดาว;\nอาวุธเทพสีขาวและสีเขียวจะมีระดับดาว 4 ระดับคือ 1-4 ดาว อาวุธเทพสีฟ้าและสีเหลืองจะมีระดับดาว 5 ระดับคือ 1-5 ดาว อาวุธเทพสีม่วงและสีส้มจะมีระดับดาว 5 ระดับคือ 1-5 ดาว อุปกรณ์สีแดงขึ้นไปจะมีระดับดาว 6 ระดับคือ 1-6 ดาว;อุปกรณ์และอาวุธเทพที่เป็นระดับเดียวกันยิ่งมีจำนวนดาวที่สูง ยิ่งเพิ่มสเตตัสมาก\n\nการรวมอุปกรณ์ อาวุธเทพ\nสามารถนำอุปกรณ์ระดับต่ำมารวมเป็นอุปกรณ์ระดับสูงได้ที่ร้านตีเหล็ก;สามารถเก็บรวบรวมเศษอาวุธเทพให้ครบตามจำนวนที่กำหนดเพื่อนำมารวมเป็นอาวุธเทพ\n\nการได้รับอุปกรณ์\nอุปกรณ์จะดรอปจากการต่อสู้ออโต้ แดนความฝัน ผ่านด่านการต่อสู้กับ Boss หรือสามารถหาซื้อได้จากร้านค้า ร้านค้าเดินทาง ร้านค้ากิลด์ ร้านโชคดี หรือสามารถหาได้จากการสุ่มในรูเล็ตนำโชค\n\nเซ็ตอุปกรณ์\nอุปกรณ์ระดับสีเหลืองขึ้นไปจะมีเอฟเฟกต์เซ็ตอุปกรณ์ สามารถเปิดใช้เอฟเฟกต์เซ็ตอุปกรณ์ได้โดยการสวมอุปกรณ์ตามจำนวนที่กำหนด\n\nอัพอาวุธเทพ\nสังเวยวัตถุดิบเพื่อนำมาอัพอาวุธเทพที่สวมใส่อยู่ เมื่ออัพอาวุธเทพ ระดับดาวของอาวุธเทพก็จะเพิ่มขึ้น\n\nการได้รับอาวุธเทพ\nสามารถหาเศษอาวุธเทพได้จากการต่อสู้ออโต้ หรือสามารถหาซื้อได้ที่ร้านค้ากิลด์ จากนั้นนำเศษอาวุธเทพมารวมเพื่อรับอาวุธเทพ หรือจากการสุ่มรูเล็ตนำโชคก็มีโอกาสที่จะได้รับอาวุธเทพเหมือนกัน",}
