M.Data[134658] = {"Gilde\nBeitritt\nGib im Gildenmenü den Gildennamen ein, um die Gilde zu suchen. Tippe auf „Anmelden“. Wenn die Gilde deine Anmeldung akzeptiert, trittst du der Gilde bei.\n\nGründen\nIm Gildenmenü kannst du deine eigene Gilde gründen. Dies kostet Juwelen und du benötigst ein bestimmtes Level. Deine Gilde kann Aufnahmeanträge anderer Spieler akzeptieren und sie zu Mitgliedern machen. \n\nGildenanführer ernennen\nDer Anführer einer Gilde kann im Gildenmitgliedermenü über den „Ernennen“-Button die Anführerschaft an ein anderes Gildenmitglied abgeben. \n\nGildenlevel\nDurch tägliches Einloggen können alle Mitglieder das Gildenlevel erhöhen.\n\nGildeninhalt\nGildenmitglieder können u. a. Folgendes nutzen: Gildenboss, Minen, Gildenkrieg. Dabei erhältst du Gildenmünzen und Objekte als Belohnung. \n\nGildentechnik\nBei der Gildentechnik kannst du mit Gildenmünzen und Gold die Gildenfähigkeiten verbessern. Die Erhöhung bestimmter Fähigkeiten verbessert auch deine Helden der entsprechenden Klasse. \n\nFunktionen\nAlle Gildenmitglieder können durch den täglichen Gilden-Check-In das Gildenlevel steigern. Die Anzahl der täglichen Steigerungen darf nicht die Anzahl der Gildenmitglieder übersteigen. Gildenboss, Minen, Gildenkriege usw. stehen den Mitgliedern zur Verfügung. Hier erhältst du Gildenmünzen und andere Belohnungen. Im Gildenladen kannst du mit Gildenmünzen einkaufen. Gildentechnik erhöht mit Hilfe von Gildenmünzen deine Gildenfähigkeiten.",true,"公会\n加入公会\n在公会界面输入公会名称搜索公会,点击申请即可向公会发送申请。公会申请被允许后即可加入公会。\n\n创建公会\n在公会界面中创建公会,创建公会消耗一定数量的钻石并且需要您达到一定的等级,创建成功后您就可以接受其他玩家的申请,使其成为公会成员。\n\n公会会长任命\n公会会长可以在公会成员菜单中点击会长任命按钮,把会长职位委任给其他的公会成员。\n\n公会等级\n公会所有成员每日签到能够提升公会等级\n\n公会玩法\n公会成员可以参与到公会副本、矿脉、公会战等玩法中,获得公会币以及其他道具奖励。\n\n公会商店\n在公会商店中可以使用公会币以及金币来升级公会技能,对应职业公会技能的提升能够增强您拥有的对应职业的英雄。\n\n公会功能\n公会所有成员每天可以通过公会签到来提升公会的等级,每天签到增加公会经验的次数不能超过公会成员人数。公会成员可以参与到公会副本、矿脉、公会战等玩法中,获得公会币以及其他奖励,在公会商店使用公会币购买商品,在科技使用公会币来提升公会技能。","Guild\n\nJoin Guild\nInput guild\'s name to search for it. Tap \"APPLY\" to send an request to join the guild. When your request is approved, you will join the guild.\n\nCreate Guild\nTo create a guild, you must be of the required team level and spend a certain number of Gems. After your guild is created, you can invite others to join or approve others\' requests.\n\nAppoint Leader\nYou can transfer your leadership to another member by tapping \"LEADER TRANSFER\" on the guild member menu.\n\nGuild Level\nGuild members can check in daily to upgrade the guild.\n\nGuild Technology\nGuild members can upgrade guild skills with Guild Coins and Gold. Upgrading the skills of different hero classes can enhance the heroes of the corresponding classes.\n\nGuild Shop\nGuild members can purchase items in Guild Shop with Guild Coins. If the items are sold out, the shop can be refreshed and replenished with Guild Coins.\n\nGuild Features\nGuild members can check in daily to upgrade the guild. Number of EXP-granting daily check-ins cannot exceed the number of guild members. They can also join in Guild Boss, Guild Mine and Guild War to win Guild Coins and other items. They can purchase items in Guild Shop or upgrade guild skills in Technology with Guild Coins.","กิลด์\nการเข้าร่วมกิลด์\nที่หน้าเมนูกิลด์ กรอกชื่อกิลด์ในช่องค้นหา และคลิกที่คำขอ เพื่อทำการส่งคำขอในการสมัครกิลด์ หลังจากคำขอสมัครได้รับการยืนยันก็จะเข้าร่วมกิลด์ได้\n\nการสร้างกิลด์\nคลิกที่สร้างกิลด์ที่อยู่ในหน้าเมนูกิลด์ โดยจะต้องใช้เพชรตามจำนวนที่กำหนดและเมื่อถึงเลเวลที่กำหนดแล้วก็จะสามารถสร้างกิลด์ได้ หลังจากที่สร้างกิลด์สำเร็จ คุณก็จะสามารถยอมรับคำขอการสมัครกิลด์จากผู้เล่นคนอื่นได้ เมื่อกดรับคำขอการสมัครเข้ากิลด์ ผู้เล่นดังกล่าวก็จะกลายเป็นสมาชิกกิลด์ทันที\n\nการแต่งตั้งหัวหน้ากิลด์\nหากต้องการแต่งตั้งให้สมาชิกคนอื่นในกิลด์เป็นหัวหน้ากิลด์ ให้หัวหน้ากิลด์คลิกที่ปุ่มแต่งตั้งหัวหน้ากิลด์ที่อยู่ในเมนูกิลด์\n\nเลเวลกิลด์\nเมื่อสมาชิกทั้งหมดในกิลด์เช็คอินในแต่ละวัน จะทำให้เลเวลกิลด์เพิ่มขึ้น\n\nการเล่นกิลด์\nสมาชิกที่อยู่ในกิลด์จะสามารถเข้าร่วมดันเจี้ยนกิลด์ เหมือง และศึกกิลด์ได้ และจะได้รับของรางวัลเป็นเหรียญกิลด์และไอเทมต่างๆ\n\nร้านค้ากิลด์\nภายในร้านค้ากิลด์ สมาชิกกิลด์สามารถใช้เหรียญกิลด์กับทองอัพสกิลกิลด์ได้, การอัพสกิลกิลด์ของแต่ละอาชีพ จะช่วยเพิ่มความแกร่งให้แก่ฮีโร่ที่คุณมีของแต่ละสายอาชีพ\n\nฟังก์ชั่นกิลด์\nทุกๆวันสมาชิกกิลด์ทุกคนสามารถเช็คอินกิลด์เพื่ออัพเลเวลกิลด์, โดยที่เช็คอินแต่ละวันก็จะเพิ่ม EXP กิลด์ ซึ่งจำนวนการเช็คอินในแต่ละวันนั้นจะต้องไม่เกินจำนวนสมาชิกในกิลด์ สมาชิกกิลด์สามารถเข้าร่วมดันเจี้ยนกิลด์ เหมือง และศึกกิลด์ได้, โดยจะได้รับรางวัลเป็นเหรียญกิลด์และไอเทมอื่นๆ, สมาชิกกิลด์สามารถใช้เหรียญกิลด์ซื้อสินค้าในร้านค้ากิลด์ได้, และยังสามารถใช้เหรียญกิลด์อัพสกิลกิลด์ในเทคโนโลยีกิลด์ได้",}
