M.Data[134659] = {"Freunde\nHerzen\nFreunde können sich Herzen schenken, womit die Freundschaftsbeschwörung in der Taverne durchgeführt werden kann. \n\nFreunde löschen\nDu kannst im Freunde-Menü das Porträt eines Freundes antippen und dann „Löschen“ wählen.\n\nKoop\nAlle 8 Stunden hast du die Chance, einen Koop-Boss zu finden und Gold, Heldenteile und andere Belohnungen zu erhalten. Besiege den Boss mit deinen Freunden und erhalte Belohnungen sowie Punkte. Anhand der Punkte wird wöchentlich eine Rangliste erstellt, auf deren Basis Belohnungen versandt werden.",true,"好友\n爱心\n好友之间可相互赠送爱心,爱心用于英雄宝典中进行友情召唤。\n\n删除好友\n您可以在好友界面点击好友头像查看好友信息,在好友信息框点击删除按钮删除好友。\n\n好友助战\n每8小时获得一次搜寻机会,一定概率搜寻到好友BOSS以及金币、英雄碎片等奖励,帮助好友打败好友BOSS获得随机奖励和积分,每周根据积分排名来发放奖励。","Friend\n\nHeart\nFriends can send Hearts to each other. They are used to perform Heart Summons in the Hero Pub.\n\n Delete Friend\n You can tap on a friend\'s avatar and then tap \"DELETE\" to remove this friend from your list.\n\nFriend Co-op\nA searching chance is granted every 8 hours. Each searching has a chance to find a Boss or grant rewards such as Gold or Hero Shards. Helping friends defeat their Bosses grants random rewards and scores. Players are ranked by their scores and will be rewarded according to the ranking.","เพื่อน\nหัวใจ\nคุณสามารถส่งหัวใจให้กับเพื่อนได้ โดยสามารถใช้หัวใจทำการอัญเชิญมิตรภาพจากหีบสมบัติฮีโร่ได้\n\nการลบเพื่อน\nคลิกที่รูปโปรไฟล์เพื่อดูข้อมูลของเพื่อน คลิกที่ปุ่มลบเพื่อนที่อยู่ในข้อมูลของเพื่อน\n\nเพื่อนช่วยรบ\nทุกๆ 8 ชั่วโมงจะได้รับโอกาสในการค้นหา 1 ครั้ง โดยการค้นหานั้นมีโอกาสที่จะเจอ Boss เพื่อน ทอง หรือเศษฮีโร่ เมื่อช่วยเพื่อนกำจัด Boss ได้สำเร็จจะได้รับรางวัลละคะแนน ในแต่ละสัปดาห์จะได้รับรางวัลตามอันดับคะแนนของผู้เล่น",}
