M.Data[134660] = {"FAQ\n1. F: Ich habe das Handy gewechselt. Wie kann ich weiterspielen?\n\nA: Lade das Spiel herunter und tippe im Anmeldemenü oben rechts auf den Button, um dein Konto und Passwort einzugeben und in dein Spiel zu gelangen.\n\n2. F: Ich habe meine Kontoinformationen vergessen. Kann ich sie wiedererhalten?\n\nA: Es ist leider nicht möglich, deine Kontoinformationen wiederzuerhalten. Präge sie dir also gut ein!\n\n3. F: Was kann ich tun, wenn jemand mein Konto gestohlen und das Passwort geändert hat?\n\nA: Wenn dein Passwort von Dritten geändert wurde, solltest du schleunigst unseren Kundenservice kontaktieren.\n\n4. F: Was kann ich tun, wenn ich mich aufgrund von Netzproblemen nicht anmelden kann?\n\nA: Versuche weiterhin, dich anzumelden und wenn das nicht funktioniert, solltest du das Spiel komplett neustarten.\n\n5. F: Was kann ich tun, wenn das Spiel immerzu aktualisiert wird und ich nicht in das Spiel komme?\n\nA: Wenn das Spiel unaufhörlich aktualisiert wird und sich deshalb nicht starten lässt, solltest du alle Spielprozesse beenden und das Spiel neu starten. Du kannst auch versuchen, das Spiel in einer anderen Netzumgebung zu starten. Sollte das Problem weiterhin bestehen, kannst du dich an unseren Kundenservice wenden.\n\n6. F: Was kann ich tun, wenn meine Daten oder mein Konto weg sind?\n\nA: Wenn deine Daten verschwunden sind, solltest du zunächst sicherstellen, dass du dich auf dem richtigen Server angemeldet hast. Die Server teilen untereinander keine Daten. Solltest du auf dem korrekten Server angemeldet sein und deine Daten dennoch verschwunden sein, dann melde dich bitte umgehend bei uns. Teile uns dabei deine Spiel-ID und registrierte E-Mail-Adresse mit.\n\n7. F: Mein Spiel stürzt laufend aufgrund von Netzproblemen ab. Was kann ich tun?\n\nA: Bitte stelle zunächst sicher, dass deine Netzwerkumgebung problemlos funktioniert. Du kannst auch die Netzwerkumgebung wechseln und dich erneut anmelden. Bitte kontaktiere uns, wenn das Problem weiterhin bestehen sollte.\n\nF: Was soll ich tun, wenn das Spiel laufend abstürzt?\n\nA: Beende bitte alle Spielprozesse und starte das Spiel erneut. Sollte das Problem weiterhin bestehen, kannst du dein Gerät neu starten oder unseren Kundendienst kontaktieren. Teile uns dabei deinen Gerätetyp mit.\n\n9. F: Was kann ich tun, wenn ich auf Cheater treffe?\n\nA: Wir wollen vermeiden, dass Spieler sich aufgrund von Bugs unfaire Vorteile verschaffen. Deshalb solltest du uns umgehend Cheater melden. Wir kümmern uns dann um sie.",true,"常见游戏问题\n1.问：换了设备后,怎样才能继续游戏？\n\n答：下载好并进入游戏后,在登录界面上点击右上角的按钮输入您的账号和密码来登录进入游戏。\n\n2.问：忘记了账号是否能够找回？\n\n答：忘记了账号将无法找回,请一定要牢记您的账号和密码。\n\n3.问：账号被盗,密码被更改了怎么办？\n\n答：当您的账号密码被更改请及时与我们的客服人员联系。\n\n4.问：出现网络超时,无法登录怎么办？\n\n答：如果你无法登录游戏,请继续尝试连接,或者杀掉游戏进程重启游戏。\n\n5.问：当游戏一直在更新中无法进入游戏怎么办？\n\n答：当您进入游戏遇到一直在更新无法进入游戏时,请尝试杀掉游戏进程后重启游戏或更换网络再次尝试,如依然无法解决请与我们的客服人员联系。\n\n6.问：当数据或者账号丢失了该怎么办？\n\n答：如果遇到数据丢失的情况,首先确认您登录的服务器是否正确,因为不同服务器之间数据不共享,如果确认服务器正确但依然存在问题请及时与我们联系。联系时请尽量提供游戏ID,注册邮箱等信息,我们将给予您最大的帮助。\n\n7.问：在玩游戏的过程中老是掉线该怎么办？\n\n答：您在玩游戏的过程中出现频繁掉线时请先确认您的设备网络状态是否异常,并更换网络环境再次尝试。若依然无法解决请与我们联系。\n\n8.问：当游戏出现闪退怎么办？\n\n答：当您游戏遇到闪退时,请先杀掉设备所有进程在尝试重新进入游戏,依然存在闪退情况重启设备再次尝试或者与客服人员提供您的设备型号反映闪退问题。\n\n9.问：发现作弊的玩家怎么办？\n\n答：我们致力于为玩家创造一个公平的游戏环境,禁止任何玩家使用游戏中的BUG来恶意破坏游戏平衡。当您发现有玩家作弊,请及时给我们反馈,我们将对作弊玩家予以处理。","FAQ - Game\nQ1: I have just changed my device. How do I continue the game?\n\nA1: Download the game on the new device. Then tap on the human icon on the top right corner of the login screen and input your account and password to enter the game.\n\nQ2: I have forgotten my account. How do I recover it?\n\nA2: It is not possible to recover your account so please keep your account details somewhere safe.\n\nQ3: My account has been stolen and the password has been changed. What do I do?\nA3: Please contact our customer service and we will try our best to help you.\n\nQ4: I can\'t log in after the connection has timed out. What do I do?\nA4: Try to reconnect or force close the game and restart it.\n\nQ5: The game keeps checking for updates and I can\'t enter the game. What do I do?\nA5: Force close the game and restart it. If that doesn\'t work, try connecting to another network. If it\'s still not working, please contact our customer service.\n\nQ6: What should I do when my data or account is lost?\nA6: Make sure you log into the correct server. Data is not shared among different servers. If the server is correct, please provide your character ID and registered email to our customer service and we will try our best to fix it.\n\nQ7: I keep going offline. What do I do?\nA7: Check your network connection. If it\'s causing a problem, try a new network. If the problem persists, please contact our customer service.\n\nQ8: The game has crashed. What do I do?\nA8: Force close the game and restart it. Try this multiple times if it doesn\'t work after the first attempt. If the problem still persists, please provide your device details to our customer service and we will respond to you ASAP.\n\nQ9: I may have found some cheaters. What do I do?\nA9: We pride ourselves on fair environment and good balance. When you find suspected cheaters please report them to us and we will deal with it ASAP.","ปัญหาในโซเชียลที่พบบ่อย\n1.คำถาม: หากมีการเปลี่ยนโทรศัพท์ ทำอย่างไรถึงจะสามารถเล่นเกมต่อได้ ?\n\nคำตอบ: หลังจากดาวน์โหลดเกมสำเร็จ คลิกที่ปุ่มมุมขวาบนที่หน้าล็อกอิน และกรอกบัญชีและพาสเวิร์ดผ่านของคุณเพื่อทำการล็อกอินเข้าสู่เกม\n\n2.คำถาม: หากลืมบัญชี จะสามารถเรียกคืนได้หรือไม่ ?\n\nคำตอบ: หากลืมบัญชีจะไม่สามารถเรียกคืนได้ ดังนั้นคุณจะต้องจำบัญชีและพาสเวิร์ดของคุณให้ได้\n\n3.คำถาม: หากบัญชีถูกขโมย และถูกเปลี่ยนพาสเวิร์ดใหม่จะทำอย่างไร ?\n\nคำตอบ: ตอนที่พาสเวิร์ดบัญชีของคุณถูกเปลี่ยน โปรดติดต่อเจ้าหน้าที่บริการลูกค้าทันที\n\n4.คำถาม: หากระบบขึ้นว่าหมดเวลาเครือข่าย และไม่สามารถล็อกอินเข้าเกมได้จะทำอย่างไร ?\n\nคำตอบ: ถ้าคุณไม่สามารถล็อกอินเข้าเกมได้ ให้ลองกดเชื่อมต่อต่อไป หรือลองปิด - เปิดเกมใหม่\n\n5.คำถาม: หากเกมยังขึ้นให้ตรวจสอบการอัปเดตและไม่สามารถเข้าเกมได้ จะทำอย่างไร ?\n\nคำตอบ: หากคุณเข้าเกมและระบบยังขึ้นให้ตรวจสอบการอัปเดตและไม่สามารถเข้าเกมได้ ให้คุณลองปิด - เปิดเกมใหม่หรือลองเปลี่ยนสัญญาณอินเทอร์เน็ตก่อนแล้วจึงเข้าเกมใหม่ หากวิธีการข้างต้นไม่สามารถแก้ปัญหาได้ให้ติดต่อที่เจ้าหน้าที่บริการลูกค้า\n\n6.คำถาม: หากข้อมูลในเกมหรือบัญชีเกมหาย จะทำอย่างไร ?\n\nคำตอบ: โปรดยืนยันให้แน่ใจก่อนว่าคุณเข้าเซิร์ฟเวอร์ถูกต้องหรือไม่ เพราะข้อมูลในเกมของแต่ละเซิร์ฟเวอร์นั้นจะไม่เหมือนกัน หากเซิร์ฟเวอร์ที่คุณเข้าถูกต้องแล้ว รบกวนส่ง ID และ Email ของคุณมาที่เจ้าหน้าที่บริการลูกค้า และพวกเราจะรีบติดต่อกลับให้เร็วที่สุด\n\n7.คำถาม: หากเกมถูกตัดจากการเชื่อมต่อระหว่างเล่นเกม จะทำอย่างไร ?\n\nคำตอบ: โปรดเช็คสัญญาณอินเทอร์เน็ตของคุณว่าปกติหรือไม่ และลองเปลี่ยนสัญญาณอินเทอร์เน็ตและเข้าเกมใหม่ หากยังมีปัญหาอยู่ รบกวนส่งข้อมูลโทรศัพท์ของคุณและส่งมาที่เจ้าหน้าที่บริการลูกค้า และพวกเราจะรีบติดต่อกลับให้เร็วที่สุด\n\n8.คำถาม: หากเกมเด้งหลุด จะทำอย่างไร ?\n\nคำตอบ: กดปิดเกมและรีสตาร์ทเกมใหม่ หากลองใช้วิธีนี้หลายๆรอบแล้วยังไม่ได้ผล รบกวนส่งข้อมูลโทรศัพท์ของคุณและส่งมาที่เจ้าหน้าที่บริการลูกค้า และพวกเราจะรีบติดต่อกลับให้เร็วที่สุด\n\n9.คำถาม: หากพบปัญหาการโกงในเกม จะทำอย่างไร ?\n\nคำตอบ: เราสนับสนุนให้สภาพแวดล้อมต่างๆในเกมเป็นไปอย่างถูกต้องและยุติธรรม หากคุณเจอการโกงกันในเกม รบกวนรายงานให้กับพวกเรา และเราจะรีบจัดการให้เร็วที่สุด",}
