M.Data[134661] = {"FAQ zum Chat\n1. F: Wie kann ich nervende Spieler blockieren?\n\nA: Tippe im Chat auf das Porträt des Spielers und dann auf „Blockieren“, um keine Nachrichten von ihm zu erhalten.\n\n2. F: Was kann ich tun, wenn Spieler Werbung oder betrügerische Nachrichten im Chat verbreiten?\n\nA: Du kannst dann in den Einstellungen eine Nachricht an den Kundenservice schreiben und den Spieler melden. Bitte teile uns auch seine Konto-ID mit. \n\n3. F: Wie kann ich Freunde im Spiel hinzufügen?\n\nA: Du kannst im Chat auf das Porträt des Spielers tippen und ihm eine Freundschaftsanfrage schicken. Du kannst auch in den Freundschaftsanfragen die Spieler-ID eingeben oder eine Anfrage an einen empfohlenen Spieler schicken.\n\n4. F: Auf welche Art kann ich mit Freunden interagieren?\n\nA: Freunde können gemeinsam Bosse bezwingen und sich Herzen schenken, um Herzbeschwörungen durchzuführen. Du kannst auch deinen Freunden Nachrichten schicken.\n\n5. F: Wie kann ich einer Gilde beitreten?\n\nA: Du kannst im Hauptmenü auf den „Gilde“-Button tippen und eine Anfrage an dir empfohlene Gilden schicken. Du kannst auch direkt die ID der Gilde eingeben, um sie zu suchen und eine Anfrage zu schicken. Außerdem kannst du deine eigene Gilde gründen und andere Spieler in diese aufnehmen.\n\n6. F: Welche Features stehen eine Gilde zur Verfügung?\n\nA: Nach dem Gildenbeitritt kannst du durch das tägliche Einchecken das Gildenlevel erhöhen und Gold erhalten. Außerdem kannst du in der Mühle und im Gildenboss Gildenmünzen und Gold erhalten. Im Gildenkrieg kannst du wöchentlich viele Gildenmünzen und andere Belohnungen erhalten.\n\n7. F: Was passiert, wenn ich die Gilde wechsle?\n\nA: Wenn du dich für den Gildenkrieg angemeldet hattest, kannst du nicht mehr daran teilnehmen und auch keine Belohnungen dafür erhalten.\n\n8. F: Was bringen Gildenmünzen?\n\nA: Mit Gildenmünzen kannst du im Gildenladen Objekte kaufen. Außerdem kannst du damit die Gildenfähigkeiten verbessern.\n\n9. F: Was bringt die Verbesserung der Fähigkeiten in Gilden-Tech?\n\nA: Wenn du die Fähigkeiten der 3 Klassen erhöhst, werden die entsprechenden Helden stärker.",true,"常见社交问题\n1.问：如何屏蔽聊天频道其他玩家刷频？\n\n答：您可以点击聊天频道内刷频玩家的头像然后点击屏蔽按钮来屏蔽该玩家的发言。\n\n2.问：当遇到有玩家在聊天频道发广告或诈骗信息该怎么办？\n\n答：您可以在设置界面的反馈中向客服人员提供发送违规信息玩家的账号ID来举报该玩家。\n\n3.问：在游戏中如何添加好友？\n\n答：您可以在聊天频道点击玩家头像发送申请,也可以在好友申请中输入玩家ID或者向推荐好友发送申请。\n\n4.好友之间可以进行怎样的互动？\n\n答：好友间可以彼此相互帮助打败还有BOSS,也可以互相赠送爱心用于进行爱心召唤,您还能向好友发送邮件跟好友进行交流。\n\n5.问：如何加入公会？\n\n答：您可以在主界面点击公会按钮,选择推荐的公会提供申请或输入公会的ID查找公会并提交申请,也可以建立属于自己的公会并邀请其他玩家加入到您的公会中。\n\n6.问：加入公会可以参加哪些玩法？\n\n答：加入公会后,您可以通过签到来提升公会等级获得公会币,也可以在磨坊、公会副本中获得公会币和金币,还可以报名参加每周一次的公会战中来获得大量的公会币等奖励。\n\n7.问：更换公会会造成什么影响？\n\n答：如果您报名参加了本周的公会战,那么更换公会后您将不能参与到本周的公会战中,并且不能获得任何奖励。\n\n8.问：公会币有什么用？\n\n答：公会币可用于在公会内的公会商店购买道具,也可以消耗到公会科技中提升您的公会技能。\n\n9.问：升级公会科技内的技能有什么作用？\n\n答：升级公会科技里的3种职业技能将会提升自己已拥有的对应职业英雄的能力。","FAQ - Social\n\nQ1: Some players are spamming the chat. What do I do?\nA1: Tap on the player\'s avatar in the chat and tap the \"BLOCK\" button to block his messages.\n\nQ2: Some players are posting ads or fraudulent information in the chat. What do I do?\nA2: Tap \"Feedback\" on the left menu of the main page and submit these players\' ID to report them.\n\nQ3: How do I add friends in the game?\nA3: Tap on the player\'s avatar in the chat to send a friend request. You can also input player ID to search for someone you want to add or send requests to recommended players.\n\nQ4: How do I interact with friends?\nA4: Friends can help each other in defeating Co-op Bosses, send each other Hearts which can be used for Heart Summons, or communicate with each other via in-game mails.\n\nQ5: How do I join a guild?\nA5: Tap the \"GUILD\" icon on the main page. Then you can either join a recommended guild or search for one with a guild ID. You can also create your own guild and invite other players.\n\nQ6: What can I do in a guild?\nA6: You can check in daily to level up the guild and gain Guild Coins. You can also gain Guild Coins and Gold from Guild Mine and Guild Bosses. You can also sign up for weekly Guild War for a chance to earn a large amount of Guild Coins and other rewards.\n\nQ7: What will happen when I join another guild?\nA7: You won\'t be able to join this week\'s Guild War or win any Guild War rewards if you join in another guild after signing up for the Guild War.\n\nQ8: What are Guild Coins for?\nA8: Guild Coins can be used to purchase items in the Guild Shop or upgrade guild skills in guild Technology.\n\nQ9: What are guild skills for?\nA9: Upgrading skills of 3 hero classes in guild Technology enhances the heroes of the corresponding classes.","ปัญหาโซเชียลที่พบบ่อย\n1.คำถาม: เราจะสามารถบล็อกแชทได้อย่างไร ?\n\nคำตอบ: คุณสามารถบล็อกแชทได้โดยการคลิกที่รูปโปรไฟล์ของผู้เล่นที่ต้องการบล็อกที่อยู่ในช่องแชท จากนั้นคลิกที่ปุ่มบล็อกเพื่อปิดรับข้อความจากผู้เล่นคนนั้น\n\n2.คำถาม: หากพบผู้เล่นส่งข้อความโฆษณาหรือข้อความข้อความหลอกลวงมายังช่องแชท จะทำอย่างไร ?\n\nคำตอบ: คุณสามารถส่งข้อมูลIDของผู้เล่นที่มีการกระทำดังกล่าวมาให้กับเจ้าหน้าที่บริการลูกค้าของเราได้ โดยคลิกที่เมนูฟีดแบคที่อยู่ในหน้าเมนูตั้งค่า\n\n3.คำถาม: จะเพิ่มเพื่อนในเกมได้อย่างไร ?\n\nคำตอบ: คลิกที่รูปโปรไฟล์ของผู้เล่นที่ต้องการจะเพิ่มในช่องแชทและกดส่งคำขอเป็นเพื่อน หรือกรอก ID ของผู้เล่นที่ต้องการจะเพิ่มเพื่อนลงไปที่หน้าเพิ่มเพื่อน หรือกดส่งคำขอการเป็นเพื่อนในหน้าแนะนำเพื่อน\n\n4.เราจะมีเชื่อมสัมพันธ์กับเพื่อนในเกมอย่างไรได้บ้าง ?\n\nคำตอบ: เราสามารถร่วมมือกับเพื่อนช่วยกันโจมตี Boss ในเกมได้ สามารถส่งหัวใจให้กับเพื่อนเพื่อใช้สำหรับการอัญเชิญมิตรภาพได้ หรือสามารถส่งจดหมายให้กับเพื่อนเพื่อติดต่อสื่อการกันได้\n\n5.คำถาม: จะเข้าร่วมกิลด์ได้อย่างไร ?\n\nคำตอบ: คลิกที่ปุ่มกิลด์ในหน้าหลัก และเลือกกิลด์ที่ขึ้นแนะนำ จากนั้นกดสมัครเข้าร่วมกิลด์ หรือกรอก ID กิลด์ในช่องค้นหากิลด์ และกดสมัครเข้าร่วมกิลด์ หรือสามารถสร้างกิลด์ของตัวเองขึ้นมาได้ และเชิญผู้เล่นคนอื่นๆเข้าร่วมกิลด์\n\n6.คำถาม: เมื่อเข้าร่วมกิลด์แล้วสามารถทำอะไรได้บ้าง ?\n\nคำตอบ: หลังจากเข้าร่วมกิลด์ คุณสามารถรับเหรียญกิลด์ได้จากเช็คอินเพิ่มเลเวลกิลด์, หรือยังหารับเหรียญกิลด์กับทองได้จากเหมืองกิลด์และดันเจี้ยนกิลด์, นอกจากนี้ทุกๆสัปดาห์ยังสมัครเข้าร่วมศึกกิลด์ เพื่อรับรางวัลเหรียญกิลด์จำนวนมาก\n\n7.คำถาม: หากทำการย้ายกิลด์จะเกิดผลกระทบอะไรขึ้นไหม ?\n\nคำตอบ: หากคุณได้ลงชื่อสมัครเข้าร่วมศึกกิลด์ในสัปดาห์นี้แล้ว และได้ทำการย้ายกิลด์ คุณจะไม่สามารถเข้าร่วมศึกกิลด์ในสัปดาห์นี้ได้อีก และจะไม่ได้รับรางวัลใดๆในศึกกิลด์ครั้งนี้\n\n8.คำถาม: เหรียญกิลด์ใช้ทำอะไรได้บ้าง ?\n\nคำตอบ: เหรียญกิลด์ใช้สำหรับการซื้อไอเทมในร้านค้ากิลด์ หรือใช้อัพสกิลในเทคโนโลยีกิลด์\n\n9.คำถาม: อัพสกิลในเทคโนโลยีกิลด์มีประโยชน์อย่างไร ?\n\nคำตอบ: การอัพเกรดทักษะของฮีโร่ทั้ง 3 อาชีพในเทคโนโลยีกิลด์ จะช่วยเพิ่มความสามารถของฮีโร่ตามอาชีพที่เกี่ยวข้อง",}
