M.Data[134662] = {"FAQ zum Aufladen\n1. F: Wie werde ich VIP-Spieler?\n\nA: Sobald die Anzahl deiner gekauften Juwelen eine bestimmte Höhe erreicht, wirst du VIP. Je mehr Juwelen du kaufst, desto höher steigt dein VIP-Level und desto mehr Privilegien erhältst du.\n\n2. F: Gibt es eine Belohnung für das erste Aufladen?\n\nA: Beim ersten Aufladen erhältst du die doppelte Juwelenmenge. Die gilt nur einmal für jedes Juwelenangebot. Besondere Waren (wie Monatskarten) sind nicht betroffen.\n\n3. F: Was soll ich tun, wenn ich bereits bezahlt, aber die Juwelen noch nicht erhalten habe?\n\nA: Starte bitte zuerst das Spiel neu. Sollten auch nach mehrmaligem Neustart die Juwelen noch nicht eingegangen sein, so kontaktiere uns bitte.\n\n4. F: Warum gibt es Abweichungen beim abgezogenen Geldbetrag für das Aufladen?\n\nA: Der abzuziehende Geldbetrag wird auf Basis des aktuellen Umrechnungskurses festgelegt. Die Abweichung entsteht aufgrund der Schwankungen des Umrechnungskurses.",true,"常见充值问题\n1.问：如何成为VIP玩家？\n\n答：当您购买钻石达到一定数量后即可成为VIP玩家,购买钻石越多VIP等级越高,享受的特权越多。\n\n2.问：首次充值有什么奖励？\n\n答：首次充值即可获得双倍数量的钻石,每种档次仅限一次。特殊的商品(如月卡等)不包含在内。\n\n3.问：当遇到充值时已经付款但道具没有到帐问题时该如何处理？\n\n答：当您发现成功付费但未收到道具时,请先尝试重新启动游戏。若尝试多次仍未到帐,请及时与我们联系。\n\n4.问：为什么充值成功后扣除的金额会出现变动？\n\n答：充值扣除的金额是游戏平台根据当前您所在的国家货币汇率兑换来收取的,所以会因为汇率的波动而变动。","FAQ - Top-up\n\nQ1: How do I become a VIP player?\n\nA1: You can become a VIP after purchasing the required number of Gems. The more you purchase, the higher the VIP level and more privileges you enjoy.\n\nQ2: What\'s the bonus for 1st top-up?\nA2: The 1st top-up grants double Gems. Each top-up level offers double Gems once only. Special offers (such as the Monthly Card) are not included.\n\nQ3: I have made the payment but haven\'t received the items. What shall I do?\nA3: Restart the game and check your account. Repeat if necessary. If problem still persists, please contact our customer service and we will help you.\n\nQ4: What I was charged for the same item varied. Why?\nA4: The payment varies according to variation in the exchange rate.","ปัญหาเติมเงินที่พบบ่อย\n1.คำถาม: ทำอย่างไรถึงจะได้เป็นผู้เล่น VIP ?\n\nคำตอบ: หลังจากที่คุณซื้อเพชรจนถึงตามจำนวนที่กำหนด ก็จะได้เป็นผู้เล่น VIP ยิ่งผู้เล่นซื้อเพชรมาก ระดับ VIP ก็จะยิ่งสูง และสิทธิพิเศษที่จะได้รับก็จะยิ่งเยอะ\n\n2.คำถาม: เติมเงินครั้งแรก จะได้รับรางวัลอะไรไหม ?\n\nคำตอบ: เมื่อเติมเงินครั้งแรก จะได้รับเพชรเป็นจำนวนสองเท่า โดยการเติมในแต่ละระดับ จะรับสิทธิพิเศษนี้ได้เพียง 1 ครั้งเท่านั้น สินค้าพิเศษ (เช่นบัตรเดือน) จะไม่รวมอยู่ในสิทธิพิเศษนี้\n\n3.คำถาม: หากพบปัญหาการเติมเงินที่ถูกหักเงินแล้ว แต่ของยังไม่เข้า จะทำอย่างไร ?\n\nคำตอบ: หากคุณพบปัญหาการเติมเงินที่ถูกหักเงินแล้ว แต่ยังไม่ได้รับของ ให้คุณลองรีสตาร์ทเกมใหม่ หากลองทำหลายครั้งแล้วก็ยังไม่ได้รับของให้ติดต่อมาที่พวกเราทันที\n\n4.คำถาม: ทำไมเมื่อเติมเงินสำเร็จแล้ว ยอดที่ถูกหักเงินนั้นถึงมีการเปลี่ยนแปลง ?\n\nคำตอบ: จำนวนเงินที่หักนั้นจะถูกเรียกเก็บโดยแพลตฟอร์มของเกมตามอัตราแลกเปลี่ยนสกุลเงินปัจจุบันของประเทศคุณ ดังนั้นจึงอาจจะเปลี่ยนแปลงและผันผวนไปตามอัตราแลกเปลี่ยน",}
