M.Data[134663] = {"Kontakt\nWenn du im Spiel auf Probleme stößt oder Vorschläge hast, kannst du uns unter „Feedback“ eine Nachricht schicken oder eine E-mail schreiben.",true,"联系我们\n当您遇到任何游戏问题或想对游戏提出自己的建议时,可以在反馈里给我们发送信息,也可以给我们发送邮件。","Contact Us\nIf you have any problems or suggestions, please do not hesitate to contact us. You can contact us through the \"Feedback\" feature in game or via customer service email.","หากคุณพบปัญหาเกี่ยวกับเกมหรือต้องการเสนอแนะเกี่ยวกับเกม สามารถส่งข้อความได้ที่ฟีดแบคหรือส่งอีเมลให้พวกเราได้",}
