M.Data[40001] = {"1. Niederlagen bei Fata Morgana verbrauchen FM-Ausdauer, siege verbrauchen nichts. Du benötigst mind. 1 FM-Ausdauer, um den Kampf zu beginnen. \n\n2. FM-Ausdauer regeneriert sich alle 120 min automatisch um 1. \n\n3. Die Schwierigkeitsstufe der Fata Morgana steigt allmählich. Der Sieg über stärkere Wächter bring bessere Belohnungen. \n\n4. Die Rangliste der Fata Morgana basiert auf der Anzahl der beendeten Ebenen.",true,"1.幻境挑战失败会消耗幻境体力,胜利不会消耗,你最少需要1个幻境体力才能进行战斗。\n\n2.幻境体力每120分钟自动恢复1个。\n\n3.幻境的难度会逐步递增,战胜强大守卫可以获得丰厚奖励。\n\n4.幻境排行榜会根据玩家的通过层数进行排名。","1. At least one Mirage Energy is required to join a Mirage battle, but only defeat will consume an Energy.\n\n2. One Mirage Energy is restored every 120 minutes.\n\n3. Difficulty increases stage by stage. Defeating the guardians of each stage grants rewards.\n\n4. Players are ranked according to the stage they reach.","1.ที่แดนความฝัน คุณจะเสีย Stamina แดนความฝันหากแพ้การท้ารบ แต่ถ้าหากท้ารบชนะก็จะไม่เสีย Stamina ต้องมี Stamina แดนความฝันอย่างน้อย 1 หน่วยถึงจะสามารถเข้าร่วมการต่อสู้ได้\n\n2.Stamina แดนความฝันจะฟื้นฟู 1 หน่วยทุกๆ 120 นาที\n\n3.ความยากของแดนความฝันจะค่อยๆยากขึ้นเรื่อยๆ เอาชนะผู้ที่พิทักษ์ที่แข็งแกร่งเพื่อรับรางวัลต่างๆมากมาย\n\n4.ตารางอันดับแดนความฝันจะจัดอันดับตามระดับชั้นที่ผู้เล่นเล่นถึง",}
