M.Data[142341] = {"*Dieses Gerät wurde bereits mit einem Spielkonto verbunden. Wähle bitte eine untenstehende Anmeldemethode aus, um in das Konto zu gelangen.",true,"*游戏检测到该设备曾经绑定过游戏账号，请选择以下登录方式登录已有的账号进入游戏","*The system has detected that you had a bound game account on this device. Please choose one of the following methods to log in with this account","*จากการตรวจสอบพบกว่าอุปกรณ์ดังกล่าวได้ทำการผูกบัญชีเกมแล้ว โปรดเลือกช่องทางล็อกอินด้านล่างนี้ เพื่อล็อกอินเข้าเกม",}
