M.Data[360187] = {"Passive Fgt.: Normaler Angriff wird zu Zufallsangriff auf 3 Feinde, mit 70% des Angriffschadens.",true,"被动技能：普通攻击变为攻击随机3名敌人,造成70%攻击伤害","Passive Skill: Normal attack attacks 3 random enemies, dealing damage (70% of Attack).","สกิลพาสซิฟ: เมื่อโจมตีปกติจะเปลี่ยนเป็นสุ่มโจมตีศัตรู 3 คนทำให้เกิดความเสียหาย (70% ของพลังโจมตี)",}
M.Data[40010] = {"1. Beim Zerlegen von Helden erhältst du u. a. Lila Seelen, Goldene Seelen, Heldenkerne.\n\n2. Mit Lila Seelen erhöhst du das Heldenlevel.\n\n3. Mit Goldenen Seelen erhöhst du den Levelabschnitt der Helden. Ein neuer Abschnitt erhöht die Attribute und schaltet Fähigkeiten frei.\n\n4. Mit Heldenkernen kannst du im Helden-Laden starke Helden kaufen.",true,"1.英雄进行分解可以得到紫魂、金魂、灵核等材料。\n\n2.紫魂可用于提升英雄等级。\n\n3.金魂可用于提升英雄的阶级,英雄进阶后可以提升属性,解锁技能。\n\n4.灵核可以在英雄商店购买强大的英雄。","1. Heroes can be decomposed into materials such as Purple Souls, Golden Souls and Hero Cores.\n\n2. Purple Souls are used to level up heroes.\n\n3. Golden Souls are used to promote heroes\' rank. Hero promotion increases the hero\'s stats and unlocks skills.\n\n4. Hero Cores are used to purchase powerful heroes in the Hero Core Shop.","1.เมื่อย่อยฮีโร่จะได้รับวัสดุต่างๆเช่น วิญญาณม่วง วิญญาณทอง จิตฮีโร่\n\n2.วิญญาณม่วงใช้สำหรับอัพเลเวลของฮีโร่\n\n3.วิญญาณทองใช้สำหรับอัพเกรดระดับของฮีโร่ หลังจากอัพเกรดระดับของฮีโร่จะทำให้ค่าสเตตัสสูงขึ้นและปลดล็อกสกิลต่างๆ\n\n4.จิตฮีโร่ใช้สำหรับซื้อฮีโร่สุดทรงพลังที่ร้านค้าฮีโร่",}
