M.Data[360512] = {"Aktive Fgt.: 3 zufällige Feinde erleiden 50% Angriffsschaden und pro Runde zusätzlich 20% Giftschaden für 2 Runden. Nach 2 Runden richtet eine Explosion Schaden i. H. v. 150 % des Angriffsschadens an.",true,"主动技能：释放技能对随机3名敌人造成50%攻击伤害，每回合额外造成20%中毒效果，持续2回合，2回合后产生爆炸对其造成150%攻击伤害","Active Skill: Deals damage (50% of Attack) to 4 random enemies and deals extra damage (20% of Attack) to them per round for 2 rounds. And deals explosion damage (150% of Attack) to them after 2 rounds.","สกิลแอคทีฟ: ปล่อยสกิลสุ่มให้ศัตรู 3 คน เกิดความเสียหาย (50% ของพลังโจมตี) ทุกๆรอบทำให้เกิดเอฟเฟกต์ติดพิษ 20% ต่อเนื่อง 2 รอบ หลังจาก 2 รอบแล้วทำให้เกิดระเบิดสร้างความเสียหาย (150% ของพลังโจมตี)",}
