M.Data[360192] = {"Aktive Fgt.: Verursacht bei 2 zufälligen Feinden 100% Angriffsschaden. Heilt LP aller Helden i. H. v. 100% des Angriffsschadens. Erhöht den Heilungseffekt der Helden um 15%. Dauer: 3 Runden.",true,"主动技能：对随机2名敌人造成100%攻击伤害,并持续恢复所有友军100%攻击的等量生命,并且提升他们受到治疗效果15%，3回合","Active Skill: Deals damage (100% of Attack) to 2 random enemies; heals all allies (100% of Attack) and increases their effect of getting healed by 15% for 3 rounds.","สกิลแอคทีฟ: สุ่มให้ศัตรู 2 คนเกิดความเสียหาย (100% ของพลังโจมตี) และฟื้นฟู HP ให้ทหารทั้งหมด (100% ของพลังโจมตี) พร้อมทั้งเพิ่มเอฟเฟกต์รักษา 15% 3 รอบ",}
