M.Data[134654] = {"Helden erhalten\nIn Kämpfen\nHeldenteile findest du u. a. hier: Auto-Kampf, Kampfvorfall in Ebenen, tägliche Aktionsraubzüge und Fata Morgana.\n\nLaden\nAuf dem Markt, im Glücksladen, Heldenkernladen, Gildenladen und Expeditionsladen werden Heldenteile verkauft.\n\nHeldentruhe\nÖffne Heldentruhen mit Herzen, Schlüsseln oder Juwelen, um schnell neue Helden zu erhalten.\n\nYggdrasil\nGegen Yggdrasilfrüchte kannst du bei Yggdrasil Heldenteile erhalten.\n\nEntdecken\nBeim Entdecken kannst du auf eine Queste stoßen, die mit Heldenteilen belohnt werden. Beende die Heldenqueste und erhalte eine bestimmte Anzahl an Heldenteilen.\n\nFreunde suchen\nBei der Suche nach Freunden kannst du eine gewisse Anzahl an Heldenteilen erhalten.",true,"英雄的获取方法\n战斗掉落\n在战役中挂机、通关战斗事件、每日参与活动副本--英雄挑战以及挑战幻境会有概率掉落英雄碎片。\n\n商店购买\n在市场、幸运商店、灵魂商店、公会商店、远征商店中会有售出英雄碎片。\n\n英雄宝典\n在英雄宝典中通过使用爱心、钥匙、钻石等道具进行召唤能快速获取新的英雄。\n\n世界树\n在世界树中可以消耗世界树果实获得英雄碎片。\n\n酒馆任务\n在酒馆中有几率出现奖励为英雄碎片的任务,完成英雄任务后将获得一定数量的英雄碎片。\n\n好友搜寻\n进行好友搜寻有一定概率获得一定数量的英雄碎片。","How To Get Heroes\n\nBattle Rewards\nThere are certain chances to get Hero Shards from auto-battle, Boss battles, Hero Raids and Mirage.\n\nShop\nYou can purchase Hero Shards from the Shop, Luck Shop, Hero Core Shop, Expedition Shop and Guild Shop.\n\nHero Pub\nSummoning with Hearts, Keys or Gems in the Hero Pub is a quick way to get new heroes.\n\nWorld Tree\nYou can spend World Tree Fruit in the World Tree to get Hero Shards.\n\nExplore Quest\nYou may find Explore Quests which grant Hero Shards after completed.\n\nCo-op Search\nFriend co-op search has a certain chance to grant certain Hero Shards.","วิธีการรับฮีโร่\nดรอปจากการต่อสู้\nมีโอกาสดรอปเศษฮีโร่จากการต่อสู้ออโต้ในสมรภูมิ จากการต่อสู้กับBoss จากการเข้าร่วมกิจกรรมดันเจี้ยน - ท้ารบฮีโร่ในแต่ละวัน หรือจากการท้ารบในแดนความฝัน\n\nซื้อจากร้านค้า\nสามารถหาซื้อเศษฮีโร่ได้จากร้านค้า ร้านโชคดี ร้านค้าจิตฮีโร่ ร้านค้ากิลด์ หรือจากร้านค้าเดินทาง\n\nหีบสมบัติฮีโร่\nสามารถใช้หัวใจ กุญแจหรือเพชรในการเปิดหีบสมบัติฮีโร่เพื่ออัญเชิญฮีโร่ใหม่\n\nต้นไม้โลก\nสามารถใช้ผลไม้ต้นไม้โลกกับที่ต้นไม้โลกเพื่อรับเศษฮีโร่\n\nสำรวจ\nหลังจากทำเควสสำรวจสำเร็จ มีโอกาสที่จะได้รับเศษฮีโร่ตามจำนวนที่กำหนด\n\nค้นหาเพื่อน\nเมื่อค้นหาเพื่อนมีโอกาสที่จำดรอปเศษฮีโร่ตามจำนวนที่กำหนด",}
M.Data[360190] = {"Passive Fgt.: Normaler Angriff wird zu Zufallsangriff auf 3 Feinde, mit 85% des Angriffschadens.",true,"被动技能：普通攻击变为攻击随机3名敌人,造成85%攻击伤害","Passive Skill: Normal attack attacks 3 random enemies, dealing damage (85% of Attack).","สกิลพาสซิฟ: เมื่อโจมตีปกติจะเปลี่ยนเป็นสุ่มโจมตีศัตรู 3 คนทำให้เกิดความเสียหาย (85% ของพลังโจมตี)",}
