M.Data[360181] = {"Passive Fgt.: Beim Erleiden eines Angriffs erhöht sich GLT um 10% und regeneriert die Einheit LP i. H. v. 40% des Angriffsschadens. Dauer: 3 Runden.",true,"被动技能：受到任何攻击时增加自身10%暴击，使自身恢复40%攻击的等量生命，持续3回合","Passive Skill: When taking any damage, increases self Crit Rate by 10% and restores self HP (40% of Attack), lasting for 3 rounds.","สกิลพาสซิฟ: เมื่อถูกโจมตีจะเพิ่ม CRI ตัวเอง 10% และฟื้นฟู HP ตัวเอง (40% ของพลังโจมตี) ต่อเนื่อง 3 รอบ",}
