M.Data[134652] = {"Ebenen\n\nAllgemein\nDie Kampagnenkarte ist in 4 Schwierigkeitsgrade unterteilt: Normal, Alptraum, Hölle und Tod. Jedem Schwierigkeitsgrad sind mehrere Ebenen zugeordnet. Du musst die 4 Schwierigkeitsgrade erst freischalten.\n\nEbenen freischalten\nFührst du für eine gewisse Zeit auf einer neuen Ebene den Auto-Kampf aus, so startet die Kampfzeit. Wenn du die Kampfzeit beendest, dein Level hoch genug ist und dein Team genug Macht hat, dann kannst du via Tippen zur nächsten Ebene gehen.\n\nKarte und Weltkarte freischalten\nWenn du alle Ebenen einer Karte beendet hast, wird die nächste Karte freigeschaltet. Wenn du alle Ebenen eines Schwierigkeitsgrads beendet hast, wird der nächste Schwierigkeitsgrad freigeschaltet.\n\nKampfvorfall\nWenn du eine neue Ebene betrittst, kommt es zu einem Kampfvorfall. Wenn du den Kampf gewinnst, erhältst du eine Belohnung.\n\nTeam\nUnter „Team“ kannst du deine Heldengruppe einstellen. Die Anzahl der Helden im Team richtet sich nach deinem Level. Je höher die Macht der Helden, desto mehr Helden können in die Formation aufgenommen werden (Die Macht der Helden beeinflusst nur die Freischaltung von Ebenen, nicht aber die dort gefundenen Objekte).\n\nAuto-Kampf\nDas im Auto-Kampf erhaltene Einkommen steigt mit der Zeit. Du kannst max. 8 Std. lang den Auto-Kampf durchführen. Danach erhältst du kein Einkommen mehr im Auto-Kampf. Komme also stets innerhalb von 8 Std. ins Spiel, um dein Einkommen abzuholen.\n\nAusstoß & Erhalten\nIn Ebenen erhältst du eine feste Menge an Erfahrung, Gold und Lila Seelen. Im Auto-Kampf erhältst du diese 3 Dinge. Je höher der Schwierigkeitsgrad und der Fortschritt, desto mehr erhältst du. Das VIP-Level erhöht ebenfalls dein Einkommen.\n\nFunde & Trophäen\nIn den Fund-Informationen kannst du erfahren, welche Objekte in der aktuellen Ebene zu finden sind. Beim Auto-Kampf kannst du dann in der Ebene mit einer gewissen Wahrscheinlichkeit diese Objekte erhalten. Erhaltene Objekte werden unter den Trophäen angezeigt.",true,"关卡说明\n\n总览\n战役的地图分为普通、噩梦、地狱、死亡四种难度,每种难度下包含多个关卡。四个难度需要依次解锁。\n\n解锁关卡\n来到新关卡等待足够的挂机时间后会触发战斗时间。完成战斗时间并且队伍战斗力和自身等级达到进入下一关条件时,可点击前往下一关。\n\n解锁地图&世界地图\n当您通关一个地区的所有关卡后,解锁下一个地图；当您通关一种难度模式的所有关卡后,解锁下一种难度模式。\n\n战斗事件\n进入一个新的关卡会触发该关卡对应的战斗事件,通关战斗事件后可获取丰厚的奖励。\n\n队伍\n在队伍里设置英雄小队。可设置的队伍人数随您自身的等级提升而增加,英雄的战斗力越高,可上阵的英雄数量越多,队伍战斗力越高(上阵英雄战斗力只和解锁关卡有关,和掉落无关)。\n\n挂机\n挂机产生的收益随时间而增加。您最长可以挂机8小时,超过8小时将不在获取挂机收益。所以请记得在8小时内回来领取你的挂机收益哦！\n\n产出&获取\n关卡固定产出玩家经验、金币和紫魂,您可以通过挂机来获取这三种收益,关卡难度模式越高和进度越往后,所获得的这三种收益越高。VIP等级会对应的增加这三个资源的掉落。\n\n掉落&战利品\n你可以在物品掉落信息中查询当前关卡可能掉落的物品,当您前往某个关卡进行挂机时,将有概率获得该关卡掉落的道具,已获得的掉落道具在战利品里查看。","Campaign Maps & Stages\n\nOverview\nThere are 4 map difficulties: Normal, Hard, Hell and Nightmare. Each difficulty has multiple stages. You must unlock these difficulties one after another.\n\nUnlock Stage\nStaying at a new stage for certain time unlocks the Boss battle. Complete the Boss battle and you will be able to enter the next stage if you meet the requirements for team power and team level.\n\nUnlock Map\nWhen all stages of a map are passed, the next map will be unlocked.\n\nBoss Battle\nEntering a new stage triggers a Boss battle. A successful challenge of the Boss grants great rewards!\n\nTeam\nYou can dispatch heroes to the team. The higher the team level, the more heroes can be dispatched. Team power increases as the number or power of the heroes increases.\n\nAuto-battle\nAuto-battle yields resources even if you are offline. The longer the auto-battle time, the more you\'ll gain. The maximum resource-yielding time per offline period is 8 hours, so remember to collect your earnings in time!\n\nYield\nAuto-battle yields Team EXP, Gold and Purple Souls. The more you advance into the later stages of the map, the more the yields. VIP can enjoy higher yields according to the level.\n\nLoot\nYou can check which loots you may get from each stage. Auto-battle grants these loots with a certain chance. Earned loots can be checked from the Loot Chest.","คำอธิบายด่าน\n\nโดยภาพรวม\nแผนที่ในสมรภูมิจะแบ่งความยากออกเป็น 4 ระดับได้แก่ ทั่วไป ฝันร้าย นรก และความตาย โดยจะต้องปลดล็อกความยากไปตามลำดับ\n\nการปลดล็อกด่าน\nแต่ละด่านจะปลดล็อกการต่อสู้ที่แตกต่างกันไป เมื่อเอาชนะการต่อสู้และพลังรบของทีมกับเลเวลถึงตามเงื่อนไขในการเข้าร่วม ก็จะสามารถกดเพื่อไปยังด่านต่อไปได้\n\nปลดล็อกแผนที่&แผนที่โลก\nหลังจากที่คุณเคลียร์ด่านทุกด่านในแผนที่ครบทั้งหมด แผนที่ต่อไปก็จะทำการปลดล็อก;โดยความยากของแต่ละแผนที่ก็จะยากขึ้นเรื่อยๆ\n\nการต่อสู้กับ Boss\nเมื่อเข้าสู่ด่านที่กำหนดจะมี Boss ปรากฎขึ้นมา หลังจากผ่านการต่อสู้กับ Boss ก็จะได้รับรางวัลจำนวนมาก\n\nทีม\nคุณสามารถปรับแต่งทีมของคุณได้ที่นี่ โดยสามารถตั้งค่าจำนวนคนในทีมของคุณได้ตามระดับเลเวลของคุณ พลังต่อสู้ของฮีโร่ยิ่งสูง จำนวนฮีโร่ที่จะนำไปออกรบได้ก็ยิ่งเยอะ และค่าพลังรบของทีมก็จะยิ่งสูงไปด้วย (พลังรบของฮีโร่ที่ออกรบนั้นเกี่ยวข้องกับการปลดล็อกด่านต่างๆ ไม่ได้เกี่ยวข้องกับการดรอปใดๆ)\n\nการต่อสู้ออโต้\nในระหว่างการต่อสู้ออโต้ รางวัลก็จะเพิ่มจำนวนขึ้นตลอดเวลา คุณสามารถต่อสู้ออโต้ได้นานสูงสุด 8 ชั่วโมง เมื่อเกิน 8 ชั่วโมงก็จะไม่ได้รับรางวัลการต่อสู้ออโต้อีก ดังนั้นอย่าลืมกลับมากดรับรางวัลการต่อสู้ออโต้ของคุณใน 8 ชั่วโมงกันล่ะ !\n\nผลผลิต&การรับ\nด่านที่กำหนดจะปรากฏ EXP เหรียญทองและวิญญาณม่วงออกมา คุณสามารถกดรับรางวัลทั้งสามได้จากการต่อสู้ออโต้ ระดับความยากของด่านยิ่งสูงและยิ่งผ่านไปด่านลึกๆ รางวัลทั้งสามนี้ก็ยิ่งเยอะตามไปด้วย ระดับ VIP ก็ส่งผลกับรางวัลที่ดรอปเหมือนกัน\n\nการดรอป&ของปล้นสะดม\nคุณสามารถตรวจสอบไอเทมที่จะดรอปในด่านนั้นๆได้ที่ข้อมูลการดรอปไอเทม เมื่อคุณทำการต่อสู้ออโต้ในแต่ละด่าน จะมีโอกาสดรอปไอเทมที่ด่านนั้นๆ โดยไอเทมที่ดรอปมาได้นั้นสามารถตรวจสอบได้ที่ของปล้นสะดม",}
