M.Data[360180] = {"Passive Fgt.: Sinken die eigenen LP unter 50%, so erhöht sich ANG um 50% und GLT um 30%. LP werden i. H. v. 240% des ANG-Werts geheilt. Dauer: 3 Runden (nur einmal anwendbar). ",true,"被动技能：自身生命低于50%,提升自身50%攻击和30%暴击,并恢复自身240%攻击等量生命，持续3回合（只触发1次）","Passive Skill: When HP is below 50%, increases self Attack by 50% and Crit Rate by 30%, restores self HP (240% of Attack), lasting for 3 rounds (Can be triggered once only per battle).","สกิลพาสซิฟ: เมื่อ HP ตัวเองต่ำกว่า 50% จะเพิ่มพลังโจมตี 50% กับ CRI ตัวเอง 30% และฟื้นฟู HP ตัวเอง (240% ของพลังโจมตี) ต่อเนื่อง 3 รอบ (ปล่อยสกิลได้เพียง 1 ครั้ง)",}
M.Data[40004] = {"1. Expeditionen werden 24 Stunden nach Start geschlossen. Nach weiteren 24 Stunden werden sie wieder geöffnet.\n\n2. Nur Helden ab Level 40 können an Expeditionen teilnehmen. Nach jedem Kampf erholen sich weder die LP der Helden noch der Feinde.\n\n3. Wenn alle Helden besiegt wurden, endet der Kampf.\n\n4. Bei jedem Sieg erhältst du eine Belohnung. Je höher die Ebenen, desto höher die Schwierigkeit und desto besser die Belohnung.\n\n5. Bei Siegen erhältst du Exped.-münzen, mit denen du im Expeditions-Laden hochwertige Objekte kaufen kannst.\n\n6. Beende eine gewisse Anzahl an Ebenen, um zur Belohnungsebene zu gelangen. Dann kannst du 1 aus 3 Vorteilen wählen und aktivieren.\n\n7. Die Attributsvorteile gelten für alle Helden und können addiert werden. Der Effekt dauert bis zum Ende der aktuellen Expedition an.",true,"1.远征开启24小时后关闭,间隔24小时再次开放。\n\n2.40级以上的英雄才能参加远征,每次战斗后敌我双方生命不重置。\n\n3.英雄全部阵亡无法继续战斗。\n\n4.玩家每次战斗胜利,都可以获得奖励,越往后的关卡难度越大,奖励也更丰厚。\n\n5.战斗胜利获得的远征币可以在远征商店兑换高级物品。\n\n6.在通关一定层数后将到达奖励层，可以从3个增益效果中选择其中一个激活。\n\n7.其中属性增益类效果对所有英雄生效且可以叠加，持续到本日远征结束。","1. Each Expedition opens for 24 hours, and the next one will open 24 hours after the current ends.\n\n2. Only lv.40 or above heroes can participate in Expedition. Heroes of both sides do not regenerate HP after each battle.\n\n3. Fallen heroes cannot join in the battles again.\n\n4. Each victory grants some rewards. The further you go, the larger the stage difficulty, the better the rewards.\n\n5. Expedition Coins can be used to purchase rare items in Expedition Shop.\n\n6. After completing a certain number of stages, you will be able to select one buff from three Mysterious Forces.\n\n7. The stats-boost buffs are effective for all heroes and can stack up until the end of the current Expedition.","1.การเดินทางหลังจากเปิดครบ 24 ชม.ก็จะปิดลง และต้องรออีก 24 ชม.ถึงจะเปิดอีกครั้ง\n\n2.ฮีโร่เลเวล 40 ขึ้นไปถึงจะสามารถเข้าร่วมเดินทางได้ หลังการต่อสู้ในแต่ละครั้ง HP ของทั้งสองฝ่ายจะไม่ถูกรีเซ็ต\n\n3.ฮีโร่ที่ถูกฆ่าทั้งหมดจะไม่สามารถต่อสู้ต่อได้\n\n4.ทุกครั้งที่ผู้เล่นต่อสู้ชนะ จะได้รับรางวัล ยิ่งระดับยากเท่าไรก็ยิ่งได้รับรางวัลมากขึ้นเท่านั้น\n\n5.เหรียญเดินทางที่ได้รับจากการต่อสู้ชนะสามารถนำไปแลกไอเทมระดับสูงได้ที่ร้านค้าเดินทาง\n\n6.เมื่อเล่นถึงชั้นที่กำหนดจะเข้าสู่ชั้นรางวัล ซึ่งสามารถเลือก 1 ใน 3 เอฟเฟกต์พิเศษที่ใช้เพิ่มสเตตัสได้\n\n7.เอฟเฟกต์เพิ่มสเตตัสจะมีผลต่อฮีโร่ทุกคนและยังสามารถซ้อนทับกันได้ และจะมีผลต่อเนื่องไปจนกว่าการเดินทางในวันนั้นจะสิ้นสุดลง",}
