M.Data[40013] = {"1. Du erhältst Belohnungen, wenn du Heldenquesten in gegebenen Zeiträumen absolvierst. 1 Held kann nur max. 1 Queste durchführen.\n\n2. Die Anzahl täglich absolvierbarer Heldenquesten ist begrenzt. Erhöhe dein VIP-Level, um die Obergrenze zu erhöhen.\n\n3. Mit einer Aktualisierung setzt du alle aktuell noch nicht begonnenen Questen zurück. Täglich werden Questen zu einem festen Zeitpunkt 1-mal aktualisiert. Du kannst sie auch mit Juwelen manuell aktualisieren.\n\n4. Durch den Einsatz von Questenbüchern erweiterte Questen werden auch aktualisiert.\n\n5. Mit Juwelen kannst du die aktuelle Queste schnell abschließen.",true,"1.在指定的时间内执行英雄任务能获得丰厚的奖励。一个英雄不能执行多个任务。\n\n2.每日可完成的英雄任务有数量限制,提升VIP等级可提高英雄任务总数上限。\n\n3.刷新可重置当前所有未开始执行的任务,每天定时自动刷新1次,也可以通过消费钻石刷新。\n\n4.刷新后,使用任务书增加的任务也会刷新。\n\n5.花费钻石可以加速完成正在执行中的任务。","1. Explore Quests grant great rewards upon being completed after certain time. Each hero can be dispatched to only one quest at a time.\n\n2. A limited number of quests are available per day. The limit can be increased by increasing VIP levels.\n\n3. Idle quests can be changed by refreshing, which is automatically performed daily. You can also spend Gems to refresh the quests.\n\n4. Quests added by Quest Books will also be refreshed.\n\n5. Quests can be completed instantly by spending Gems.","1.สามารถได้รับรางวัลมากมายจากการทำเควสสำรวจเสร็จตามเวลาที่กำหนด ฮีโร่แต่ละคนจะถูกส่งไปทำเควสได้เพียงครั้งเดียวเท่านั้น\n\n2.จำนวนเควสในแต่ละวันมีจำนวนจำกัด สามารถเพิ่มขีดจำกัดจำนวนเควสได้จากการเพิ่มระดับ VIP\n\n3.สามารถรีเซ็ตเควสปัจจุบันที่ยังไม่ได้ทำได้ ระบบจะรีเฟรชเควสอัตโนมัติวันละ 1 ครั้งเมื่อถึงเวลาที่กำหนด หรือสามารถใช้เพชรเพื่อรีเฟรชเควสเองได้\n\n4.หากรีเฟรชเควสใหม่ เควสที่เพิ่มมาจากตำราเควสก็จะถูกรีเฟรชด้วย\n\n5.สามารถเร่งเควสให้สำเร็จได้ทันทีโดยการจ่ายด้วยเพชร",}
