M.Data[360183] = {"Passive Fgt.: Sinken die eigenen LP unter 50%, so erhöht sich ANG um 70% und GLT um 40%. LP werden i. H. v. 400% des ANG-Werts geheilt. Dauer: 3 Runden (nur einmal anwendbar). ",true,"被动技能：自身生命低于50%,提升自身70%攻击和40%暴击,并恢复自身400%攻击等量生命，持续3回合（只触发1次）","Passive Skill: When HP is below 50%, increases self Attack by 70% and Crit Rate by 40%, restores self HP (400% of Attack), lasting for 3 rounds (Can be triggered once only per battle).","สกิลพาสซิฟ: เมื่อ HP ตัวเองต่ำกว่า 50% จะเพิ่มพลังโจมตี 70% กับ CRI ตัวเอง 40% และฟื้นฟู HP ตัวเอง (400% ของพลังโจมตี) ต่อเนื่อง 3 รอบ (ปล่อยสกิลได้เพียง 1 ครั้ง)",}
