M.Data[360670] = {"Aktive Fgt.: Alle Feinde erleiden 115% Angriffsschaden und ein Glückstreffersiegel. Beim Auslösen des Siegels erleiden die Ziele 180% Angriffsschaden. Chance von 30% auf 1 weiteres Siegel mit 120% Angriffsschaden. Trifft immer.",true,"主动技能：对所有敌人造成115%伤害并附加暴击印记,暴击印记暴击触发后造成180%攻击伤害,并有30%几率额外附加1个120%攻击伤害的暴击印记,必中","Active Skill: Deals damage (115% of Attack) to all enemies and adds a Crit Trigger which will be triggered by a crit hit to deal damage (180% of Attack); has a 30% chance to add another Crit Trigger (120% Attack). Cannot be dodged.","สกิลแอคทีฟ: ทำให้ศัตรูทั้งหมดเกิดความเสียหาย (115% ของพลังโจมตี) พร้อมติดผนึก CRI เมื่อปล่อยผนึก CRI โจมตี ทำให้เกิดความเสียหาย (180% ของพลังโจมตี) และมีโอกาส 30% เพิ่มผนึก CRI 1 ครั้ง จะให้เกิดความเสียหาย (120% ของพลังโจมตี),",}
