M.Data[360645] = {"Aktive Fgt.: Chance von 100%, allen Gegnern 75% Angriffsschaden zuzufügen und ein Glückstreffersiegel zu verpassen. Beim Auslösen des Siegels erleiden die Ziele 100% Angriffsschaden.",true,"主动技能：对所有敌人造成75%攻击伤害,有100%几率给目标附加暴击印记,暴击印记暴击触发后造成100%攻击伤害","Active Skill: Deals damage (75% of Attack) to all enemies and adds a Crit Trigger which will be triggered by a crit hit to deal damage (100% of Attack).","สกิลแอคทีฟ: ทำให้ศัตรูทั้งหมดเกิดความเสียหาย (75% ของพลังโจมตี) มีโอกาส 100% ทำให้เป้าหมายติดผนึก CRI และเมื่อปล่อยผนึก CRI โจมตีจะทำให้เกิดความเสียหาย (100% ของพลังโจมตี)",}
