M.Data[360254] = {"Passive Fgt.: Hintere Reihe der Formation +20% ANG, vordere Reihe +20% LP",true,"被动技能：上阵位置位于后排+20%攻击,位于前排+20%生命","Passive Skill: If stands on the back-line, adds self Attack by 20%; if stands on the front-line, increases self HP by 20%.","สกิลพาสซิฟ: เมื่อฮีโร่ลงทีมในตำแหน่งแถวหลัง พลังโจมตีเพิ่ม +20% หากอยู่แถวหน้าเพิ่ม HP +20%",}
M.Data[360627] = {"Aktive Fgt.: 1 zufälliger Feind erleidet 110% Angriffsschaden. Chance von 100%, das Ziel zu verwirren. Dauer: 2 Runden.",true,"主动技能：对随机1名敌人造成110%攻击伤害,有100%几率使目标眩晕2回合","Active Skill: Deals damage (110% of Attack) to a random enemy and stun him for 2 rounds.","สกิลแอคทีฟ: สุ่มให้ศัตรู 1 คนเกิดความเสียหาย (110% ของพลังโจมตี) มีโอกาส 100% ทำให้เป้าหมายมึนงง 2 รอบ",}
M.Data[360626] = {"Passive Fgt.: Sinken die LP unter 50%, so erhöht sich GLT um 50% und GSD um 70% für 3 Runden. Entfernt alle Kontrolleffekte (nur 1-mal anwendbar).",true,"被动技能：生命值低于50%，暴击+50%，暴击伤害+70%，持续3回合。立即移除身上所有控制效果。（只触发1次）","Passive Skill: When HP is below 50%, increases self Crit by 50% and Crit Damage by 70% for 3 rounds. Remove self the controlled state (Can be triggered once only per battle).","สกิลพาสซิฟ: เมื่อ HP ต่ำกว่า 50% ก็จะเพิ่ม CRI +50% CRI.DMG +70% ต่อเนื่อง 3 รอบ และลบดีบัฟที่ตัวเองได้รับทั้งหมด (ปล่อยสกิลได้เพียง 1 ครั้ง)",}
