M.Data[360620] = {"Aktive Fgt.: Vordere Reihe der Feinde erleidet 240% Angriffsschaden. Eigene LP sinken um 20%.",true,"主动技能：对前排敌人造成240%攻击伤害，同时减少自身当前生命值20%的生命","Active Skill: Deals damage (240% of Attack) to all front-line enemies and reduces self HP by 20%.","สกิลแอคทีฟ: ทำให้ศัตรูแถวหน้าเกิดความเสียหาย (240% ของพลังโจมตี) พร้อมทั้งลด HP ตัวเองในขณะนั้น 20%",}
M.Data[360615] = {"Passive Fgt.: Bei normalem Angriff eigener ANG + 15%, Held auf 1. Position regeneriert 4% der max. LP. Dauer: 2 Runden. ",true,"被动技能：自身普通攻击时增加自身15%攻击和治疗友方1号位4%最大生命，持续2回合","Passive Skill: Normal attack increases self Attack by 15% and heals the 1st ally HP (4% of MaxHP)","สกิลพาสซิฟ: เมื่อตัวเองโจมตีปกติ จะเพิ่มพลังโจมตีตัวเอง 15% และรักษาเพื่อนหมายเลข 1 (4% ของค่า Max HP) ต่อเนื่อง 2 รอบ",}
M.Data[360613] = {"Aktive Fgt.: 4 zufällige Feinde erleiden 75% Angriffsschaden und pro Runde zusätzlich 30% Giftschaden für 2 Runden. Nach 2 Runden richtet eine Explosion Schaden i. H. v. 200 % des Angriffsschadens an.",true,"主动技能：释放技能对随机4名敌人造成75%攻击伤害，每回合额外造成30%中毒效果，持续2回合，2回合后产生爆炸对其造成200%攻击伤害","Active Skill: Deals damage (75% of Attack) to 4 random enemies and deals extra damage (30% of Attack) to them per round for 2 rounds. And deals explosion damage (200% of Attack) to them after 2 rounds.","สกิลแอคทีฟ: ปล่อยสกิลสุ่มให้ศัตรู 4 คนเกิดความเสียหาย (75% ของพลังโจมตี) ทุกๆรบอทำให้เกิดเอฟเฟกต์ติดพิษ 30% ต่อเนื่อง 2 รอบ หลังจาก 2 รอบแล้วทำให้เกิดระเบิดสร้างความเสียหาย (200% ของพลังโจมตี)",}
