M.Data[360597] = {"Aktive Fgt.: Verursacht bei allen Feinden in der vorderen Reihe 159% Angriffsschaden. Absorbiert 9 Punkte ABW für 2 Runden. Heilt LP i. H. v. 70% des Angriffsschadens bei allen Helden. Dauer: 10 Runden. Trifft immer.",true,"主动技能：对所有前排敌人造成159%攻击伤害,并吸取目标9防御持续2回合,使自身恢复70%攻击的等量生命,持续10回合,必中","Active Skill: Deals damage (159% of Attack) to all front-line enemies, drains their Defense by 9 for 2 rounds and restores self HP (70% of Attack) for 10 rounds. Cannot be dodged.","สกิลแอคทีฟ: สร้างความเสียหาย (159% ของพลังโจมตี) ให้แก่ศัตรูแถวหน้าทั้งหมด และดูดซับ DEF เป้าหมาย 9 แต้ม ต่อเนื่อง 2 รอบ พร้อมทั้งฟื้นฟู HP ตัวเอง (70% ของพลังโจมตี) ต่อเนื่อง 10 รอบ,",}
