M.Data[40005] = {"1. Zunächst hat jede Gilde Level 1. Durch tägliches Check-In erhöhen Gildenmitglieder die Gildenerfahrung. Die Anzahl der Erhöhung von Gildenerfahrung pro Tag kann die Anzahl der Gildenmitglieder nicht übersteigen.\n\n2. Anfangs kann die Gilde nur 15 Mitglieder aufnehmen. Durch die Erhöhung des Gildenlevels können bis zu 30 Mitglieder aufgenommen werden.\n\n3. Die Gildenrangliste wird auf Basis des Gildenlevels erstellt.\n\n4. War der Gildenanführer länger als 1 Tag nicht online, so wird seine Position automatisch abgegeben.",true,"1.初始公会等级为1,公会成员通过每日签到来增加公会经验,提升公会等级,每天签到增加经验的次数不能超过公会成员人数上限,超过后公会经验将不会增加。\n\n2.公会初始人数上限为15,公会等级提升能增加成员人数上限,公会最多可容纳30人。\n\n3.公会排行榜根据公会等级进行排名。\n\n4.公会会长超过一定天数不在线后，会长权限将会进行自动转移。","1. Guild starts at level 1. Guild members can contribute Guild EXP by checking in everyday to increase guild level. The number of EXP-granting daily check-ins cannot exceed the number of guild members.\n\n2. The initial guild member cap is 15, which can be increased up to 30 by increasing the guild level.\n\n3. Guilds are ranked based on their level.\n\n4. When guild Leader is offline for more than a certain number of days, the leadership will be automatically transferred.","1.เลเวลกิลด์จะเริ่มต้นที่เลเวล 1 โดย EXP กิลด์จะเพิ่มขึ้นจากการเช็คอินของสมาชิกในกิลด์ จำนวนครั้งที่เช็คอินเพื่อเพิ่ม EXP กิลด์ของคุณจะต้องไม่เกินกว่าจำนวนสมาชิกสูงสุดของกิลด์ หากมีการเช็คอินเกินกว่าจำนวนสมาชิกกิลด์ก็จะไม่ได้รับ EXP กิลด์\n\n2.จำนวนสมาชิกในกิลด์จะเริ่มต้นที่ 15 คน เมื่อเลเวลกิลด์เพิ่มขึ้นจำนวนสมาชิกสูงสุดก็จะเพิ่มขึ้น โดยจะมีสมาชิกในกิลด์ได้สูงสุด 30 คน\n\n3.ตารางอันดับกิลด์จะจัดตามระดับเลเวลของกิลด์\n\n4.หากหัวหน้ากิลด์ไม่ได้ออนไลน์จนถึงตามระยะเวลาที่กำหนด อำนาจหัวหน้ากิลด์จะถูกโอนไปให้คนอื่นโดยอัตโนมัติ",}
