M.Data[142325] = {"Sehr geehrter Spieler, auf dem Server wird eine Wartung durchgeführt, die voraussichtlich in %s Minuten abgeschlossen sein wird. Die Serverausfallzeit kann je nach Fortschritt variieren. Wir bedanken uns für Ihre Geduld!",true,"亲爱的玩家，游戏服务器目前正在维护中，预计在%s分钟后完成维护，服务器开启时间可能因实际维护进度提前或者延后，感谢您的耐心等待，祝您游戏愉快！","Dear player, the server is undergoing a maintenance which is estimated to end in %s minutes. The server downtime may vary according to the progress. We thank you for your patience!","เรียนผู้เล่นทุกท่าน ขณะนี้กำลังปรับปรุงเซิร์ฟเวอร์เกมอยู่ คาดว่าจะปรับปรุงเสร็จสิ้นภายใน%sนาที สำหรับเวลาเปิดเซิร์ฟอาจจะเปิดเร็วขึ้น หรือเลือนเปิดช้าลง ขึ้นอยู่กับสถานการณ์ปรับปรุงตามจริง โปรดรออีกสักนิด แล้วท่านจะมีความสุขกับการเล่นเกม !",}
