M.Data[134653] = {"Kampf\n\nFormationspositionen\nHelden, die sich in der vorderen Reihe der Formation befinden, erleiden zumeist mehr Angriffe. Du solltest deine Helden anhand ihrer Klasse sorgsam positionieren, um ihre Überlebenschance zu steigern.\n\nLagervor- und Nachteile\nDie verschiedenen Lager stehen in einem bestimmten Stärke- und Schwächeverhältnis zueinander. Vor dem Kampf solltest du die Helden in die Formation aufnehmen, die dem Feind möglichst überlegen sind.\n\nAura\nWenn du 6 Helden eines bestimmten Lagers oder 6 Helden aller Lager in der Formation hast, wird eine Aura aktiviert.\n\nSieg oder Niederlage\nDauert ein Kampf länger als 15 Runden, so verliert der Angreifer. Werden alle Feinde innerhalb der Rundenbegrenzung besiegt gewinnst du. Werden alle deine Helden besiegt, so verlierst du.\n\nKampfzahlen\nWeiß - Schaden\nGelb - Lager oder Ausrüstung haben Vorteile\nRot - Glücksschaden\nGrün - Heilung\n\nAngriff\nJe höher der Angriffswert, desto mehr Schaden richtet der Held beim Feind an.\n\nLebenpunkte\nJe höher der LP-Wert, desto länger hält der Held im Kampf durch.\n\nAbwehr\nJe höher der ABW-Wert des Helden ist, desto weniger Schaden können Feinde anrichten.\n\nBewegung\nDer BWG-Wert bestimmt die Angriffsreihenfolge der Helden. Je höher der BWG-Wert, desto früher greift der Held an.\n\nErhöhung des Fähigkeits-Schadens\nDie Erhöhung des Fgt.-Schadens bringt Extraschaden bei Fähigkeitsangriffen.\n\nTreffer\nDer Treffer-Wert legt fest, mit welcher Wahrscheinlichkeit der Held den Feind trifft. Je höher der Treffer-Wert, desto wahrscheinlicher wird der Feind getroffen.\n\nAusweichen\nDer Ausweichen-Wert bestimmt, mit welcher Wahrscheinlichkeit der Held getroffen wird. Je höher der ASW-Wert, desto unwahrscheinlicher wird ein Treffer.\n\nGlückstreffer\nDies ist die Wahrscheinlichkeit für einen GLT. Je höher der GLT-Wert, desto wahrscheinlicher wird ein Glückstreffer.\n\nGlücksschaden\nDer Schaden bei Glückstreffern. Je höher der GSD-Wert, desto mehr Schaden richten Glückstreffer an.\n\nAbwehrbruch\nDieser Wert legt fest, wie viel des feindlichen Abwehr-Wertes ignoriert wird.\n\nKontroll-Widerstand\nDie Chance, mit der einer feindlichen Kontrolle entgangen wird. Je höher Kontroll-Wdst., desto unwahrscheinlicher wird die Kontrolle.\n\nSchadens-Reduktion\nDer Anteil am Schaden, der reduziert wird. Je höher der SD-Reduktions-Wert, desto weniger Schaden richtet der Feind an.",true,"战斗\n\n战前站位\n通常站在前排的英雄比站在后排的英雄更容易受到攻击,您需要根据英雄的职业合理的调整英雄站位,才能使英雄在战斗中存活率提高。\n\n阵营克制\n英雄之间存在阵营克制关系。在战前根据敌人上阵的英雄来调整己方队伍来尽可能发挥出优势。\n\n阵营光环\n上阵6名相同阵营的英雄或是6个完全不同阵营的英雄都将激活强大的阵营光环。\n\n战斗胜负判定\n战斗回合超过15回合将判定进攻方战斗失败。在限定回合内击杀所有对方英雄判定为胜,己方英雄全灭判断为败。\n\n战斗数字\n白色--发生伤害\n黄色--阵营或装备带有克制\n红色--暴击伤害\n绿色--治疗\n\n攻击\n英雄的攻击越高,进行攻击时对敌人造成的伤害越高。\n\n生命值\n英雄的生命值越高,在战斗中存活的时间越长。\n\n护甲\n英雄的护甲越高,敌方对英雄造成的伤害越低。\n\n速度\n速度决定每回合英雄的出手顺序,英雄的速度越高,每回合出手的顺序越靠前。\n\n增加技能伤害率\n增加技能伤害率是对技能伤害的额外加成,增加技能伤害率越高,技能造成的伤害越大。\n\n命中\n命中决定击中敌人的概率,命中越高,击中敌人的概率越高。\n\n闪避\n闪避决定英雄被击中的概率,闪避越高,被敌人击中的概率就越低。\n\n暴击\n触发暴击的几率,英雄暴击越高,触发暴击的几率越大。\n\n暴击伤害\n触发暴击时造成的伤害,英雄暴击的伤害越高触发暴击成功后造成的伤害越多。\n\n破甲\n抵消攻击目标的固定护甲值,英雄的破甲越高,抵消敌人的护甲越多\n\n免控率\n免于被敌人控制的几率,英雄的免控率越高,被敌人控制的几率越低。\n\n减伤率\n减少实际伤害的百分比,英雄的减伤率越高,敌人造成的伤害越低。","Battle\n\nPre-battle Deploy\nFront-line heroes are more likely to get attacked than back-line heroes. Adjust the positioning according to the heroes\' classes so they have the best chance of surviving!\n\nFaction Restraint\nHeroes of different factions restrain each other. It\'s important to adjust your lineup according to the enemy\'s heroes to gain the upper hand!\n\nFaction Aura\n6 heroes of either a same faction or 5 different factions activate a powerful aura.\n\nBattle Rules\nIf the battle lasts for more than 15 rounds, the attacker will lose. The side which manages to kill all opponent\'s heroes within the limited rounds win the battle.\n\nColors of Pop-up Numbers\nWhite: Normal damage\nYellow: Faction or gear restraint\nRed: Critical damage\nGreen: Heal\n\nAttack\nThe higher the Attack, the more damage can be dealt.\n\nHP\nThe higher the HP, the longer the hero can survive.\n\nDefense\nThe higher the Defense, the less damage the hero takes.\n\nSpeed\nSpeed decides the attack sequence of the heroes. The higher the Speed, the earlier the hero makes action.\n\nSkill Damage\nSkill Damage decides the extra damage the skills deal. The higher the Skill Damage, the more damage the skills deal.\n\nHit\nHit decides the chances of attacks hitting enemies. The higher the Hit, the more likely attacks hit the enemies.\n\nDodge\nDodge decides the chances of being hit. The higher the Hit, the less likely being hit by the enemies.\n\nCrit Rate\nCrit Rate decides the chances of launching crit hits. The higher the Crit Rate, the more likely to launch crit hits.\n\nCrit Damage\nThe damage dealt by a crit hit. The higher the Crit Damage, the larger damage is dealt by a crit hit.\n\nDefense Break\nOffsets the target\'s Defense. The higher the Defense Break, the more target\'s Defense is offset.\n\nControl Resist\nDecides the chances of being controlled. The higher the Control Resist, the less likely being controlled by the enemies.\n\nDamage Reduce\nThe percentage of reduced received damage. The higher the Damage Reduce, the smaller damage is received.","ต่อสู้\n\nตำแหน่งก่อนการต่อสู้\nฮีโร่ที่อยู่ในแถวหน้าจะโดนโจมตีง่ายกว่าฮีโร่ที่อยู่แถวหลัง โดยคุณจะต้องปรับตำแหน่งฮีโร่ตามอาชีพของฮีโร่ ก็จะทำให้โอกาสในการรอดของฮีโร่สูงขึ้น\n\nการแพ้ทางของธาตุ\nฮีโร่ในแต่ละธาตุมีทั้งธาตุที่ชนะทางและแพ้ทาง ก่อนเริ่มการต่อสู้ควรตรวจสอบฮีโร่ของศัตรู แล้วจึงปรับฮีโร่ในทีมของคุณเพื่อให้เกิดความได้เปรียบมากที่สุด\n\nธาตุออร่า\nเมื่อในทีมมีฮีโร่ที่เป็นธาตุเดียวกันทั้ง 6 ตัว หรือเป็นธาตุที่แตกต่างกันทั้ง 6 ตัวจะทำให้เกิดธาตุออร่าที่มีพลังมหาศาลขึ้น\n\nการตัดสินแพ้ชนะในการต่อสู้\nถ้าสามารถกำจัดฮีโร่ทั้งหมดของอีกฝ่ายภายในจำนวนรอบที่จำกัดไว้ได้จะถือว่าชนะ แต่ถ้าต่อสู้จนเกิน 15 รอบ ฝ่ายโจมตีจะถูกตัดสินให้แพ้ หรือหากฮีโร่ทั้งสองฝ่ายถูกกำจัดทั้งหมดก็จะถือว่าแพ้เช่นกัน\n\nตัวเลขระหว่างการต่อสู้\nสีขาว -- ความเสียหายที่ทำได้\nสีเหลือง -- ธาตุหรืออุปกรณ์ที่ใส่อยู่นั้นชนะทาง\nสีแดง -- CRI.DMG\nสีเขียว -- รักษา\n\nATK\nพลังโจมตีของฮีโร่ยิ่งสูง ยิ่งสร้างความเสียหายได้มาก\n\nค่า HP\nค่า HP ยิ่งสูง ยิ่งอยู่รอดในการต่อสู้ได้นาน\n\nเกราะคุ้มกัน\nเกราะคุ้มกันของฮีโร่ยิ่งสูง ความเสียหายที่ได้รับจากอีกฝ่ายก็ยิ่งน้อยลง\n\nSPD\nค่า SPD จะเป็นตัวกำหนดลำดับการโจมตีของฮีโร่ในรอบนั้นๆ SPD ของฮีโร่ยิ่งสูง ยิ่งมีโอกาสได้โจมตีเป็นคนแรก\n\nเพิ่มอัตราดาเมจสกิล\nคือการเพิ่มโบนัสดาเมจสกิล ยิ่งเพิ่มอัตราดาเมจสกิลสูง ดาเมจจากสกิลที่ทำก็ยิ่งมาก\n\nHIT\nค่า HIT คืออัตราความแม่นยำในการโจมตีอีกฝ่าย HIT ยิ่งสูง อัตราที่จะโจมตีโดนอีกฝ่ายก็ยิ่งเยอะ\n\nDodge\nค่า Dodge คืออัตราในการหลบการโจมตีอีกฝ่าย Dodge ยิ่งสูง อัตราที่จะโดนอีกฝ่ายโจมตีก็จะยิ่งต่ำ\n\nCRI\nอัตรา CRI ยิ่งสูง ยิ่งมีโอกาสที่จะโจมตีแบบ CRI\n\nCRI.DMG\nคือความเสียหายเมื่อเกิดการโจมตีแบบคริติคอล ค่า CRIT.DMG ของฮีโร่ยิ่งสูง ดาเมจคริติคอลที่ทำได้ก็จะยิ่งเยอะ\n\nทะลุเกราะ\nเป็นการโจมตีเป้าหมายโดยไม่สนเกราะคุ้มกันของอีกฝ่าย ค่าทะลุเกราะของฮีโร่ยิ่งสูง ยิ่งทะลุเกราะได้มาก\n\nRES.Rate\nลดโอกาสในการถูกควบคุมจากอีกฝ่าย RES.Rate ของฮีโร่ยิ่งสูง โอกาสที่จะถูกอีกฝ่ายควบคุมก็ยิ่งน้อย\n\nลดความเสียหาย\nลดเปอร์เซ็นต์ของความเสียหายจริง อัตราลดความเสียหายของฮีโร่ยิ่งสูง ดาเมจที่เกิดจากอีกฝ่ายก็ยิ่งต่ำ",}
