M.Data[360282] = {"Aktive Fgt.: 3 zufällige Feinde erleiden 100% Angriffsschaden. Chance von 12%, Ziele zu verwirren. Dauer: 2 Runden. Chance von 60%, Ziele vom Stärke-Typ zu verwirren. Dauer: 2 Runden.",true,"主动技能：对随机3名敌人造成100%攻击伤害,有12%概率使其眩晕2回合，有60%概率使力量型目标眩晕2回合","Active Skill: Deals damage (100% of Attack) to 3 random enemies with a 12% chance to stun them for 2 rounds; has a 60% chance to stun Strength enemies for 2 rounds.","สกิลแอคทีฟ: สุ่มให้ศัตรู 3 คนเกิดความเสียหาย (100% ของพลังโจมตี) มีโอกาส 12% ทำให้เป้าหมายมึนงง 2 รอบ และยังมีโอกาส 60% ทำให้เป้าหมายประเภท STR มึนงง 2 รอบ",}
