M.Data[134656] = {"Heldentypen\nKlasse\nHelden werden auf Basis ihrer Klasse in die 3 Typen Stärke, Agilität und Weisheit. Stärke-Helden haben hohe LP und ABW, aber niedrigen ANG. Sie eignen sich für die vordere Reihe, um Schaden abzufangen. Agilitäts-Helden haben niedrige LP und ABW, aber hohen ANG. Sie verfügen über starke Gruppen- und Einzelangriffsfähigkeiten. Weisheits-Helden verfügen über Gruppenangriffsfähigkeiten und können das Team heilen.\n\nStern-Lv.\nHelden beginnen mit einem Initial-Sternenlevel. Maximal beträgt dies 5. Je höher das Stern-Lv., desto besser die Basis-Attribute und die Fähigkeiten. Heldenfusion und Erwachen erhöhen das Stern-Lv.\n\nLager\nEs gibt 5 Heldenlager: Feuer, Wasser, Holz, Licht, Dunkel. Wasser ist stärker als Feuer, Feuer stärker als Holz und Holz stärker als Wasser. Licht und Dunkel schädigen sich gegenseitig stark. Unterlegene Lager erleiden 30% mehr Schaden.",true,"英雄的分类\n职业\n英雄根据其职业分为力量型、敏捷型、智力型3种职业。力量型英雄血高防厚但攻击力较低,适合在前排承受伤害；敏捷型英雄生命值、防御较低但攻击力高,技能为群体或单体高爆发攻击；智力型英雄拥有全体攻击的技能或者能治疗友军\n\n星级\n英雄有初始星级。最高为5星。英雄的星级越高,基础属性越高,技能越强。英雄合成和觉醒可以提升英雄的星级。\n\n阵营\n英雄阵营一共划分为火、水、木、光、暗5种阵营。阵营间存在克制关系：水克制火，火克制木，木克制水；光暗相互克制。对被克制的英雄将多造成30%的伤害。","Hero Category\n\nClass\nThere are three classes: Strength, Agility and Intellect. Strength heroes have high HP & Defense but low Attack, making them suitable for taking damage in the front-line; Agility heroes have lower HP & Defense but high Attack, their skills can deal high damage to a single target or multiple targets; Intellect heroes have AOE damage skills or healing skills.\n\nStar Level\nEach hero is born with an initial star level. The highest initial star level is 5. The higher the star level, the higher the basic stats and stronger skills. Star level can be increased by hero fusing in the Temple or awakening.\n\nFaction\nThere are 5 hero factions: Fire, Water, Wood, Light and Dark. Factions restrain each other: Water restrains Fire, Fire restrains Wood and Wood restrains Water; Light and Dark restrains each other. Faction Restraint deals 30% more damage.","ประเภทของฮีโร่\nอาชีพ\nอาชีพของฮีโร่จะแบ่งออกเป็น 3 อาชีพได้แก่ STR, AGI และ INT ฮีโร่สาย STR จะมี HP และพลังป้องกันเยอะ แต่มีพลังโจมตีที่น้อย เหมาะแก่การยืนแถวหน้ารับรับความเสียหาย;ฮีโร่สาย AGI จะมี HP และพลังป้องกันที่ต่ำ แต่ว่าจะมีพลังโจมตีที่สูง และมีสกิลที่ทำความเสียหายได้สูง สามารถโจมตีศัตรูได้ทั้งแบบเดี่ยวและแบบหมู่;ฮีโร่สาย INT เป็นฮีโร่ที่มีสกิลการโจมตีแบบหมู่ และมีสกิลที่ช่วยรักษาเพื่อนในทีม\n\nระดับดาว\nฮีโร่แต่ละตัวจะมีระดับดาวเริ่มต้น โดยระดับดาวที่มากที่สุดจะอยู่ที่ 5 ดาว ระดับดาวของฮีโร่ยิ่งสูง สเตตัสพื้นฐานก็จะยิ่งสูง สกิลก็จะยิ่งแข็งแกร่งขึ้นไปด้วย สามารถเพิ่มระดับดาวได้จากการรวมหรือจากการปลุกพลัง\n\nธาตุของฮีโร่\nธาตุของฮีโร่จะแบ่งออกเป็น 5 ธาตุได้แก่ธาตุไฟ น้ำ ไม้ แสง และมืด โดยแต่ละธาตุจะมีความหักล้างกันคือ ธาตุน้ำจะชนะธาตุไฟ ธาตุไฟจะชนะธาตุไม้ ธาตุไม้จะชนะธาตุน้ำ;ธาตุมืดและธาตุแสงจะหักล้างกันเอง โดยธาตุที่ได้เปรียบนั้นจะเพิ่มดาเมจขึ้น 30%",}
