M.Data[360216] = {"Passive Fgt.: Normaler Angriff auf 3 zufällige Feinde, verursacht 50% Angriffsschaden. Chance von 8% (16% bei GLT), Ziele für 2 Runden einzufrieren.",true,"被动技能：免爆率+100%","Passive Skill: Normal attack attacks 3 random enemies, dealing damage (50% of Attack). And has a 8% chance to freeze them for 2 rounds; when the attack crit has a 16% chance to freeze them for 2 rounds.","สกิลพาสซิฟ: เมื่อโจมตีปกติ จะสุ่มโจมตีศัตรู 3 คนทำให้เกิดความเสียหาย (50% ของพลังโจมตี) และมีโอกาส 8% ทำให้เป้าหมายถูกแช่แข็ง 2 รอบ หากเกิด CRI ก็จะมีโอกาส 16% ทำให้เป้าหมายถูกแช่แข็ง 2 รอบ",}
M.Data[360647] = {"Passive Fgt.: Chance von 100%, bei einem normalen Angriff, dem Ziel ein Glückstreffersiegel zu verpassen, das den eigenen Glücksschaden für 3 Runden um 8% erhöht. Das Siegel verursacht beim Glückstreffer 45% Schaden.",true,"被动技能：普通攻击时有100%几率给目标附加暴击印记,提升自身8%暴击3回合,暴击印记暴击触发后造成45%伤害","Passive Skill: Normal attack adds a Crit Trigger to the target and increases self Crit Rate by 8% for 3 rounds. A crit hit on the target activates the Trigger, dealing extra damage (45% of Attack).","สกิลพาสซิฟ: เมื่อโจมตีปกติ มีโอกาส 100% ทำให้เป้าหมายติดผนึก CRI พร้อมกับเพิ่ม CRI ตัวเอง 8% 3 รอบ และเมื่อปล่อยผนึก CRI โจมตี ทำให้เกิดความเสียหาย (45% ของพลังโจมตี)",}
