M.Data[360407] = {"Aktive Fgt.: 2 zufällige Feinde in der hinteren Reihe erleiden 150% Angriffsschaden und pro Runde zusätzlich 44%. Dauer: 5 Runden. Chance von 50%, das Ziel zu verwirren. Erhöht eigene Schadensvermeidung um 50% für 2 Runden. Trifft immer.",true,"主动技能：对随机2名后排敌人造成150%攻击伤害,每回合额外造成44%攻击伤害,持续5回合,并有50%几率使目标眩晕2回合,增加自己50%免伤率,持续2回合,必中","Active Skill: Deals damage (150% of Attack) to 2 random back-line enemies and deals extra damage (44% of Attack) to them per round for 5 rounds; has a 50% chance to stun them for 2 rounds; increases self Damage Reduce by 50% for 2 rounds. Cannot be dodged.","สกิลแอคทีฟ: สุ่มให้ศัตรูแถวหลัง 2 คนเกิดความเสียหาย (150% ของพลังโจมตี) ทุกๆรอบทำให้เกิดความเสียหายเพิ่ม (44% ของพลังโจมตี) ต่อเนื่อง 5 รอบ และมีโอกาส 50% ทำให้เป้าหมายมึนงง 2 รอบ เพิ่มอัตราป้องกันเกิดความเสียหายตัวเอง 50% ต่อเนื่อง 2 รอบ,",}
