M.Data[360406] = {"Passive Fgt.: Sinken die LP unter 50%, werden 2 zufällige Feinde in der hinteren Reihe verbrannt, erleiden Schaden i. H. v. pro Runde 50% des Angriffsschadens. Dauer: 5 Runden (nur einmal anwendbar). ",true,"被动技能：自身生命低于50%,使随机2名后排敌人燃烧,每回合额外造成50%攻击伤害,持续5回合（只触发1次）","Passive Skill: When HP is below 50%, burns 2 random back-line enemies, dealing extra damage (50% of Attack) per round for 5 rounds (Can be triggered once only per battle).","สกิลพาสซิฟ: เมื่อ HP ตัวเองต่ำกว่า 50% จะสุ่มให้ศัตรูแถวหลัง 2 คนถูกไฟไหม้ ทุกๆรอบเกิดความเสียหายเพิ่ม (50% ของพลังโจมตี) ต่อเนื่อง 5 รอบ (ปล่อยสกิลได้เพียง 1 ครั้ง)",}
