M.Data[40014] = {"1. Yggdrasilfrüchte findest du u. a. in Aktionen, beim Entdecken und auf dem Markt.\n\n2. Mit 1 Yggdrasilfrucht kannst du eine Beschwörung in einem Lager durchführen.\n\n3. Du hast die Chance, Teile von 4- oder 5-Sterne-Helden (inkl. fusionierte 5-Sterne-Helden) dieses Lagers oder zufällige 4- oder 5-Sterne-Heldenteile zu erhalten.\n\n4. Bei jeder Beschwörung entstehen Yggdrasilteile, die zum Umwandeln von Helden benötigt werden.",true,"1.世界树果实通过活动、酒馆、市场购买获得。\n\n2.消耗1个世界树果实对应的进行一次指定阵营召唤。\n\n3.有几率获得对应阵营的4星英雄碎片,5星英雄碎片(包含合成的5星英雄),4星随机碎片,5星随机碎片。\n\n4.每次召唤将额外产生一定数量的世界树碎片,该道具用于英雄置换。","1. World Tree Fruits can be gained from Events, Explore Quests or Shop.\n\n2. One World Fruit is consumed to perform a Summon of a specific Faction.\n\n3. World Tree Summon grants 4-star/5-star Hero Shards of the corresponding Faction (including the 5-star heroes that can only be gained from the Temple), or random 4-star/5-star Hero Shards.\n\n4. Each summon also grants some World Tree Shards, which can be used for hero conversion.","1.ผลไม้ต้นไม้โลกหาได้จากกิจกรรม เควสสำรวจ หรือซื้อจากร้านค้า\n\n2.ใช้ผลไม้ต้นไม้โลก 1 ลูกเพื่ออัญเชิญตามธาตุที่กำหนด\n\n3.การอัญเชิญจะมีโอกาสได้รับเศษฮีโร่ 4 - 5 ดาวตามธาตุที่สอดคล้องกัน (รวมไปถึงฮีโร่ 5 ดาวด้วย) หรือเศษฮีโร่ 4 - 5 ดาวแบบสุ่ม\n\n4.ทุกครั้งที่อัญเชิญจะได้รับเศษต้นไม้โลก ไอเทมนี้ใช้สำหรับการแปลงฮีโร่",}
